 ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-04-18 15:33:01', '2017-05-10 16:34:40', 'b9fea62a-169f-4a81-a73b-ffa266ede7bd'),
 ('2', '2', 'en_us', 'Home', '<p>If you are a high school student planning your future, then Kent Roosevelt Career Technical programs is the place for you!  Learn in our high-tech facility from instructors with real-world experience. The Kent Roosevelt High School Career Technical programs are open to students within the Six District Educational Compact. </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, 'This is information about when we\'re accepting applications and why you should apply today.', 'How To Apply', NULL, NULL, NULL, '1', 'News', 'Explore Career Paths', 'Welcome to Kent Roosevelt', NULL, NULL, NULL, NULL, 'Career Technical Education', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-04-18 15:33:03', '2017-11-12 01:22:08', '35ea2da5-4e56-4a77-aca1-2b79c89ab6b8'),
 ('4', '4', 'en_us', 'Explore Programs', '<p>Theodore Roosevelt High School Career Technical Education is a member of the Six District Educational Compact. The Six District Educational Compact offers 25 career-technical programs. All Six District Educational Compact programs, with the exception of auto specialization, provide opportunity for students to earn College Tech Prep status. </p>\n<p>For more information about all the Six District Educational Compact Career Technical Education programs visit <a href=\"http://www.sixdistrict.com/\" target=\"_blank\" rel=\"noreferrer noopener\">www.sixdistrict.com</a>. </p>\n<p>Contact Brian Bachtel, Career-Technical Director, or Edna Hensel, CTE Administrative Assistant, at (330) 676-8740 to learn more about starting your career this year.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'https://www.youtube.com/watch?v=WY5vOpp9x6M', NULL, 'Six District', NULL, NULL, NULL, '2017-04-20 13:30:32', '2017-11-03 02:52:28', 'a251479c-0708-429a-82d6-fba5e4dc3689'),
 ('5', '5', 'en_us', 'Faculty & Staff', '<p>Hello hello hello</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-04-20 13:30:45', '2017-10-30 02:35:57', '25b21532-9731-4ffc-8f59-f5dd0a4c1b63'),
