 ('54', '60', 'en_us', 'Forestry and Landscape Management', '<p>Concerned about the environment?  Interested in ecology?  In Forestry and Landscape Management, students learn about scientific identification of trees and plants, as well as landscaping design, construction and maintenance.  Students are prepared for further education in fields like Turf Management, Arboriculture, Landscape Construction or Nursery Management.  College Prep English includes writing assignments about plant science, career opportunities in the “Green Industry” and other industry-related topics.A strong advocate of problem based learning with an emphasis on authentic, hands on, science based application, John promotes, and executes realistic, fundamental lessons in a huge variety of project based learning applications in the Green Industry. Many activities are a variety of community service projects emphasising plant identification, landscape construction and maintenance, and tree and turfgrass propagation, growing, and health care. <br /><br />Classes are taught outdoors as much as possible and educational field trips are added to create dynamics in learning. Some of the traveling a student may experience is ( but not limited to ), traveling to other schools to work with science classes, going to City, County, and State Parks, participating in invasive plant identification and eradication and helping to replace plant species with native material. Classes are also visiting forests and lumber mills, working on golf courses, visiting large and small landscape design and building firms, attending turfgrass commercial equipment sales events, developing relations in business by visiting plant propagation and greenhouse facilities, investigating tree care and landscape maintenance businesses, visiting plant pathology labs studying insect and diseases, looking at mechanical engineering and agricultural repair shops, making occasional trips to farms that produce fruits, vegetables, Christmas trees,row crops, and nursery production.<br /><br />When class can not be held outdoors, indoor instruction is geared toward personal communication and marketing skills, plant fertility, soil science, plant identification, and hand/ power tool usage and repair.<br /><br />Alumni of the program have  gone on to have successful traditional Green Industry careers such as designing and managing golf courses, becoming entrepreneurs in landscape construction companies, turf grass and athletic field installation and maintenance, plant health care technicians, US Forest Service employees, Parks and Recreation managers, tree care, and even running plant pathology labs.  <br />Others students have successfully taken other non traditional destinations after graduation such as investment bankers, ski area managers, performers in acrobatic gymnastics and climbing, NHRA crew chief to name a few.These students have all suggested  that Forestry and Landscape class created the foundation in their lives for working as a team, understanding how to think and memorize, develop personal communication skills, time management, creative expression, and problem solving in difficult situations.<br /></p>\n<p>If you are interested in working outside with plants and turf, this program may be for you.  If you complete the Forest and Landscape Management program, you could be employed in various careers found in the “Green” industry.  You will have an opportunity to study first hand, given a work-based experience, between three and five major fields of study during the first year of the program.  In the second year, you will concentrate on one area, attending class for approximately 50 minutes a day and working three to four hours a day in your area of interest.</p>\n<ul><li><p>Golf course management </p></li><li><p>Forestry</p></li><li><p>Urban Forestry</p></li></ul>', NULL, NULL, NULL, NULL, NULL, '<p>Level I – English 1; Tech Theory 1; Lab 2;<br /></p>\n<p>Level II – English 1; Tech Theory 1; Lab 3; Internship 1</p>', '10, 11, 12', 'Kent', 'Two years', '1', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '2017-05-10 16:18:30', '2017-11-13 02:27:44', 'ee25f492-a295-4cca-b0bb-44f336c09f0c'),
 ('55', '62', 'en_us', 'Business and Sports Management', '<p>This College Tech Prep Initiative develops skills and knowledge in the field of business, sports management and marketing, human resource management, facilities and operations management, sales, and public relations. Students will acquire knowledge of business processes, economics and business relationships, finance, and accounting.   Students will learn how to manage a workforce, lead change and build professional relationships with employees and customers. Students will utilize technology, software, and virtual simulations to prepare for careers in the business and sport management fields.  Worksite and facility visits to professional, collegiate, and recreational sports and management will be integrated into the program. All students are provided opportunities for leadership development through the Business Professionals of America national student organization. College credit is available through university partnerships.</p>', NULL, NULL, NULL, NULL, NULL, '<p>Level I:  CP English-1; Theory-1; Lab-1; and optional Capstone*-1<br /></p>\n<p>Level II: CP English-1; Theory-1; Lab-1; and optional Capstone*-1</p>', '10, 11, 12', 'Kent', 'Two years', '1', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '2017-05-10 16:19:00', '2017-11-13 02:12:30', '82f39dd3-99cb-41e1-a94c-591b2d988f08'),
