 ('57', '64', 'en_us', 'Construction Technologies', '<p>Students interested in working hands on with machinery, hand and power tools and who want to learn skills they can use on-the-job or in their own home should consider being apart of this excellent program.  Emphasis is placed on both rough and finished carpentry with introductions to plumbing, masonry, cabinetry and residential wiring.  Working in the lab, students will learn by constructing with their hands in order to build a strong foundation for a career in the building trades.  Students that have completed this course have entered apprenticeships, entered two-year and four-year college programs in Construction Technology, Construction Management, Surveying and Architecture, started their own construction businesses or worked as building and property maintenance personnel, as well as carpenters for contractors and builders.<br /></p>\n<p>In Level 1, students are introduced to many aspects of construction including remodeling, estimating, framing, roofing, exterior finishing, interior finishing, cabinets, countertops and trim work. By applying math, science, communication and team building skills, students construct real-life application projects in the spacious lab while also learning to operate a wide range of hand, power and air tools. Because the class focuses on residential construction, students learn to build from floor to roof, which helps prepare them for a career in the construction industry. The construction process introduces them to basic electrical, plumbing and masonry work. In Level II, students have the opportunity to complete a paid internship with contractors on actual</p>\n<p>job sites. Completers of this program have entered apprenticeships, enrolled in two- and four-year colleges and worked for a contractor or builder as a carpenter. Many have even started their own construction business! Post-secondary credits available based on successful completion of the program and criteria set by the Ohio Department of Higher Education.</p>', NULL, NULL, NULL, NULL, NULL, '<p>Level I: CP or Comp English 1; Construction Tech IA (Construction Safety) 1.5; Construction Tech IB 1.5.<br /></p>\n<p>Level II: Construction Tech IIA 1.5; Construction Tech IIB 1.5. Optional Capstone* 1. (*Capstone includes project/problem-based learning opportunities that occur both in the building and at an external site. Students may combine classroom teaching with work experience.)</p>', '10, 11, 12', 'Kent', 'Two Years', '1', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '2017-05-10 16:19:43', '2017-11-13 02:12:40', '588f0402-0fcb-4020-a25a-0c525313a3f4'),
 ('58', '65', 'en_us', 'Teaching Professions', '<p>The Teaching Professions’ program is designed for students who are interested in a teaching, school administration, or guidance counseling career.  This career pathway will help students learn more about future career options, while their field experience and coursework provide a solid foundation for a successful teaching career.  Students will develop a professional portfolio that will summarize their field and classroom experiences.  Due to the high percentage of teachers approaching retirement age in the next 5 years, it is estimated that more than 2.5 million teachers will be needed in the U.S. and about 57,000 K-12 openings in Ohio.<br /></p>', NULL, NULL, NULL, NULL, NULL, '<p>2, plus one credit for Advanced English</p>', '10,11,12', 'Kent', 'Two years', '1', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '2017-05-10 16:20:53', '2017-11-13 02:34:30', 'ef589e4c-4bea-44b3-b57f-f2b2464602d4'),
 ('59', '66', 'en_us', 'Electronics, Robotics, and Programming', '<p>Career opportunities are abundant and increasing in the fields of electronics, robotics and programming. This program will provide students with great preparation in theory and hands on experience. Transistor circuits, amplifiers, LED lighting and soldering projects are<br /></p>\n<p>included. Vex robots are built and programmed with C language. BASIC language is used for parallax robots and LED displays. Video game programming is offered, computers are assembled and software installed. Students who complete the Electronics, Robotics and Programming College Tech Prep Initiative will have the opportunity to continue their studies in post-secondary education, enhance their skills in the military or directly enter the workforce. </p>', NULL, NULL, NULL, NULL, NULL, '<p>Level I: Electronics, Robotics and Programming IA 1, Electronics, Robotics and Programming IB.<br /></p>\n<p>Level II: Electronics, Robotics and Programming IIA 1, Electronics, Robotics and Programming IIB.</p>', '10, 11, 12', 'Kent', 'Two Years', '1', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '2017-05-10 16:21:20', '2017-11-13 02:09:52', '2655b7df-3787-478d-b167-51c98ab6ab87'),
 ('60', '67', 'en_us', 'Engineering Academy', '<p>This two-year College Tech Prep Academy combines academically competitive, college prep courses with hands-on technical studies. Students rotate through four technology areas-computer-aided design, (CAD), electronics, robotics &amp; programming, manufacturing processes and polymers. ¾ of the program is at Theodore Roosevelt High school and ¼ of the program is at Stow-Munroe High School.<br /></p>\n<p>College prep courses in English, Algebra II or Honors/Adv. Algebra II, Pre-Calculus or Honors/Adv. Pre-Calculus, Calculus, AP Calculus, and Adv. Physics I and II are linked with the technology curriculum. University partners include Cleveland State University and The University of Akron.</p>\n<p>Various instructional approaches are used, including team teaching, work teams, self-directed studies, and project-based learning.  Benefits of this program include: exposure to key elements of various aspects of engineering; practical content for future college engineering courses; work with experienced engineers; and extra-curricular opportunities with regional competitions.<br /></p>', NULL, NULL, NULL, NULL, NULL, '<p><br /></p>\n<p>Level I – English 1; Tech Theory 1; Lab 2; </p>\n<p>Level II – English 1; Tech Theory 1; Lab 3; Internship 1</p>', '10, 11, 12', 'Kent', 'Two Years', '1', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '2017-05-10 16:21:42', '2017-11-13 02:09:58', '2b7e5fd5-a21f-4fa5-87ed-9aed65896491'),
 ('61', '68', 'en_us', 'Computer Aided Design and Engineering Technologies', '<p>Redefine what is possible through CAD &amp; Engineering Technologies! Students will use the latest industry standard software and equipment to produce working drawings, 3D solid model designs, parts and assemblies. Additionally, students will have the opportunity to program and operate CNC machines (router, lathe, mill and water jet) to produce manufactured products using wood, metal, and plastic. Students will also operate rapid prototype machines (3D printer) laser engraver in fabricating various engineered and designed products. Manufacturing and welder processes and industries will be explored. This exciting, professional College Tech Prep offering is designed to prepare students for careers in the engineering, advanced manufacturing and architectural career fields. Students will network with industry experts and partners in high demand career fields. Senior level internships/industry placement opportunities are available to qualified students. Advanced technologies, coupled with the need to update and improve manufacturing facilities and product design, should fuel the demand for professionals in computer-aided manufacturing, architecture, and engineering technologies. According to the latest data 7,400 jobs within a 100 mile radius of Akron, Ohio currently exist. Upon successful completion of the program, students will be eligible to earn up to 3 college credits (CTAG) to any Ohio public university for Computer-Aided Drafting and Design in an Engineering Technology program.</p>', NULL, NULL, NULL, NULL, NULL, '<p>Level I: CP or Comp English 1; CADET IA 1; CADET IB 1.<br /></p>\n<p>Level II: CADET IIA 1.5; CADET IIB 1.5. Capstone* 1. (*Capstone includes project/ problem-based learning opportunities that occur both in the building and at an external site. Students may combine classroom teaching with work experience.)</p>', '10, 11, 12', 'Kent', 'Two Years', '1', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '2017-05-10 16:22:06', '2017-10-23 14:27:43', '28025516-6f43-42d8-a849-2fc50a244d9a'),
 ('62', '69', 'en_us', 'Athletic Health Care Fitness', '<p>Are you looking for an educational experience that is fun, exciting and fast-paced?  Look no further than Athletic Health Care and Fitness.  This program will provide knowledge and real life experiences in recognizing, initially treating and rehabilitating athletic injuries.  Under the direction of a licensed athletic trainer, students will assist injured athletes from the onset of injury to their full return to competition.  Students will also learn about prevention of injury through the practice of proper sports nutrition, conditioning and weight training.  Learning about the proper use and selection of sports related equipment will also provide students with knowledge and experience in injury reduction.  The Athletic Health Care and Fitness Program will help you select and prepare for a future in fitness or a variety of health related careers.</p>', NULL, NULL, NULL, NULL, NULL, '<p>Level I – Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.</p>\n<p>Level II – Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.</p>', '10, 11, 12', 'Kent', 'Two Years', '1', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'https://www.youtube.com/watch?v=izOY_EUycfI', NULL, NULL, NULL, NULL, NULL, '2017-05-10 16:22:32', '2017-10-31 03:11:54', '61f4d258-c1c4-4b68-8b2c-0a1ed2961197'),
 ('63', '70', 'en_us', 'Health Care and Technologies', '<p>Since many health careers require further education, students will be prepared for post-secondary studies in their area of concentration.   Health Careers Technologies students will learn clinical skills that are utilized in a variety of occupations in the medical field.  Students learn basic health care skills, medical laboratory processes, physical therapy techniques and clinical techniques. Additional coursework is provided in anatomy and physiology, medical terminology, nutrition, infection control, and legal/ ethical issues. This program places an emphasis on helping students shape their own future by providing them with a wide range of entry-level skills and knowledge. Certification is available AHA CPR-AED for the Health Care Provider</p>', NULL, NULL, NULL, NULL, NULL, '<p>Level I – Anatomy and Physiology 1 ; CP English 1; Tech Theory 1;  Lab 1.<br /></p>\n<p>Level II – Tech Theory 1; Lab 2; CP English 1; Internship 0.5 – 3 </p>', '10, 11, 12', 'Kent', 'Two Years', '1', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '2017-05-10 16:22:54', '2017-10-23 14:28:30', '2553c623-71c0-4865-a95a-fe74b6123970'),
 ('64', '71', 'en_us', 'Cosmetology', '<p>If you are artistic and interested in hair styling, makeup analysis and nail care, here’s a program that allows you to apply your talents and your interests.  Instructors and students are kept up to date in this rapidly changing profession by attending shows and conferences, hosting guest artists and participating in competitions.  As soon as you complete this two-year program you can apply to take the State Board exam and become a licensed Cosmetologist.  You’ll be qualified for immediate employment, performing professional grooming services related to the care of hair, skin and nails.  Who knows — some day you could become a famous make-up artist or a salon owner!<br /></p>', NULL, NULL, NULL, NULL, NULL, '', '10, 11, 12', 'Kent', 'Two Years', '1', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '2017-05-10 16:23:20', '2017-10-16 18:48:22', '5d309694-f6b0-4279-a076-01ac7739bc91'),
