 ('88', '95', 'en_us', 'Franek', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-06-27 17:33:32', '2017-09-08 14:47:53', '099abd7b-4311-431b-8102-3d7680e42259'),
 ('89', '96', 'en_us', 'Tom Franek', '<p>As an instructor of  Forestry and Landscape Management for 16 years at Kent Theodore Roosevelt High School, I\'ve enjoyed the mix of teaching new skills and knowledge along with providing the ability to apply these skills and knowledge on real job sites in the community.   It provides for a very fulfilling career.</p>\n<p>I believe that careers related to this field provide and promote an active, healthy and happy lifestyle and a very high quality of life.  As part of the program, I advocate living healthy by emphasizing safe working habits, proper diet and sleep habits, and involvement in activities that promote fitness.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_tfranek@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-06-27 17:33:59', '2017-10-19 21:42:49', '56869bf1-73c5-4577-a819-975e2146673d'),
 ('90', '97', 'en_us', '1 White Red Condensed', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-06-27 19:20:39', '2017-06-28 19:58:49', '73738417-55b0-46ef-9bc6-40cab93ace0a'),
 ('92', '99', 'en_us', 'Terry Slattery', '<p>Terry Slattery is the primary instructor for both the Level I and Level II Athletic Health Care and Fitness career technical education program at Theodore Roosevelt High School.  He has lead this 2-yr program since its design and inception into the Six District Educational Compact in 1997.  Over 400 students have completed the 2-yr program requirements with approximately 80% of these graduates currently working or studying within the field of health care today.  Terry received his B.S. in Health Education and Athletic Training from Bowling Green State University.  He has completed graduate credit hours at both Central Michigan University and Kent State University.  Terry also serves as the Head Athletic Trainer for all of the Roosevelt Rough Rider athletic teams.  He was awarded the 2013 Ohio Athletic Trainers Association (OATA) Linda Weber-Daniels Student Mentorship Award for his work with high school students interested in health care professions.  He was also recognized by the OATA in 2003 as the Ohio High School Athletic Trainer of the Year and a Special Consideration award for successfully performing CPR on an unresponsive person at a Kent State University basketball game.  Slattery has collaborated with the Six District Educational Compact, Kent State University, University of Akron, Slippery Rock University, and the Ohio Department of Education in curricular design and assessment testing.  He and his students have also worked with Northeast Medical University (NEOMED) and AmeriCorp on a number of educational projects and was recognized as the 2016 Health Professions Affinity Community (HPAC) Teacher of the Year.  Slattery was also honored by the Kent City Schools as an Emilio Ferrara Service Award winner in 2014.  A strong advocate for hands-on, inquiry-based problem solving, he works hard with his students to provide them with a variety of tools to make learning enjoyable and applicable to their personal needs and objectives.  </p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_tslattery@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:31:38', '2017-10-19 21:42:40', 'd36cb3d6-831d-488b-87f1-0930cc053033'),
 ('93', '100', 'en_us', 'Ben Dunlap', '<p>Ben Dunlap received a B.A. in Business Education and a M.A. in Sports Administration both from Kent State University. He currently teaches the Business and Sports Management program  at Theodore Roosevelt High School in Kent, Ohio. A strong advocate of hands-on, inquiry-based learning, he involves his students in a variety of community service, problem-solving, and technology-infused activities that provide them with opportunities to use their expanding business knowledge and skills to work through various virtual businesses. His professional interests focus on ensuring all of his students understand the vast opportunities available to them in the Sports Management field. In addition, he serves as department chairperson for the Career and Technical Education department at Roosevelt as well as Faculty Manager for its athletic department.  <br /></p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_bdunlap@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:32:18', '2017-10-19 21:43:26', 'c59339c8-5904-4888-bf0c-1057a8f94e25'),
 ('94', '101', 'en_us', 'Troy Spear', '<p>Troy Spear is level I instructor for the Computer Aided Design and Engineering Technologies career technical program at Theodore Roosevelt High School.  Mr. Spear is the sole instructor for the elective courses: Fundamentals of Wood and Metal Manufacturing, and Advanced Cabinetry.  He received his Master of Arts in Industrial Technology from Kent State University after completing his undergraduate B.A. degrees in English, Speech, Theatre and Education from the University of Sioux Falls in Sioux Falls, South Dakota.  Spear is also a member of the Society of Manufacturing Engineers, the Cabinetmakers Association, Woodwork Career Alliance and Skills USA.  His commitment to hands-on, inquiry based problem solving and learning fosters an active learning environment where students are physically engaged in the work that they are learning about; be it setting up and operating machines, making accurate technical drawings and renderings or writing programs to run on the CAD &amp; Engineering Tech programs CNC machines.  Spear’s goal is that his students demonstrate knowledge and the application of real world knowledge they gain to solve tomorrow’s problems.  He states that if students can dream it we can show them how to draw it, design it, prototype it, machine it, put it together and make it work.<br /></p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_tspear@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:33:25', '2017-10-19 21:42:58', '7e1dd840-2a8e-4799-acf9-c26ae1caea5b'),
 ('95', '102', 'en_us', 'Don Titko', '<p>Don Titko received a Bachelors Degree in Industrial Arts Education from Kent State University in 1983. In addition, he received his Masters Degree in Vocational Education from Kent State University in 2001. During his career, Don has spent many years in business and industry from management positions within a fortune 500 company to a construction business owner for 15 years prior to coming to Theodore Roosevelt High School. His strong beliefs in work ethic, pride in your work and craftsmanship resonate throughout his program. Instilling characteristics of accountability, responsibility, honesty, and respect allow students to grow in many ways beyond their technical training and education.  Don is an advocate for the importance of students giving back to their community.  This is reinforced through community service projects constructed in the program each year. To quote Don, \"People forget how fast you did a job—but they remember how well you did it.\"<br /></p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_dtitko@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:34:01', '2017-10-19 21:40:17', 'dcfa0558-761e-4586-95f0-37d30f833334'),
 ('96', '103', 'en_us', 'Sandi Melucci', '<p>Sandi Melucci received her degree from Kent State University in Career Technical Education and is currently teaching Cosmetology at Theodore Roosevelt High School.  A strong advocate for hands-on learning and involves her students in hair competitions, professional hair shows and personal in salon training from various licensed professionals in the field of Cosmetology. As she believes in involvement in school and community activities her students are presently preparing for RHS annual craft show as well as working behind the scenes for the theater.    </p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_smelucci@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:34:30', '2017-10-19 21:42:20', 'b8924394-780d-4b61-a264-8ae32f84c3d9'),
 ('97', '104', 'en_us', 'Danielle Wardell', '<p>Danielle Wardell received her Cosmetology license in 2005 from Theodore Roosevelt High School and then her bachelor’s degree in Spanish education from the University of Akron in 2010. After six years teaching Spanish, Danielle changed professions, returned to TRHS, and is currently the senior level Cosmetology instructor. She is a strong believer in hands-on, kinesthetic learning. She believes that communication is one of the most valuable skills in the salon and she focuses much of her teaching to that skill.  Another valuable skill she tries to convey to her students is the importance of the community. Danielle’s students perform hair, skin, and nail services on members of the community at Rider Salon as well as sponsor a craft show every November for the city of Kent. Danielle is also an active member of Theodore Roosevelt High School acting as the Junior Class advisor and silent auction chair.<br /></p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_dwardell@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:34:58', '2017-10-19 21:39:58', '16776f2d-c521-460d-a706-02f67781255d'),
 ('98', '105', 'en_us', 'Jeff LeSueur', '<p>Jeff LeSueur is an electronics instructor at Theodore Roosevelt High School in Kent, Ohio.  He teaches both an engineering class and a traditional career education class.  Jeff holds degrees in Electrical Engineering (Cleveland State University) and a Master’s of Education (John Carroll University).<br /></p>\n<p>He believes that teachers must use materials that engage the students.  Lessons should be directly applicable to the real world and skills should be developed that are useful in life and employable.  This must be done while still finding and inventing lessons that are <em>interesting</em> to students.  Many materials should be used: project kits, videos, programming, field trips, student centered activities as well as traditional lab experiments and theory.  Lessons should be evaluated for success regularly and updated frequently.  This philosophy led Jeff to the design of the Awesome Cube and other innovative lessons.  </p>\n<p>Prior to teaching, Jeff worked in the telecommunications industry as a systems engineer, sales engineer, and consultant for several companies including Fujitsu, NASA, American Greetings and General DataComm.</p>\n<p>Jeff has many interests.  He is a performing jazz guitarist, equity investor, golfer, skier, boater, and biker.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_jlesueur@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:35:31', '2017-10-19 21:40:58', 'e7928295-0925-4cf9-b4fc-d04c8a4ffd18'),
 ('99', '106', 'en_us', 'Ed Borsuk', '<p>#</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'st_borsuk@smfcsd.org', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:36:14', '2017-10-19 21:40:29', '317c7f2e-049a-4655-9812-92c326e9b63f'),
 ('100', '107', 'en_us', 'Laura Eyring', '<p>Laura Eyring received a B.S. in Aerospace Engineering from Embry-Riddle Aeronautical University, a B.S. in Secondary Math Education from Southeast Missouri State University, and a M.A. in Career-Technical Education from Kent State University and is currently teaching Computer Aided Design, Pre-Calculus, Advanced Pre-Calculus, and College Math Fundamentals at Theodore Roosevelt High School.  A strong advocate for showing students the real-world, relevant connections in mathematics as well as in Computer Aided Design, she involves her students in activities and projects that reflect those connections.  Her professional interests focus on the ever-changing and quickly-advancing world of 3D prototyping.  She serves as an instructor for the Engineering Academy, part of the Six District Educational Compact.<br /></p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_leyring@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:36:43', '2017-10-19 21:41:54', 'b19bae40-1180-426e-849a-1aa68836bc3e'),
