 ('106', '113', 'en_us', 'Dan Syvanych ', '<p>#</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'st_dsyvanych@smfcsd.org', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:40:12', '2017-10-19 21:39:48', 'a07a50d5-1478-4f46-83bd-18424750d926'),
 ('107', '114', 'en_us', 'John Lang ', '<p>John Lang, an instructor for Forestry and Landscape Management received a degree.in Horticulture from Ohio State, is a Certified Arborist from The International Society of Arboriculture, is a Certified Commercial Pesticide Applicator from the Ohio Department of Agriculture, and holds a class A, commercial driver\'s license from the Ohio Bureau of Motor Vehicles, and owner and operator of Mogul Creek Farms in Kent Ohio.<br /><br />Lang is also involved in the United States Ski Association, he is a nationally certified alpine and nordic ski instructor, examiner emeritus. He is starting his thirty fourth year in marketing and sales for  Volkl skis, Marker bindings, and Dalbello ski boots. He alo is a certified ski mechanic, boot fitter and sponsored skier. Many students have supplemented their employment in the snowsports industry by taking Lang\'s class.<br /><br />Lang is also an accomplished percussionist playing drums and singing for several rock and jazz fusion bands over the last forty years.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_jlang@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:41:31', '2017-10-19 21:41:17', '8fb171b1-1e2b-4c22-9fe2-192c1f83d42b'),
 ('108', '115', 'en_us', 'Catie Milton ', '<p>Catie Milton received her BSN (Bachelor of Science in Nursing ) and MEd (Master of Education) from Kent State University and is currently one of the instructors for  the Health Careers Technologies Program at Kent Roosevelt High School.  Catie is a certified American Heart Association instructor and teaches CPR. When she is not teaching , Catie cares  for infants and their families at University Hospital’s Rainbow Babies &amp; Children’s Hospital  as an RN on the NICU Step-down and NICU. She has also worked  in Akron Children’s Hospital NICU and at The Hattie Larlham Foundation as a nursing supervisor.  As  a registered nurse, Catie is uniquely qualified to bring current skills and practices into the classroom setting. The classes she teaches, Principles of Allied Health and Nursing and Patient Centered Care consist of both theory and lab activities where students can apply what they have learned using up to date medical equipment found in hospitals  and other healthcare facilities. As part of the Health Careers  program, Catie is the advisor for the Health Careers Tech Club and assists students in planning and implementing many service projects that benefit the local community such as creating quilts for patients undergoing chemotherapy, helping with the Red Cross Blood Drive and raising money for the Northeastern Ohio Leukemia and Lymphoma Society. Catie lives in Brimfield, Ohio  and is an active member of Newman Center parish. She volunteers  at the Kent Soup Kitchen and with UH Community Partners at various events such as the Cleveland Brown’s Camp and Boo at the Zoo in Cleveland.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_cmilton@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:42:27', '2017-10-19 21:39:34', '11e4f787-4721-4ae1-8abd-997cb7a640d5'),
 ('109', '116', 'en_us', 'Angela Textor ', '<p>Angela is an instructor for Health Careers Technoligies.   Angela started her career at Theodore Roosevelt High School in the fall of 2011.  Prior to coming to Kent Roosevelt, Angela was a staff member in the Athletic Training Department at Kent state University.  During her time at Kent State she worked primarily with Women’s Gymnastics, Cross Country and Softball, while also serving as the insurance coordinator for athletics.  Angela has a vast amount of clinical experience and was a staff member of Crystal Clinic Inc. as an orthopaedic physician assistant for 11 years.  Her primary responsibilities were assisting William Pakan, MD. with the evaluation and treatment of patients, as well as assisting in the operating room for outpatient procedures. Angela received her Bachelors of Arts in Education in 1993 from Kent State University and a master’s degree in Career Technical Education in 2013.   Angela is an approved Clinical Instructor and is an instructor in CPR/First Aid/AED training.<br /></p>', NULL, NULL, NULL, '330', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_atextor@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:42:56', '2017-10-31 01:17:21', 'ae5ff206-875b-40f0-a8dd-d2b115515e75'),
 ('110', '117', 'en_us', 'Brent Pfeiffer  ', '<p>Brent Pfeiffer, a life-long resident of Kent, Ohio, is a third generation marketing educator and DECA advisor. Brent is a 1989 graduate of Theodore Roosevelt High School in Kent and a 1994 graduate of Kent State University; Pfeiffer also received his M.Ed. in 2004 from Kent State. Upon graduating from Kent, Brent used his marketing degree to pursue a career in sales working with John Hancock Financial Services and MCI Telecommunications before following the family legacy of teaching after his father’s untimely death in 1995.</p>\n<p>Pfeiffer’s grandfather Paul was an Emeritus marketing professor at Kent State University and his great-uncle, Kenneth (Paul’s brother), was the State Supervisor of Distributive Education and DECA in Pennsylvania for most of his career. Brent’s father, Richard, founded Roosevelt’s award-winning Marketing and DECA program in 1967.  During Brent’s tenure, the program has grown from a one-year program to a two-year program that has been internationally recognized as one of the top programs for entrepreneurial studies. During his 20 year tenure, Pfeiffer’s students have raised close to $500,000 for school, community, and philanthropic projects.</p>\n<p><br />Throughout his career, Pfeiffer has worn many hats; he has worked as an assistant golf professional at area golf courses for 15 years, and has coached golf at Roosevelt for 18 years where he led the Rough Riders to seven consecutive league titles. Brent is also an assistant ice hockey coach at Roosevelt where he just finished his tenth season as an assistant with the team. He currently works part-time for the TaylorMade Golf Company in outside sales with his twin brother, David. </p>\n<p><br />Pfeiffer has also spent time as an adjunct professor in Kent State’s Center for Entrepreneurship and Business Innovation where he served as an advisor for Kent State’s chapter of CEO, the Collegiate Entrepreneurs’ Organization. During his six year tenure in the College of Business, Pfeiffer was twice nominated by his students for the Part Time Distinguished Teaching Award. Brent also worked as a small business advisor in the Entrepreneurship Lab at the Center for Entrepreneurship, assisting student entrepreneurs with their student-run businesses. Pfeiffer has also taught adjunct in the College of Education at Kent State as well.</p>\n<p><br />Committed to public service, Pfeiffer has volunteered on numerous boards, including fifteen years on the Ohio DECA Executive Council and Board of Directors, three years on the Kent Cyclones Youth Hockey Board of Directors, and is currently on the Advisory Board for Kent State’s LaunchNET, an entrepreneurial initiative that provides counseling to students, faculty, and alumni looking to bring ideas, inventions, and businesses to life. Pfeiffer has also served on Ohio Department of Education curriculum and assessment boards to develop the statewide entrepreneurship curriculum standards and testing. Most recently, he has served on an international panel of teachers and professors for DECA’s Competitive Events Task Force which was tasked with the revision, addition, modification, and improvement of DECA’s entrepreneurship events.</p>\n<p><br />Brent and his wife of 23 years, Erika reside in Kent with their two children, Paige and Coulter.<br /></p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_bpfeiffer@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:43:26', '2017-10-19 21:43:36', 'd54c6394-ea13-4ac0-beae-fa89c0252040'),
 ('111', '118', 'en_us', 'Rhonda Butler-Carson', '<p>Rhonda Butler Carson received a B.A. in Comprehensive Business Education from the University of Akron as well as a Masters of Education from Kent State University.  Currently, she is the instructor for the Teaching Professions program serving students in the Six District Educational Compact.  A strong advocate of hands-on and inquiry-based learning, she involves her students in a variety of problem-solving and technology-infused activities that provide them with opportunities to use their skills to both learn and teach others. Her professional interests focus on what\'s new and upcoming in the teaching arena, implementing the most current teaching philosophies and strategies into her instruction.  In addition to teaching the program, she is the co-coordinator for the Resident Educator Program with Kent City Schools, a mentoring program for all new teachers in the district.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_rbulter@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-07-05 16:43:53', '2017-10-19 21:42:10', '57b8b2fe-9b59-4c94-babb-876fb81cabaf'),
