 ('153', '162', 'en_us', 'Brian Bachtel', '<p>Brian Bachtel has been the Director of Career Technical Education at Kent City Schools since 2009.  Prior to Kent City Schools, he was the Career Based Intervention Coordinator for Mentor Schools for nineteen years.  Mr. Bachtel has taken a leadership role Career Technical Education in the State and on a national level.  His leadership includes being the past-president of the Ohio Association for Career Technical Education.  He holds a Bachelor’s degree in Education from the University of Toledo and a Master’s in Administration from Ashland University.  Mr. Bachtel is member of the Rotary club of Kent..</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'ke_bbachtel@kentschools.net', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-08 14:34:24', '2017-10-19 21:43:43', 'bf4f77be-1ccf-4194-b963-0f24e4b056fa'),
