 ('172', '181', 'en_us', 'Parent/Teacher Conferences Nov. 20 and 21', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, '2017-11-20 05:00:00', NULL, '<p>Theodore Roosevelt Parent/Teacher conferences will be held on Monday, Nov. 20 from 5pm until 8pm, and on Tuesday, Nov. 21 from 9am until 8pm.  Please call 330 676-8700 or email ke_nharris@kentschools.net to schedule an appointment.  We welcome this opportunity to share your student’s progress and to discuss concerns and/or questions you may have.</p>', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Theodore Roosevelt Parent/Teacher conferences will be held on Monday, Nov. 20 from 5pm until 8pm, and on Tuesday, Nov. 21 from 9am until 8pm. ', '0', NULL, '', '2017-11-05 22:00:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-08 15:55:01', '2017-11-06 02:32:29', 'e872eb44-971a-4a66-84d0-7be62e6499db'),
 ('173', '182', 'en_us', 'TRHS Students Start Aug. 16; Six District Educational Compact Sudents First Day of School Aug. 17', '<p>The first day of school for all Six District Educational Compact Career-Technical Education programs is August 17.</p>\n<p>TRHS students will report for classes and TRHS CTE programs on Aug. 16.</p>\n<p>TRHS students attending Six District Educational Compact programs outside of Kent attend only TRHS classes Aug 16, Six District Educational Compact programs begin Aug. 17 with the exception of Stow-Munroe Falls High School programs (1st day for programs is Aug. 22).</p>\n<p>Six District Educational Compact students (Hudson, Tallmadge, SMF, Woodridge, and CF) start TRHS CTE programs Aug. 17 <a href=\"http://kentschools.net/rhscte/forms/district-calendar-2017-2018/\">District-Calendar-2017-2018</a> but attend home school classes on the first scheduled day.</p>\n<p>Please email me at ke_bbachtel@kentschools.net if you have any questions or contact the Theodore Roosevelt Career-Technical Education office at (330) 676-8740 for personal service,  The Kent City Schools <a href=\"http://kentschools.net/rhscte/forms/district-calendar-2017-2018/\">District-Calendar-2017-2018</a> , Six District Educational Compact <a href=\"http://kentschools.net/rhscte/forms/interdistrict-driving-form-8-2018/\">Interdistrict-Driving-Form-8-2018</a>  and  <a href=\"http://kentschools.net/rhscte/forms/17-18-six-district-calendar/\">17-18 Six District Calendar</a> are linked and can be found under the Forms tab.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'The first day of school for all Six District Educational Compact Career-Technical Education programs is August 17.', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Brian Bachtel', NULL, NULL, '2017-09-08 15:57:19', '2017-10-30 01:12:44', '66f6658a-73cf-4506-8feb-bebe9e72afd5'),
 ('174', '183', 'en_us', 'TRHS Calendar, TRHS Bell Schedule, Six District Educational Compact Calendar and Bus Schedule', '<p>The TRHS Bell Schedule, TRHS and Six District Educational Compact calendars are located under the forms and calendar tab.  Below is the Six District Educational Compact Transportation times.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'The TRHS Bell Schedule, TRHS and Six District Educational Compact calendars are located under the forms and calendar tab.  Below is the Six District Educational Compact Transportation times.', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-08 16:01:27', '2017-10-16 20:31:08', '12530281-bdcc-430f-a06d-1e39da8bd361'),
 ('176', '185', 'en_us', 'Welcome to the Program-Start Date Aug. 17', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, '2018-08-17 04:00:00', NULL, '<p>Important Items</p>\n<p>-PLEASE —Wear school colors &amp; sport uniforms!\n-Kent and home school calendars are in effect–reference both calendars..in the event of conflicts– please communicate with your program instructor.\n-All Career-Technical Programs start Thursday, August 17.\n–<strong>Notify both, Kent and home school attendance to report an absence (330) 676-8750.</strong>\n-Bus transportation to and from home school provided. Optional driving privilege form (<a href=\"http://kentschools.net/rhscte/forms/interdistrict-driving-form-8-2018/\">Interdistrict-Driving-Form-8-2018</a>) must be completed and returned to the TRHS CTE office room 515 with your home school parking pass.\n-Each program has certain necessary workbooks and supplies which you will need. In some instances, students will be asked to purchase tool or operational kits. There are two methods of payment:  (1) cash in full; or (2) a payment plan. Information about these two payment methods will be provided during the first week of school. Program school fees can be waived for students on free lunch (Six District Educational Compact students approved for free lunch will need to complete a fee waiver form),   Your instructor will provide additional details.-</p>\n<p><strong>Call the Kent Theodore Roosevelt Career-Technical Education office with any questions (330) 676-8740…we are here to serve you!</strong></p>', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '0', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-08 16:10:46', '2017-11-03 01:35:26', '05efaf29-ae09-46a3-8671-0699bd8bc43e'),
 ('177', '186', 'en_us', 'no Six District Transportation to Theodore Roosevelt High School', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, '2017-08-01 04:00:00', NULL, '', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Kent Theodore Roosevelt High School Career-Technical Education programs will be in session on Monday, April 17.  There will be no Six District Educational Compact busing that day.', '0', NULL, '', '2017-11-02 04:00:00', '2017-11-03 03:30:00', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-08 16:20:01', '2017-11-03 02:12:35', '63d8474b-625e-4625-9254-6fb323ab8030'),
