 ('127', '91', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Mr. Jeffrey Bee\",\"slug\":\"robert\",\"postDate\":1496850840,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>He is a Mechanical Engineer with a Bachelor of Science in Mechanical Engineering degree from The University of Akron. He earned a &nbsp;master\\u2019s degree in Career and Technical Education through Kent State University. He has worked as a mechanical designer, project engineer or product engineer on projects worth hundreds of thousands of dollars to multi-million dollar projects from New York City to Alaska and globally (Saudi Arabia and South Korea). He has had privilege to have taught and coached four Ohio Gold Medal Champions in Technical Drafting in the past six years. (2006-2012 &nbsp;all Portage County Students) Each student competed at the national level against the best in the country.<\\/p>\",\"26\":\"needed\",\"56\":[\"50\"],\"15\":[\"90\"],\"9\":\"needed\"}}', '2017-06-27 17:30:48', '2017-06-27 17:30:48', 'e700007b-fa95-4426-852a-5e608bbc753d'),
 ('128', '51', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Mrs. Janelle Cuva\",\"slug\":\"jon-doe\",\"postDate\":1493993520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Mrs. Cuva has been a business teacher at Roosevelt for 16 years. She holds a bachelor\'s degree from Kent State University in Business Education, and also has a master\'s degree in Instructional Technology. &nbsp;She has been married for 14 years and has three beautiful children.<\\/p>\",\"26\":\"needed\",\"56\":[\"50\"],\"15\":[\"94\"],\"9\":\"needed\"}}', '2017-06-27 17:32:16', '2017-06-27 17:32:16', 'b33842a4-d8e7-4e77-9bc5-f92796c0e8f2'),
 ('129', '96', '7', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Mr. Tom Franek\",\"slug\":\"mr-tom-franek\",\"postDate\":1498584839,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>As an instructor of &nbsp;Forestry and Landscape Management for 16 years at Kent Theodore Roosevelt High School, I\'ve enjoyed the mix of teaching new skills and knowledge along with providing the ability to apply these skills and knowledge on real job sites in the community. &nbsp;&nbsp;It provides for a very fulfilling career.<\\/p>\\r\\n<p>I believe that careers related to this field provide and promote an active, healthy and happy lifestyle and a very high quality of life. &nbsp;As part of the program, I advocate living healthy by emphasizing safe working habits, proper diet and sleep habits, and involvement in activities that promote fitness.<\\/p>\\r\\n\",\"26\":\"needed\",\"56\":[\"50\"],\"15\":[\"95\"],\"9\":\"needed\"}}', '2017-06-27 17:33:59', '2017-06-27 17:33:59', '40f13873-61f2-463f-b766-a23e759348f7'),
 ('130', '2', '1', '1', 'en_us', '13', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1492529583,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"37\":[\"9\"],\"22\":\"\",\"23\":\"Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.\",\"24\":\"Admissions\",\"1\":\"<p>It\\u2019s true, this site doesn\\u2019t have a whole lot of content yet, but don\\u2019t worry. Our web developers have just installed the CMS, and they\\u2019re setting things up for the content editors this very moment. Soon Careertech.web will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.<\\/p>\",\"15\":[\"36\"],\"31\":\"1\",\"32\":\"News\",\"33\":\"Explore Pathways\",\"34\":[\"4\"],\"35\":\"\",\"36\":\"Welcome to Kent Rosevelt\"}}', '2017-06-27 17:36:08', '2017-06-27 17:36:08', '2f002516-92e2-4cb2-b327-acffc39cac60'),
 ('131', '2', '1', '1', 'en_us', '14', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1492529583,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"37\":[\"9\"],\"22\":\"\",\"23\":\"Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.\",\"24\":\"Admissions\",\"1\":\"<p>If you are a high school student planning your future, then Kent Roosevelt Career Technical programs is the place for you! &nbsp;Learn in our high-tech facility from instructors with real-world experience. The Kent Roosevelt High School Career Technical programs are open to students within the Six District Educational Compact. &nbsp;For an application, to schedule an individual tour, or request more information \\u2013call (330) 676-8740 or see your school counselor.<\\/p>\",\"15\":[\"36\"],\"31\":\"1\",\"32\":\"News\",\"33\":\"Explore Pathways\",\"34\":[\"4\"],\"35\":\"\",\"36\":\"Welcome to Kent Rosevelt\"}}', '2017-06-27 17:37:29', '2017-06-27 17:37:29', 'c5306fa9-2d4b-4db3-b25f-576e0e5dbd93'),
