 ('221', '99', '7', '1', 'en_us', '2', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Terry Slattery\",\"slug\":\"terry-slattery\",\"postDate\":1499272260,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>#<\\/p>\",\"26\":\"ke_tslattery@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\"}}', '2017-08-07 17:15:48', '2017-08-07 17:15:48', 'ddcc0a7e-460c-427f-ac5a-14fb1b0ba04d'),
 ('222', '91', '7', '1', 'en_us', '8', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeffrey Bee\",\"slug\":\"robert\",\"postDate\":1496850840,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>He is a Mechanical Engineer with a Bachelor of Science in Mechanical Engineering degree from The University of Akron. He earned a &nbsp;master\\u2019s degree in Career and Technical Education through Kent State University. He has worked as a mechanical designer, project engineer or product engineer on projects worth hundreds of thousands of dollars to multi-million dollar projects from New York City to Alaska and globally (Saudi Arabia and South Korea). He has had privilege to have taught and coached four Ohio Gold Medal Champions in Technical Drafting in the past six years. (2006-2012 &nbsp;all Portage County Students) Each student competed at the national level against the best in the country.<\\/p>\",\"26\":\"needed\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"needed\"}}', '2017-08-07 17:15:56', '2017-08-07 17:15:56', 'd4764ce0-389b-4d74-a4c9-7983bdee7d74'),
 ('223', '96', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Tom Franek\",\"slug\":\"mr-tom-franek\",\"postDate\":1498584780,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>As an instructor of &nbsp;Forestry and Landscape Management for 16 years at Kent Theodore Roosevelt High School, I\'ve enjoyed the mix of teaching new skills and knowledge along with providing the ability to apply these skills and knowledge on real job sites in the community. &nbsp;&nbsp;It provides for a very fulfilling career.<\\/p>\\r\\n<p>I believe that careers related to this field provide and promote an active, healthy and happy lifestyle and a very high quality of life. &nbsp;As part of the program, I advocate living healthy by emphasizing safe working habits, proper diet and sleep habits, and involvement in activities that promote fitness.<\\/p>\",\"26\":\"ke_tfranek@kentschools.net\",\"56\":[\"50\"],\"15\":[\"95\"],\"9\":\"needed\"}}', '2017-08-07 17:16:04', '2017-08-07 17:16:04', '394b66d3-0b00-4656-8fe7-77c3893175d9'),
 ('224', '2', '1', '1', 'en_us', '16', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1492529583,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"37\":[\"9\"],\"22\":\"\",\"23\":\"Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.\",\"24\":\"Admissions\",\"1\":\"<p>If you are a high school student planning your future, then Kent Roosevelt Career Technical programs is the place for you! &nbsp;Learn in our high-tech facility from instructors with real-world experience. The Kent Roosevelt High School Career Technical programs are open to students within the Six District Educational Compact. &nbsp;For an application, to schedule an individual tour, or request more information \\u2013call (330) 676-8740 or see your school counselor.<\\/p>\",\"15\":[\"146\"],\"31\":\"1\",\"32\":\"News\",\"33\":\"Explore Pathways\",\"34\":[\"4\"],\"35\":\"\",\"36\":\"Welcome to Kent Rosevelt\"}}', '2017-08-09 20:40:55', '2017-08-09 20:40:55', 'f3a634e8-ae3b-442d-abb3-3a0e8512fd12'),
