 ('240', '2', '1', '1', 'en_us', '22', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1492529583,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"37\":[\"9\"],\"22\":\"\",\"23\":\"This is information about when we\'re accepting applications and why you should apply today.\",\"24\":\"How To Apply\",\"1\":\"<p>If you are a high school student planning your future, then Kent Roosevelt Career Technical programs is the place for you! &nbsp;Learn in our high-tech facility from instructors with real-world experience. The Kent Roosevelt High School Career Technical programs are open to students within the Six District Educational Compact.&nbsp;<\\/p>\",\"15\":[\"151\",\"147\"],\"31\":\"1\",\"32\":\"News\",\"33\":\"Explore Career Paths\",\"34\":[\"4\"],\"35\":\"\",\"64\":\"Career Technical Education\",\"36\":\"Welcome to Kent Roosevelt\"}}', '2017-09-06 21:03:38', '2017-09-06 21:03:38', '1a16c956-b092-4103-b83a-0c2292b1a969'),
