 ('242', '162', '7', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Brian Bachtel\",\"slug\":\"brian-bachtel\",\"postDate\":1504881264,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Brian Bachtel has been the Director of Career Technical Education at Kent City Schools since 2009. &nbsp;Prior to Kent City Schools, he was the Career Based Intervention Coordinator for Mentor Schools for nineteen years. &nbsp;Mr. Bachtel has taken a leadership role Career Technical Education in the State and on a national level. &nbsp;His leadership includes being the past-president of the Ohio Association for Career Technical Education. &nbsp;He holds a Bachelor\\u2019s degree in Education from the University of Toledo and a Master\\u2019s in Administration from Ashland University. &nbsp;Mr. Bachtel is member of the Rotary club of Kent..<\\/p>\\r\\n\",\"26\":\"ke_bbachtel@kentschools.net\",\"56\":[\"120\"],\"15\":\"\",\"9\":\"\",\"66\":\"\"}}', '2017-09-08 14:34:24', '2017-09-08 14:34:24', 'd80151ed-409e-4bf6-9c63-014366af51c5'),
 ('243', '91', '7', '1', 'en_us', '9', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeffrey Bee\",\"slug\":\"robert\",\"postDate\":1496850840,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>He is a Mechanical Engineer with a Bachelor of Science in Mechanical Engineering degree from The University of Akron. He earned a &nbsp;master\\u2019s degree in Career and Technical Education through Kent State University. He has worked as a mechanical designer, project engineer or product engineer on projects worth hundreds of thousands of dollars to multi-million dollar projects from New York City to Alaska and globally (Saudi Arabia and South Korea). He has had privilege to have taught and coached four Ohio Gold Medal Champions in Technical Drafting in the past six years. (2006-2012 &nbsp;all Portage County Students) Each student competed at the national level against the best in the country.<\\/p>\",\"26\":\"needed\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"needed\",\"66\":\"\"}}', '2017-09-08 14:34:35', '2017-09-08 14:34:35', 'b8090d17-b302-42fb-bf87-10b41bb5d99b'),
 ('244', '118', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Rhonda Butler-Carson\",\"slug\":\"rhonda-butler-carson-ke-rbulter-kentschools-net\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Rhonda Butler Carson received a B.A. in Comprehensive Business Education from the University of Akron as well as a Masters of Education from Kent State University. &nbsp;Currently, she is the instructor for the Teaching Professions program serving students in the Six District Educational Compact. &nbsp;A strong advocate of hands-on and inquiry-based learning, she involves her students in a variety of problem-solving and technology-infused activities that provide them with opportunities to use their skills to both learn and teach others. Her professional interests focus on what\'s new and upcoming in the teaching arena, implementing the most current teaching philosophies and strategies into her instruction. &nbsp;In addition to teaching the program, she is the co-coordinator for the Resident Educator Program with Kent City Schools, a mentoring program for all new teachers in the district.<\\/p>\",\"26\":\"ke_rbulter@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 14:35:08', '2017-09-08 14:35:08', '0f83cdd8-bc23-4850-84e7-7ef9e0c8e82a'),
 ('245', '51', '7', '1', 'en_us', '9', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Janelle Cuva\",\"slug\":\"jon-doe\",\"postDate\":1493993520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Mrs. Cuva has been a business teacher at Roosevelt for 16 years. She holds a bachelor\'s degree from Kent State University in Business Education, and also has a master\'s degree in Instructional Technology. &nbsp;She has been married for 14 years and has three beautiful children.<\\/p>\",\"26\":\"ke_jcuva@kentschools.net\",\"56\":[\"50\"],\"15\":[\"94\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 14:35:19', '2017-09-08 14:35:19', '7c01537d-a99d-4d8a-8fd7-3cfa72466ef8'),
 ('246', '100', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Ben Dunlap\",\"slug\":\"ben-dunlap\",\"postDate\":1499272320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Ben Dunlap received a B.A. in Business Education and a M.A. in Sports Administration both from Kent State University. He currently teaches the Business and Sports Management program &nbsp;at Theodore Roosevelt High School in Kent, Ohio. A strong advocate of hands-on, inquiry-based learning, he involves his students in a variety of community service, problem-solving, and technology-infused activities that provide them with opportunities to use their expanding business knowledge and skills to work through various virtual businesses. His professional interests focus on ensuring all of his students understand the vast opportunities available to them in the Sports Management field. In addition, he serves as department chairperson for the Career and Technical Education department at Roosevelt as well as Faculty Manager for its athletic department. &nbsp;<br><\\/p>\",\"26\":\"ke_bdunlap@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 14:35:37', '2017-09-08 14:35:37', '7c02ae2b-7255-4733-b51e-cc9ebe18ee9c'),
 ('247', '107', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Laura Eyring\",\"slug\":\"laura-eyring\",\"postDate\":1499272560,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>As an instructor of &nbsp;Forestry and Landscape Management for 16 years at Kent Theodore Roosevelt High School, I\'ve enjoyed the mix of teaching new skills and knowledge along with providing the ability to apply these skills and knowledge on real job sites in the community. &nbsp;&nbsp;It provides for a very fulfilling career.<br><\\/p>\\r\\n<p>I believe that careers related to this field provide and promote an active, healthy and happy lifestyle and a very high quality of life. &nbsp;As part of the program, I advocate living healthy by emphasizing safe working habits, proper diet and sleep habits, and involvement in activities that promote fitness. &nbsp;<\\/p>\\r\\n<p><\\/p>\",\"26\":\"ke_leyring@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 14:35:56', '2017-09-08 14:35:56', '7474edf1-4730-4435-aaf7-1109d03399f8'),
 ('248', '114', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"John Lang \",\"slug\":\"john-lang\",\"postDate\":1499272860,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>John Lang, an instructor for Forestry and Landscape Management received a degree.in Horticulture from Ohio State, is a Certified Arborist from The International Society of Arboriculture, is a Certified Commercial Pesticide Applicator from the Ohio Department of Agriculture, and holds a class A, commercial driver\'s license from the Ohio Bureau of Motor Vehicles, and owner and operator of Mogul Creek Farms in Kent Ohio.<br> <br>Lang is also involved in the United States Ski Association, he is a nationally certified alpine and nordic ski instructor, examiner emeritus. He is starting his thirty fourth year in marketing and sales for &nbsp;Volkl skis, Marker bindings, and Dalbello ski boots. He alo is a certified ski mechanic, boot fitter and sponsored skier. Many students have supplemented their employment in the snowsports industry by taking Lang\'s class.<br><br>Lang is also an accomplished percussionist playing drums and singing for several rock and jazz fusion bands over the last forty years.<\\/p>\",\"26\":\"ke_jlang@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 14:36:21', '2017-09-08 14:36:21', 'eac93876-379f-437b-a7ca-f22b8b4fd7c3'),
 ('249', '105', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeff LeSueur\",\"slug\":\"jeff-lesueur\",\"postDate\":1499272500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Jeff LeSueur is an electronics instructor at Theodore Roosevelt High School in Kent, Ohio. &nbsp;He teaches both an engineering class and a traditional career education class. &nbsp;Jeff holds degrees in Electrical Engineering (Cleveland State University) and a Master\\u2019s of Education (John Carroll University).<br><\\/p>\\r\\n<p>He believes that teachers must use materials that engage the students. &nbsp;Lessons should be directly applicable to the real world and skills should be developed that are useful in life and employable. &nbsp;This must be done while still finding and inventing lessons that are <i>interesting<\\/i> to students. &nbsp;Many materials should be used: project kits, videos, programming, field trips, student centered activities as well as traditional lab experiments and theory. &nbsp;Lessons should be evaluated for success regularly and updated frequently. &nbsp;This philosophy led Jeff to the design of the Awesome Cube and other innovative lessons. &nbsp;<\\/p>\\r\\n<p>Prior to teaching, Jeff worked in the telecommunications industry as a systems engineer, sales engineer, and consultant for several companies including Fujitsu, NASA, American Greetings and General DataComm.<\\/p>\\r\\n<p>Jeff has many interests. &nbsp;He is a performing jazz guitarist, equity investor, golfer, skier, boater, and biker.<\\/p>\",\"26\":\"ke_jlesueur@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 14:37:09', '2017-09-08 14:37:09', '55d6c6ab-f867-4c48-a06f-c3c8f735352d'),
 ('250', '117', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Brent Pfeiffer  \",\"slug\":\"brent-pfeiffer\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Brent Pfeiffer, a life-long resident of Kent, Ohio, is a third generation marketing educator and DECA advisor. Brent is a 1989 graduate of Theodore Roosevelt High School in Kent and a 1994 graduate of Kent State University; Pfeiffer also received his M.Ed. in 2004 from Kent State. Upon graduating from Kent, Brent used his marketing degree to pursue a career in sales working with John Hancock Financial Services and MCI Telecommunications before following the family legacy of teaching after his father\\u2019s untimely death in 1995.<\\/p><p>Pfeiffer\\u2019s grandfather Paul was an Emeritus marketing professor at Kent State University and his great-uncle, Kenneth (Paul\\u2019s brother), was the State Supervisor of Distributive Education and DECA in Pennsylvania for most of his career. Brent\\u2019s father, Richard, founded Roosevelt\\u2019s award-winning Marketing and DECA program in 1967. &nbsp;During Brent\\u2019s tenure, the program has grown from a one-year program to a two-year program that has been internationally recognized as one of the top programs for entrepreneurial studies. During his 20 year tenure, Pfeiffer\\u2019s students have raised close to $500,000 for school, community, and philanthropic projects.<\\/p><p><br>Throughout his career, Pfeiffer has worn many hats; he has worked as an assistant golf professional at area golf courses for 15 years, and has coached golf at Roosevelt for 18 years where he led the Rough Riders to seven consecutive league titles. Brent is also an assistant ice hockey coach at Roosevelt where he just finished his tenth season as an assistant with the team. He currently works part-time for the TaylorMade Golf Company in outside sales with his twin brother, David.&nbsp;<\\/p><p><br>Pfeiffer has also spent time as an adjunct professor in Kent State\\u2019s Center for Entrepreneurship and Business Innovation where he served as an advisor for Kent State\\u2019s chapter of CEO, the Collegiate Entrepreneurs\\u2019 Organization. During his six year tenure in the College of Business, Pfeiffer was twice nominated by his students for the Part Time Distinguished Teaching Award. Brent also worked as a small business advisor in the Entrepreneurship Lab at the Center for Entrepreneurship, assisting student entrepreneurs with their student-run businesses. Pfeiffer has also taught adjunct in the College of Education at Kent State as well.<\\/p><p><br>Committed to public service, Pfeiffer has volunteered on numerous boards, including fifteen years on the Ohio DECA Executive Council and Board of Directors, three years on the Kent Cyclones Youth Hockey Board of Directors, and is currently on the Advisory Board for Kent State\\u2019s LaunchNET, an entrepreneurial initiative that provides counseling to students, faculty, and alumni looking to bring ideas, inventions, and businesses to life. Pfeiffer has also served on Ohio Department of Education curriculum and assessment boards to develop the statewide entrepreneurship curriculum standards and testing. Most recently, he has served on an international panel of teachers and professors for DECA\\u2019s Competitive Events Task Force which was tasked with the revision, addition, modification, and improvement of DECA\\u2019s entrepreneurship events.<\\/p><p><br>Brent and his wife of 23 years, Erika reside in Kent with their two children, Paige and Coulter.<br><\\/p>\",\"26\":\"ke_bpfeiffer@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 14:38:01', '2017-09-08 14:38:01', 'b7efea4e-a81e-4048-93b9-94b5b79cc87c'),
 ('251', '99', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Terry Slattery\",\"slug\":\"terry-slattery\",\"postDate\":1499272260,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Terry Slattery is the primary instructor for both the Level I and Level II Athletic Health Care and Fitness career technical education program at Theodore Roosevelt High School. &nbsp;He has lead this 2-yr program since its design and inception into the Six District Educational Compact in 1997. &nbsp;Over 400 students have completed the 2-yr program requirements with approximately 80% of these graduates currently working or studying within the field of health care today. &nbsp;Terry received his B.S. in Health Education and Athletic Training from Bowling Green State University. &nbsp;He has completed graduate credit hours at both Central Michigan University and Kent State University. &nbsp;Terry also serves as the Head Athletic Trainer for all of the Roosevelt Rough Rider athletic teams. &nbsp;He was awarded the 2013 Ohio Athletic Trainers Association (OATA) Linda Weber-Daniels Student Mentorship Award for his work with high school students interested in health care professions. &nbsp;He was also recognized by the OATA in 2003 as the Ohio High School Athletic Trainer of the Year and a Special Consideration award for successfully performing CPR on an unresponsive person at a Kent State University basketball game. &nbsp;Slattery has collaborated with the Six District Educational Compact, Kent State University, University of Akron, Slippery Rock University, and the Ohio Department of Education in curricular design and assessment testing. &nbsp;He and his students have also worked with Northeast Medical University (NEOMED) and AmeriCorp on a number of educational projects and was recognized as the 2016 Health Professions Affinity Community (HPAC) Teacher of the Year. &nbsp;Slattery was also honored by the Kent City Schools as an Emilio Ferrara Service Award winner in 2014. &nbsp;A strong advocate for hands-on, inquiry-based problem solving, he works hard with his students to provide them with a variety of tools to make learning enjoyable and applicable to their personal needs and objectives. &nbsp;<\\/p>\",\"26\":\"ke_tslattery@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 14:38:48', '2017-09-08 14:38:48', 'fb868ca6-f1ab-4ff4-a38e-221b0c58ed26');
