 ('253', '102', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Don Titko\",\"slug\":\"don-titko\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Don Titko received a Bachelors Degree in Industrial Arts Education from Kent State University in 1983. In addition, he received his Masters Degree in Vocational Education from Kent State University in 2001. During his career, Don has spent many years in business and industry from management positions within a fortune 500 company to a construction business owner for 15 years prior to coming to Theodore Roosevelt High School. His strong beliefs in work ethic, pride in your work and craftsmanship resonate throughout his program. Instilling characteristics of accountability, responsibility, honesty, and respect allow students to grow in many ways beyond their technical training and education. &nbsp;Don is an advocate for the importance of students giving back to their community. &nbsp;This is reinforced through community service projects constructed in the program each year. To quote Don, \\\"People forget how fast you did a job&mdash;but they remember how well you did it.\\\"<br><\\/p>\",\"26\":\"ke_dtitko@kentschools.net\",\"56\":[\"50\"],\"15\":[\"136\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 14:39:44', '2017-09-08 14:39:44', 'e4295d48-3af7-4864-986c-052a02c180d7'),
 ('254', '104', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Danielle Wardell\",\"slug\":\"danielle-wardell\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Danielle Wardell received her Cosmetology license in 2005 from Theodore Roosevelt High School and then her bachelor\\u2019s degree in Spanish education from the University of Akron in 2010. After six years teaching Spanish, Danielle changed professions, returned to TRHS, and is currently the senior level Cosmetology instructor. She is a strong believer in hands-on, kinesthetic learning. She believes that communication is one of the most valuable skills in the salon and she focuses much of her teaching to that skill. &nbsp;Another valuable skill she tries to convey to her students is the importance of the community. Danielle\\u2019s students perform hair, skin, and nail services on members of the community at Rider Salon as well as sponsor a craft show every November for the city of Kent. Danielle is also an active member of Theodore Roosevelt High School acting as the Junior Class advisor and silent auction chair.<br><\\/p>\",\"26\":\"ke_dwardell@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 14:40:25', '2017-09-08 14:40:25', '1eebef4a-26df-4268-8a65-bd52db6253f7'),
 ('255', '162', '7', '1', 'en_us', '2', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Brian Bachtel\",\"slug\":\"brian-bachtel\",\"postDate\":1504881240,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Brian Bachtel has been the Director of Career Technical Education at Kent City Schools since 2009. &nbsp;Prior to Kent City Schools, he was the Career Based Intervention Coordinator for Mentor Schools for nineteen years. &nbsp;Mr. Bachtel has taken a leadership role Career Technical Education in the State and on a national level. &nbsp;His leadership includes being the past-president of the Ohio Association for Career Technical Education. &nbsp;He holds a Bachelor\\u2019s degree in Education from the University of Toledo and a Master\\u2019s in Administration from Ashland University. &nbsp;Mr. Bachtel is member of the Rotary club of Kent..<\\/p>\",\"26\":\"ke_bbachtel@kentschools.net\",\"56\":[\"120\"],\"15\":\"\",\"9\":\"\",\"66\":\"\"}}', '2017-09-08 14:46:53', '2017-09-08 14:46:53', '7c5d4e07-bfbd-4462-acc2-42ef1b8eb54e'),
