 ('264', '105', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeff LeSueur\",\"slug\":\"jeff-lesueur\",\"postDate\":1499272500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Jeff LeSueur is an electronics instructor at Theodore Roosevelt High School in Kent, Ohio. &nbsp;He teaches both an engineering class and a traditional career education class. &nbsp;Jeff holds degrees in Electrical Engineering (Cleveland State University) and a Master\\u2019s of Education (John Carroll University).<br><\\/p>\\r\\n<p>He believes that teachers must use materials that engage the students. &nbsp;Lessons should be directly applicable to the real world and skills should be developed that are useful in life and employable. &nbsp;This must be done while still finding and inventing lessons that are <em>interesting<\\/em> to students. &nbsp;Many materials should be used: project kits, videos, programming, field trips, student centered activities as well as traditional lab experiments and theory. &nbsp;Lessons should be evaluated for success regularly and updated frequently. &nbsp;This philosophy led Jeff to the design of the Awesome Cube and other innovative lessons. &nbsp;<\\/p>\\r\\n<p>Prior to teaching, Jeff worked in the telecommunications industry as a systems engineer, sales engineer, and consultant for several companies including Fujitsu, NASA, American Greetings and General DataComm.<\\/p>\\r\\n<p>Jeff has many interests. &nbsp;He is a performing jazz guitarist, equity investor, golfer, skier, boater, and biker.<\\/p>\",\"26\":\"ke_jlesueur@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 15:37:46', '2017-09-08 15:37:46', '1ac66fa2-1697-4935-8e06-8a3d2b459974'),
 ('265', '115', '7', '1', 'en_us', '2', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Catie Milton \",\"slug\":\"catie-milton\",\"postDate\":1499272920,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>#<\\/p>\",\"26\":\"ke_cmilton@kentschools.net\",\"56\":[\"50\"],\"15\":[\"172\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 15:38:16', '2017-09-08 15:38:16', '5cd39f24-1fd5-4b2b-819c-843d3b0a2780'),
 ('266', '99', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Terry Slattery\",\"slug\":\"terry-slattery\",\"postDate\":1499272260,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Terry Slattery is the primary instructor for both the Level I and Level II Athletic Health Care and Fitness career technical education program at Theodore Roosevelt High School. &nbsp;He has lead this 2-yr program since its design and inception into the Six District Educational Compact in 1997. &nbsp;Over 400 students have completed the 2-yr program requirements with approximately 80% of these graduates currently working or studying within the field of health care today. &nbsp;Terry received his B.S. in Health Education and Athletic Training from Bowling Green State University. &nbsp;He has completed graduate credit hours at both Central Michigan University and Kent State University. &nbsp;Terry also serves as the Head Athletic Trainer for all of the Roosevelt Rough Rider athletic teams. &nbsp;He was awarded the 2013 Ohio Athletic Trainers Association (OATA) Linda Weber-Daniels Student Mentorship Award for his work with high school students interested in health care professions. &nbsp;He was also recognized by the OATA in 2003 as the Ohio High School Athletic Trainer of the Year and a Special Consideration award for successfully performing CPR on an unresponsive person at a Kent State University basketball game. &nbsp;Slattery has collaborated with the Six District Educational Compact, Kent State University, University of Akron, Slippery Rock University, and the Ohio Department of Education in curricular design and assessment testing. &nbsp;He and his students have also worked with Northeast Medical University (NEOMED) and AmeriCorp on a number of educational projects and was recognized as the 2016 Health Professions Affinity Community (HPAC) Teacher of the Year. &nbsp;Slattery was also honored by the Kent City Schools as an Emilio Ferrara Service Award winner in 2014. &nbsp;A strong advocate for hands-on, inquiry-based problem solving, he works hard with his students to provide them with a variety of tools to make learning enjoyable and applicable to their personal needs and objectives. &nbsp;<\\/p>\",\"26\":\"ke_tslattery@kentschools.net\",\"56\":[\"50\"],\"15\":[\"175\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 15:38:44', '2017-09-08 15:38:44', 'fec492c5-9597-47aa-82eb-037833c27b3a'),
 ('267', '102', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Don Titko\",\"slug\":\"don-titko\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Don Titko received a Bachelors Degree in Industrial Arts Education from Kent State University in 1983. In addition, he received his Masters Degree in Vocational Education from Kent State University in 2001. During his career, Don has spent many years in business and industry from management positions within a fortune 500 company to a construction business owner for 15 years prior to coming to Theodore Roosevelt High School. His strong beliefs in work ethic, pride in your work and craftsmanship resonate throughout his program. Instilling characteristics of accountability, responsibility, honesty, and respect allow students to grow in many ways beyond their technical training and education. &nbsp;Don is an advocate for the importance of students giving back to their community. &nbsp;This is reinforced through community service projects constructed in the program each year. To quote Don, \\\"People forget how fast you did a job&mdash;but they remember how well you did it.\\\"<br><\\/p>\",\"26\":\"ke_dtitko@kentschools.net\",\"56\":[\"50\"],\"15\":[\"136\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 15:38:50', '2017-09-08 15:38:50', '8c716d74-f6b9-4ece-a3da-20f1367e6911'),
 ('268', '104', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Danielle Wardell\",\"slug\":\"danielle-wardell\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Danielle Wardell received her Cosmetology license in 2005 from Theodore Roosevelt High School and then her bachelor\\u2019s degree in Spanish education from the University of Akron in 2010. After six years teaching Spanish, Danielle changed professions, returned to TRHS, and is currently the senior level Cosmetology instructor. She is a strong believer in hands-on, kinesthetic learning. She believes that communication is one of the most valuable skills in the salon and she focuses much of her teaching to that skill. &nbsp;Another valuable skill she tries to convey to her students is the importance of the community. Danielle\\u2019s students perform hair, skin, and nail services on members of the community at Rider Salon as well as sponsor a craft show every November for the city of Kent. Danielle is also an active member of Theodore Roosevelt High School acting as the Junior Class advisor and silent auction chair.<br><\\/p>\",\"26\":\"ke_dwardell@kentschools.net\",\"56\":[\"50\"],\"15\":[\"178\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 15:39:04', '2017-09-08 15:39:04', '6e985df1-4e31-4b7a-bcfb-51df3eaf3b59'),
 ('269', '105', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeff LeSueur\",\"slug\":\"jeff-lesueur\",\"postDate\":1499272500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Jeff LeSueur is an electronics instructor at Theodore Roosevelt High School in Kent, Ohio. &nbsp;He teaches both an engineering class and a traditional career education class. &nbsp;Jeff holds degrees in Electrical Engineering (Cleveland State University) and a Master\\u2019s of Education (John Carroll University).<br><\\/p>\\r\\n<p>He believes that teachers must use materials that engage the students. &nbsp;Lessons should be directly applicable to the real world and skills should be developed that are useful in life and employable. &nbsp;This must be done while still finding and inventing lessons that are <em>interesting<\\/em> to students. &nbsp;Many materials should be used: project kits, videos, programming, field trips, student centered activities as well as traditional lab experiments and theory. &nbsp;Lessons should be evaluated for success regularly and updated frequently. &nbsp;This philosophy led Jeff to the design of the Awesome Cube and other innovative lessons. &nbsp;<\\/p>\\r\\n<p>Prior to teaching, Jeff worked in the telecommunications industry as a systems engineer, sales engineer, and consultant for several companies including Fujitsu, NASA, American Greetings and General DataComm.<\\/p>\\r\\n<p>Jeff has many interests. &nbsp;He is a performing jazz guitarist, equity investor, golfer, skier, boater, and biker.<\\/p>\",\"26\":\"ke_jlesueur@kentschools.net\",\"56\":[\"50\"],\"15\":[\"171\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-08 15:39:57', '2017-09-08 15:39:57', 'c023648f-501c-4844-a58d-b1a9a4e3126e'),
 ('271', '181', '8', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Parent\\/Teacher Conferences Nov. 20 and 21\",\"slug\":\"parent-teacher-conferences-nov-20-and-21\",\"postDate\":1504886101,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"11\\/20\\/2017\"},\"74\":{\"time\":\"\"},\"27\":\"<p>Theodore Roosevelt Parent\\/Teacher conferences will be held on Monday, Nov. 20 from 5pm until 8pm, and on Tuesday, Nov. 21 from 9am until 8pm.&nbsp; Please call 330 676-8700 or email ke_nharris@kentschools.net to schedule an appointment.&nbsp; We welcome this opportunity to share your student\\u2019s progress and to discuss concerns and\\/or questions you may have.<\\/p>\",\"72\":\"\",\"65\":\"Theodore Roosevelt Parent\\/Teacher conferences will be held on Monday, Nov. 20 from 5pm until 8pm, and on Tuesday, Nov. 21 from 9am until 8pm. \",\"21\":\"\",\"73\":{\"time\":\"5:00 PM\"}}}', '2017-09-08 15:55:01', '2017-09-08 15:55:01', '39410ff2-66fe-4420-b857-33673cc5da6a'),
 ('272', '182', '2', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"TRHS STUDENTS START AUG 16; SIX DISTRICT EDUCATIONAL COMPACT STUDENTS FIRST DAY OF SCHOOL AUG 17\",\"slug\":\"trhs-students-start-aug-16-six-district-educational-compact-students-first-day-of-school-aug-17\",\"postDate\":1504886239,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>The first day of school for all Six District Educational Compact Career-Technical Education programs is August 17.<\\/p>\\r\\n<p>TRHS students will report for classes and TRHS CTE programs on Aug. 16.<\\/p>\\r\\n<p>TRHS students attending Six District Educational Compact programs outside of&nbsp;Kent attend&nbsp;only TRHS classes&nbsp;Aug 16, Six District Educational Compact programs begin Aug. 17 with the exception of Stow-Munroe Falls High School programs (1st day for programs is Aug. 22).<\\/p>\\r\\n<p>Six District Educational Compact students&nbsp;(Hudson, Tallmadge, SMF, Woodridge, and CF)&nbsp;start TRHS&nbsp;CTE programs Aug. 17&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/district-calendar-2017-2018\\/\\\" rel=\\\"attachment wp-att-872\\\">District-Calendar-2017-2018<\\/a>&nbsp;but attend home school classes on the first scheduled day.<\\/p>\\r\\n<p>Please email me at ke_bbachtel@kentschools.net if you have any questions or contact the Theodore Roosevelt Career-Technical Education office at (330) 676-8740 for personal service,&nbsp; The Kent City Schools&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/district-calendar-2017-2018\\/\\\" rel=\\\"attachment wp-att-872\\\">District-Calendar-2017-2018<\\/a>&nbsp;, Six District Educational Compact&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/interdistrict-driving-form-8-2018\\/\\\" rel=\\\"attachment wp-att-881\\\">Interdistrict-Driving-Form-8-2018<\\/a>&nbsp; and &nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/17-18-six-district-calendar\\/\\\" rel=\\\"attachment wp-att-889\\\">17-18 Six District Calendar<\\/a>&nbsp;are linked and can be found under the Forms tab.<\\/p>\",\"39\":\"\",\"65\":\"The first day of school for all Six District Educational Compact Career-Technical Education programs is August 17.\",\"2\":\"\"}}', '2017-09-08 15:57:19', '2017-09-08 15:57:19', '48bd64e6-3b8a-4ca9-91f8-b40f204acc64'),
