 ('277', '185', '8', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"WELCOME TO THE PROGRAM-START DATE AUG. 17\",\"slug\":\"welcome-to-the-program-start-date-aug-17-1\",\"postDate\":1504887046,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"8\\/17\\/2017\"},\"74\":{\"time\":\"\"},\"27\":\"<p>Important Items<\\/p>\\r\\n<p>-PLEASE &mdash;Wear school colors & sport uniforms!\\r\\n-Kent and home school calendars are in effect\\u2013reference both calendars..in the event of conflicts\\u2013 please communicate with your program instructor.\\r\\n-All Career-Technical Programs start Thursday, August 17.\\r\\n\\u2013<b>Notify both, Kent and home school attendance to report an absence (330) 676-8750.<\\/b>\\r\\n-Bus transportation to and from home school provided. Optional driving privilege form (<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/interdistrict-driving-form-8-2018\\/\\\" rel=\\\"attachment wp-att-881\\\">Interdistrict-Driving-Form-8-2018<\\/a>) must be completed and returned to the TRHS CTE office room 515 with your home school parking pass.\\r\\n-Each program has certain necessary workbooks and supplies which you will need. In some instances, students will be asked to purchase tool or operational kits. There are two methods of payment:&nbsp; (1) cash in full; or (2) a payment plan. Information about these two payment methods will be provided during the first week of school. Program school fees can be waived for students on free lunch (Six District Educational Compact students approved for free lunch will need to complete a fee waiver form),&nbsp;&nbsp; Your instructor will provide additional details.-<\\/p>\\r\\n<p><b>Call the Kent Theodore Roosevelt Career-Technical Education office with any questions (330) 676-8740&hellip;we are here to serve you!<\\/b><\\/p>\",\"72\":\"\",\"65\":\"\",\"21\":\"\",\"73\":{\"time\":\"\"}}}', '2017-09-08 16:10:46', '2017-09-08 16:10:46', '8e27245e-bf02-4399-86e9-b70d9ff4624e'),
 ('278', '185', '8', '1', 'en_us', '2', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"Welcome to the Program-Start Date Aug. 17\",\"slug\":\"welcome-to-the-program-start-date-aug-17-1\",\"postDate\":1504887000,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"8\\/17\\/2017\"},\"74\":{\"time\":\"\"},\"27\":\"<p>Important Items<\\/p>\\r\\n<p>-PLEASE &mdash;Wear school colors & sport uniforms!\\r\\n-Kent and home school calendars are in effect\\u2013reference both calendars..in the event of conflicts\\u2013 please communicate with your program instructor.\\r\\n-All Career-Technical Programs start Thursday, August 17.\\r\\n\\u2013<strong>Notify both, Kent and home school attendance to report an absence (330) 676-8750.<\\/strong>\\r\\n-Bus transportation to and from home school provided. Optional driving privilege form (<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/interdistrict-driving-form-8-2018\\/\\\">Interdistrict-Driving-Form-8-2018<\\/a>) must be completed and returned to the TRHS CTE office room 515 with your home school parking pass.\\r\\n-Each program has certain necessary workbooks and supplies which you will need. In some instances, students will be asked to purchase tool or operational kits. There are two methods of payment:&nbsp; (1) cash in full; or (2) a payment plan. Information about these two payment methods will be provided during the first week of school. Program school fees can be waived for students on free lunch (Six District Educational Compact students approved for free lunch will need to complete a fee waiver form),&nbsp;&nbsp; Your instructor will provide additional details.-<\\/p>\\r\\n<p><strong>Call the Kent Theodore Roosevelt Career-Technical Education office with any questions (330) 676-8740&hellip;we are here to serve you!<\\/strong><\\/p>\",\"72\":\"\",\"65\":\"\",\"21\":\"\",\"73\":{\"time\":\"\"}}}', '2017-09-08 16:11:52', '2017-09-08 16:11:52', '3093f5aa-5356-4351-b9f4-b9b9663b89e8'),
 ('279', '183', '2', '1', 'en_us', '4', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"TRHS Calnedar, TRHS Bell Scheule, Six District Educational Compact Calendar and Bus Schedule\",\"slug\":\"trhs-calnedar-trhs-bell-scheule-six-district-educational-compact-calendar-and-bus-schedule\",\"postDate\":1504886460,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>The TRHS Bell Schedule, TRHS and Six District Educational Compact calendars are located under the forms and calendar tab. &nbsp;Below is the Six District Educational Compact Transportation times.<\\/p>\",\"39\":\"\",\"65\":\"The TRHS Bell Schedule, TRHS and Six District Educational Compact calendars are located under the forms and calendar tab.  Below is the Six District Educational Compact Transportation times.\",\"2\":\"\"}}', '2017-09-08 16:13:00', '2017-09-08 16:13:00', '9162a002-3794-460d-ab4d-4d7998362e77'),
 ('280', '182', '2', '1', 'en_us', '2', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"TRHS Students Start Aug. 16; Six District Educational Compact Sudents First Day of School Aug. 17\",\"slug\":\"trhs-students-start-aug-16-six-district-educational-compact-students-first-day-of-school-aug-17\",\"postDate\":1504886220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>The first day of school for all Six District Educational Compact Career-Technical Education programs is August 17.<\\/p>\\r\\n<p>TRHS students will report for classes and TRHS CTE programs on Aug. 16.<\\/p>\\r\\n<p>TRHS students attending Six District Educational Compact programs outside of&nbsp;Kent attend&nbsp;only TRHS classes&nbsp;Aug 16, Six District Educational Compact programs begin Aug. 17 with the exception of Stow-Munroe Falls High School programs (1st day for programs is Aug. 22).<\\/p>\\r\\n<p>Six District Educational Compact students&nbsp;(Hudson, Tallmadge, SMF, Woodridge, and CF)&nbsp;start TRHS&nbsp;CTE programs Aug. 17&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/district-calendar-2017-2018\\/\\\">District-Calendar-2017-2018<\\/a>&nbsp;but attend home school classes on the first scheduled day.<\\/p>\\r\\n<p>Please email me at ke_bbachtel@kentschools.net if you have any questions or contact the Theodore Roosevelt Career-Technical Education office at (330) 676-8740 for personal service,&nbsp; The Kent City Schools&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/district-calendar-2017-2018\\/\\\">District-Calendar-2017-2018<\\/a>&nbsp;, Six District Educational Compact&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/interdistrict-driving-form-8-2018\\/\\\">Interdistrict-Driving-Form-8-2018<\\/a>&nbsp; and &nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/17-18-six-district-calendar\\/\\\">17-18 Six District Calendar<\\/a>&nbsp;are linked and can be found under the Forms tab.<\\/p>\",\"39\":\"\",\"65\":\"The first day of school for all Six District Educational Compact Career-Technical Education programs is August 17.\",\"2\":\"\"}}', '2017-09-08 16:13:58', '2017-09-08 16:13:58', 'f14587a7-8cdf-43ea-8a57-b14a7c4c2e2e'),
 ('281', '186', '8', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Monday April 17 no Six District Transportation to Theodore Roosevelt High School\",\"slug\":\"monday-april-17-no-six-district-transportation-to-theodore-roosevelt-high-school\",\"postDate\":1504887601,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"4\\/17\\/2017\"},\"74\":{\"time\":\"\"},\"27\":\"\",\"72\":\"\",\"65\":\"Kent Theodore Roosevelt High School Career-Technical Education programs will be in session on Monday, April 17.  There will be no Six District Educational Compact busing that day.\",\"21\":\"\",\"73\":{\"time\":\"\"}}}', '2017-09-08 16:20:01', '2017-09-08 16:20:01', '802c43be-74e3-4b99-a657-9833bc44e45e'),
 ('282', '186', '8', '1', 'en_us', '2', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"no Six District Transportation to Theodore Roosevelt High School\",\"slug\":\"monday-april-17-no-six-district-transportation-to-theodore-roosevelt-high-school\",\"postDate\":1504887600,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"4\\/17\\/2017\"},\"74\":{\"time\":\"11:30 PM\"},\"27\":\"\",\"72\":\"\",\"65\":\"Kent Theodore Roosevelt High School Career-Technical Education programs will be in session on Monday, April 17.  There will be no Six District Educational Compact busing that day.\",\"21\":\"\",\"73\":{\"time\":\"12:00 AM\"}}}', '2017-09-11 18:18:10', '2017-09-11 18:18:10', '0460d7b2-3416-4109-a378-0675a6fe57e8'),
 ('283', '91', '7', '1', 'en_us', '10', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeffrey Bee\",\"slug\":\"robert\",\"postDate\":1496850840,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>He is a Mechanical Engineer with a Bachelor of Science in Mechanical Engineering degree from The University of Akron. He earned a &nbsp;master\\u2019s degree in Career and Technical Education through Kent State University. He has worked as a mechanical designer, project engineer or product engineer on projects worth hundreds of thousands of dollars to multi-million dollar projects from New York City to Alaska and globally (Saudi Arabia and South Korea). He has had privilege to have taught and coached four Ohio Gold Medal Champions in Technical Drafting in the past six years. (2006-2012 &nbsp;all Portage County Students) Each student competed at the national level against the best in the country.<\\/p>\",\"26\":\" http:\\/\\/kentschools.net\\/cadm\\/\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"needed\",\"66\":\"\"}}', '2017-09-22 17:46:50', '2017-09-22 17:46:50', 'a666919a-1d93-4334-ad6a-8185fe009fd6'),
 ('284', '118', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Rhonda Butler-Carson\",\"slug\":\"rhonda-butler-carson-ke-rbulter-kentschools-net\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Rhonda Butler Carson received a B.A. in Comprehensive Business Education from the University of Akron as well as a Masters of Education from Kent State University. &nbsp;Currently, she is the instructor for the Teaching Professions program serving students in the Six District Educational Compact. &nbsp;A strong advocate of hands-on and inquiry-based learning, she involves her students in a variety of problem-solving and technology-infused activities that provide them with opportunities to use their skills to both learn and teach others. Her professional interests focus on what\'s new and upcoming in the teaching arena, implementing the most current teaching philosophies and strategies into her instruction. &nbsp;In addition to teaching the program, she is the co-coordinator for the Resident Educator Program with Kent City Schools, a mentoring program for all new teachers in the district.<\\/p>\",\"26\":\"ke_rbulter@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:48:04', '2017-09-22 17:48:04', '0549e5b4-bb2b-4650-af08-ce8847bcc9a4'),
 ('285', '51', '7', '1', 'en_us', '11', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Janelle Cuva\",\"slug\":\"jon-doe\",\"postDate\":1493993520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Mrs. Cuva has been a business teacher at Roosevelt for 16 years. She holds a bachelor\'s degree from Kent State University in Business Education, and also has a master\'s degree in Instructional Technology. &nbsp;She has been married for 14 years and has three beautiful children.<\\/p>\",\"26\":\"ke_jcuva@kentschools.net\",\"56\":[\"50\"],\"15\":[\"94\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:48:32', '2017-09-22 17:48:32', 'ef8c71a3-4581-4a7a-8398-8b897719551b'),
 ('286', '100', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Ben Dunlap\",\"slug\":\"ben-dunlap\",\"postDate\":1499272320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Ben Dunlap received a B.A. in Business Education and a M.A. in Sports Administration both from Kent State University. He currently teaches the Business and Sports Management program &nbsp;at Theodore Roosevelt High School in Kent, Ohio. A strong advocate of hands-on, inquiry-based learning, he involves his students in a variety of community service, problem-solving, and technology-infused activities that provide them with opportunities to use their expanding business knowledge and skills to work through various virtual businesses. His professional interests focus on ensuring all of his students understand the vast opportunities available to them in the Sports Management field. In addition, he serves as department chairperson for the Career and Technical Education department at Roosevelt as well as Faculty Manager for its athletic department. &nbsp;<br><\\/p>\",\"26\":\"ke_bdunlap@kentschools.net\",\"56\":[\"50\"],\"15\":[\"166\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:49:00', '2017-09-22 17:49:00', '2f190f07-25c0-4115-9872-11ded2b579f5'),
 ('287', '103', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Sandi Melucci\",\"slug\":\"sandi-melucci\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Sandi Melucci received her degree from Kent State University in Career Technical Education and is currently teaching Cosmetology at Theodore Roosevelt High School. &nbsp;A strong advocate for hands-on learning and involves her students in hair competitions, professional hair shows and personal in salon training from various licensed professionals in the field of Cosmetology. As she believes in involvement in school and community activities her students are presently preparing for RHS annual craft show as well as working behind the scenes for the theater. &nbsp; &nbsp;<\\/p>\",\"26\":\"ke_smelucci@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:49:28', '2017-09-22 17:49:28', '0e90254f-1667-4455-896c-c542b3d12897'),
 ('288', '115', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Catie Milton \",\"slug\":\"catie-milton\",\"postDate\":1499272920,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Catie Milton received her BSN (Bachelor of Science in Nursing ) and MEd (Master of Education) from Kent State University and is currently one of the instructors for &nbsp;the Health Careers Technologies Program at Kent Roosevelt High School. &nbsp;Catie is a certified American Heart Association instructor and teaches CPR. When she is not teaching , Catie cares &nbsp;for infants and their families at University Hospital\\u2019s Rainbow Babies & Children\\u2019s Hospital &nbsp;as an RN on the NICU Step-down and NICU. She has also worked &nbsp;in Akron Children\\u2019s Hospital NICU and at The Hattie Larlham Foundation as a nursing supervisor. &nbsp;As &nbsp;a registered nurse, Catie is uniquely qualified to bring current skills and practices into the classroom setting. The classes she teaches, Principles of Allied Health and Nursing and Patient Centered Care consist of both theory and lab activities where students can apply what they have learned using up to date medical equipment found in hospitals &nbsp;and other healthcare facilities. As part of the Health Careers &nbsp;program, Catie is the advisor for the Health Careers Tech Club and assists students in planning and implementing many service projects that benefit the local community such as creating quilts for patients undergoing chemotherapy, helping with the Red Cross Blood Drive and raising money for the Northeastern Ohio Leukemia and Lymphoma Society. Catie lives in Brimfield, Ohio &nbsp;and is an active member of Newman Center parish. She volunteers &nbsp;at the Kent Soup Kitchen and with UH Community Partners at various events such as the Cleveland Brown\\u2019s Camp and Boo at the Zoo in Cleveland.<\\/p>\",\"26\":\"ke_cmilton@kentschools.net\",\"56\":[\"50\"],\"15\":[\"172\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:50:14', '2017-09-22 17:50:14', '048c7b73-6d8b-45e8-b363-72f94e33c1c1'),
 ('289', '117', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Brent Pfeiffer  \",\"slug\":\"brent-pfeiffer\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Brent Pfeiffer, a life-long resident of Kent, Ohio, is a third generation marketing educator and DECA advisor. Brent is a 1989 graduate of Theodore Roosevelt High School in Kent and a 1994 graduate of Kent State University; Pfeiffer also received his M.Ed. in 2004 from Kent State. Upon graduating from Kent, Brent used his marketing degree to pursue a career in sales working with John Hancock Financial Services and MCI Telecommunications before following the family legacy of teaching after his father\\u2019s untimely death in 1995.<\\/p>\\r\\n<p>Pfeiffer\\u2019s grandfather Paul was an Emeritus marketing professor at Kent State University and his great-uncle, Kenneth (Paul\\u2019s brother), was the State Supervisor of Distributive Education and DECA in Pennsylvania for most of his career. Brent\\u2019s father, Richard, founded Roosevelt\\u2019s award-winning Marketing and DECA program in 1967. &nbsp;During Brent\\u2019s tenure, the program has grown from a one-year program to a two-year program that has been internationally recognized as one of the top programs for entrepreneurial studies. During his 20 year tenure, Pfeiffer\\u2019s students have raised close to $500,000 for school, community, and philanthropic projects.<\\/p>\\r\\n<p><br>Throughout his career, Pfeiffer has worn many hats; he has worked as an assistant golf professional at area golf courses for 15 years, and has coached golf at Roosevelt for 18 years where he led the Rough Riders to seven consecutive league titles. Brent is also an assistant ice hockey coach at Roosevelt where he just finished his tenth season as an assistant with the team. He currently works part-time for the TaylorMade Golf Company in outside sales with his twin brother, David.&nbsp;<\\/p>\\r\\n<p><br>Pfeiffer has also spent time as an adjunct professor in Kent State\\u2019s Center for Entrepreneurship and Business Innovation where he served as an advisor for Kent State\\u2019s chapter of CEO, the Collegiate Entrepreneurs\\u2019 Organization. During his six year tenure in the College of Business, Pfeiffer was twice nominated by his students for the Part Time Distinguished Teaching Award. Brent also worked as a small business advisor in the Entrepreneurship Lab at the Center for Entrepreneurship, assisting student entrepreneurs with their student-run businesses. Pfeiffer has also taught adjunct in the College of Education at Kent State as well.<\\/p>\\r\\n<p><br>Committed to public service, Pfeiffer has volunteered on numerous boards, including fifteen years on the Ohio DECA Executive Council and Board of Directors, three years on the Kent Cyclones Youth Hockey Board of Directors, and is currently on the Advisory Board for Kent State\\u2019s LaunchNET, an entrepreneurial initiative that provides counseling to students, faculty, and alumni looking to bring ideas, inventions, and businesses to life. Pfeiffer has also served on Ohio Department of Education curriculum and assessment boards to develop the statewide entrepreneurship curriculum standards and testing. Most recently, he has served on an international panel of teachers and professors for DECA\\u2019s Competitive Events Task Force which was tasked with the revision, addition, modification, and improvement of DECA\\u2019s entrepreneurship events.<\\/p>\\r\\n<p><br>Brent and his wife of 23 years, Erika reside in Kent with their two children, Paige and Coulter.<br><\\/p>\",\"26\":\"ke_bpfeiffer@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:50:37', '2017-09-22 17:50:37', 'b598d16a-6879-4beb-a023-f51ae49aef0f'),
 ('290', '101', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Troy Spear\",\"slug\":\"troy-spear\",\"postDate\":1499272380,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Troy Spear is level I instructor for the Computer Aided Design and Engineering Technologies career technical program at Theodore Roosevelt High School. &nbsp;Mr. Spear is the sole instructor for the elective courses: Fundamentals of Wood and Metal Manufacturing, and Advanced Cabinetry. &nbsp;He received his Master of Arts in Industrial Technology from Kent State University after completing his undergraduate B.A. degrees in English, Speech, Theatre and Education from the University of Sioux Falls in Sioux Falls, South Dakota. &nbsp;Spear is also a member of the Society of Manufacturing Engineers, the Cabinetmakers Association, Woodwork Career Alliance and Skills USA. &nbsp;His commitment to hands-on, inquiry based problem solving and learning fosters an active learning environment where students are physically engaged in the work that they are learning about; be it setting up and operating machines, making accurate technical drawings and renderings or writing programs to run on the CAD & Engineering Tech programs CNC machines. &nbsp;Spear\\u2019s goal is that his students demonstrate knowledge and the application of real world knowledge they gain to solve tomorrow\\u2019s problems. &nbsp;He states that if students can dream it we can show them how to draw it, design it, prototype it, machine it, put it together and make it work.<br><\\/p>\\r\\n\",\"26\":\"ke_tspear@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:51:00', '2017-09-22 17:51:00', '126b4d5d-e58a-40f9-b36d-11eafc2dfda2'),
 ('291', '116', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Angela Textor \",\"slug\":\"angela-textor\",\"postDate\":1499272920,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Angela is an instructor for Health Careers Technoligies. &nbsp;&nbsp;Angela started her career at Theodore Roosevelt High School in the fall of 2011. &nbsp;Prior to coming to Kent Roosevelt, Angela was a staff member in the Athletic Training Department at Kent state University. &nbsp;During her time at Kent State she worked primarily with Women\\u2019s Gymnastics, Cross Country and Softball, while also serving as the insurance coordinator for athletics. &nbsp;Angela has a vast amount of clinical experience and was a staff member of Crystal Clinic Inc. as an orthopaedic physician assistant for 11 years. &nbsp;Her primary responsibilities were assisting William Pakan, MD. with the evaluation and treatment of patients, as well as assisting in the operating room for outpatient procedures. Angela received her Bachelors of Arts in Education in 1993 from Kent State University and a master\\u2019s degree in Career Technical Education in 2013. &nbsp;&nbsp;Angela is an approved Clinical Instructor and is an instructor in CPR\\/First Aid\\/AED training.<br><\\/p>\\r\\n\",\"26\":\"ke_atextor@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:51:25', '2017-09-22 17:51:25', '686c58c9-f16b-4c71-9a73-1e2eb27befa4'),
 ('292', '102', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Don Titko\",\"slug\":\"don-titko\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Don Titko received a Bachelors Degree in Industrial Arts Education from Kent State University in 1983. In addition, he received his Masters Degree in Vocational Education from Kent State University in 2001. During his career, Don has spent many years in business and industry from management positions within a fortune 500 company to a construction business owner for 15 years prior to coming to Theodore Roosevelt High School. His strong beliefs in work ethic, pride in your work and craftsmanship resonate throughout his program. Instilling characteristics of accountability, responsibility, honesty, and respect allow students to grow in many ways beyond their technical training and education. &nbsp;Don is an advocate for the importance of students giving back to their community. &nbsp;This is reinforced through community service projects constructed in the program each year. To quote Don, \\\"People forget how fast you did a job&mdash;but they remember how well you did it.\\\"<br><\\/p>\",\"26\":\"ke_dtitko@kentschools.net\",\"56\":[\"50\"],\"15\":[\"136\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:51:55', '2017-09-22 17:51:55', '788eb3fe-1e2f-44ed-a034-ac679ee612a8'),
 ('293', '104', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Danielle Wardell\",\"slug\":\"danielle-wardell\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Danielle Wardell received her Cosmetology license in 2005 from Theodore Roosevelt High School and then her bachelor\\u2019s degree in Spanish education from the University of Akron in 2010. After six years teaching Spanish, Danielle changed professions, returned to TRHS, and is currently the senior level Cosmetology instructor. She is a strong believer in hands-on, kinesthetic learning. She believes that communication is one of the most valuable skills in the salon and she focuses much of her teaching to that skill. &nbsp;Another valuable skill she tries to convey to her students is the importance of the community. Danielle\\u2019s students perform hair, skin, and nail services on members of the community at Rider Salon as well as sponsor a craft show every November for the city of Kent. Danielle is also an active member of Theodore Roosevelt High School acting as the Junior Class advisor and silent auction chair.<br><\\/p>\",\"26\":\"ke_dwardell@kentschools.net\",\"56\":[\"50\"],\"15\":[\"178\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:52:15', '2017-09-22 17:52:15', 'dd19f27b-580a-4c70-9d29-6822ed0f9d51'),
 ('294', '101', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Troy Spear\",\"slug\":\"troy-spear\",\"postDate\":1499272380,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Troy Spear is level I instructor for the Computer Aided Design and Engineering Technologies career technical program at Theodore Roosevelt High School. &nbsp;Mr. Spear is the sole instructor for the elective courses: Fundamentals of Wood and Metal Manufacturing, and Advanced Cabinetry. &nbsp;He received his Master of Arts in Industrial Technology from Kent State University after completing his undergraduate B.A. degrees in English, Speech, Theatre and Education from the University of Sioux Falls in Sioux Falls, South Dakota. &nbsp;Spear is also a member of the Society of Manufacturing Engineers, the Cabinetmakers Association, Woodwork Career Alliance and Skills USA. &nbsp;His commitment to hands-on, inquiry based problem solving and learning fosters an active learning environment where students are physically engaged in the work that they are learning about; be it setting up and operating machines, making accurate technical drawings and renderings or writing programs to run on the CAD & Engineering Tech programs CNC machines. &nbsp;Spear\\u2019s goal is that his students demonstrate knowledge and the application of real world knowledge they gain to solve tomorrow\\u2019s problems. &nbsp;He states that if students can dream it we can show them how to draw it, design it, prototype it, machine it, put it together and make it work.<br><\\/p>\",\"26\":\"ke_tspear@kentschools.net\",\"56\":[\"50\"],\"15\":[\"187\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:55:19', '2017-09-22 17:55:19', '09f34146-4476-4fe0-8c55-59c7425336e7'),
 ('295', '103', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Sandi Melucci\",\"slug\":\"sandi-melucci\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Sandi Melucci received her degree from Kent State University in Career Technical Education and is currently teaching Cosmetology at Theodore Roosevelt High School. &nbsp;A strong advocate for hands-on learning and involves her students in hair competitions, professional hair shows and personal in salon training from various licensed professionals in the field of Cosmetology. As she believes in involvement in school and community activities her students are presently preparing for RHS annual craft show as well as working behind the scenes for the theater. &nbsp; &nbsp;<\\/p>\",\"26\":\"ke_smelucci@kentschools.net\",\"56\":[\"50\"],\"15\":[\"188\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:57:09', '2017-09-22 17:57:09', '45456de0-8134-4183-9b79-da84751ebcf9'),
 ('296', '117', '7', '1', 'en_us', '7', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Brent Pfeiffer  \",\"slug\":\"brent-pfeiffer\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Brent Pfeiffer, a life-long resident of Kent, Ohio, is a third generation marketing educator and DECA advisor. Brent is a 1989 graduate of Theodore Roosevelt High School in Kent and a 1994 graduate of Kent State University; Pfeiffer also received his M.Ed. in 2004 from Kent State. Upon graduating from Kent, Brent used his marketing degree to pursue a career in sales working with John Hancock Financial Services and MCI Telecommunications before following the family legacy of teaching after his father\\u2019s untimely death in 1995.<\\/p>\\r\\n<p>Pfeiffer\\u2019s grandfather Paul was an Emeritus marketing professor at Kent State University and his great-uncle, Kenneth (Paul\\u2019s brother), was the State Supervisor of Distributive Education and DECA in Pennsylvania for most of his career. Brent\\u2019s father, Richard, founded Roosevelt\\u2019s award-winning Marketing and DECA program in 1967. &nbsp;During Brent\\u2019s tenure, the program has grown from a one-year program to a two-year program that has been internationally recognized as one of the top programs for entrepreneurial studies. During his 20 year tenure, Pfeiffer\\u2019s students have raised close to $500,000 for school, community, and philanthropic projects.<\\/p>\\r\\n<p><br>Throughout his career, Pfeiffer has worn many hats; he has worked as an assistant golf professional at area golf courses for 15 years, and has coached golf at Roosevelt for 18 years where he led the Rough Riders to seven consecutive league titles. Brent is also an assistant ice hockey coach at Roosevelt where he just finished his tenth season as an assistant with the team. He currently works part-time for the TaylorMade Golf Company in outside sales with his twin brother, David.&nbsp;<\\/p>\\r\\n<p><br>Pfeiffer has also spent time as an adjunct professor in Kent State\\u2019s Center for Entrepreneurship and Business Innovation where he served as an advisor for Kent State\\u2019s chapter of CEO, the Collegiate Entrepreneurs\\u2019 Organization. During his six year tenure in the College of Business, Pfeiffer was twice nominated by his students for the Part Time Distinguished Teaching Award. Brent also worked as a small business advisor in the Entrepreneurship Lab at the Center for Entrepreneurship, assisting student entrepreneurs with their student-run businesses. Pfeiffer has also taught adjunct in the College of Education at Kent State as well.<\\/p>\\r\\n<p><br>Committed to public service, Pfeiffer has volunteered on numerous boards, including fifteen years on the Ohio DECA Executive Council and Board of Directors, three years on the Kent Cyclones Youth Hockey Board of Directors, and is currently on the Advisory Board for Kent State\\u2019s LaunchNET, an entrepreneurial initiative that provides counseling to students, faculty, and alumni looking to bring ideas, inventions, and businesses to life. Pfeiffer has also served on Ohio Department of Education curriculum and assessment boards to develop the statewide entrepreneurship curriculum standards and testing. Most recently, he has served on an international panel of teachers and professors for DECA\\u2019s Competitive Events Task Force which was tasked with the revision, addition, modification, and improvement of DECA\\u2019s entrepreneurship events.<\\/p>\\r\\n<p><br>Brent and his wife of 23 years, Erika reside in Kent with their two children, Paige and Coulter.<br><\\/p>\",\"26\":\"ke_bpfeiffer@kentschools.net\",\"56\":[\"50\"],\"15\":[\"189\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 17:59:26', '2017-09-22 17:59:26', 'a7ac4d4e-06bf-4fd0-b733-68067721910f'),
 ('297', '118', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Rhonda Butler-Carson\",\"slug\":\"rhonda-butler-carson-ke-rbulter-kentschools-net\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Rhonda Butler Carson received a B.A. in Comprehensive Business Education from the University of Akron as well as a Masters of Education from Kent State University. &nbsp;Currently, she is the instructor for the Teaching Professions program serving students in the Six District Educational Compact. &nbsp;A strong advocate of hands-on and inquiry-based learning, she involves her students in a variety of problem-solving and technology-infused activities that provide them with opportunities to use their skills to both learn and teach others. Her professional interests focus on what\'s new and upcoming in the teaching arena, implementing the most current teaching philosophies and strategies into her instruction. &nbsp;In addition to teaching the program, she is the co-coordinator for the Resident Educator Program with Kent City Schools, a mentoring program for all new teachers in the district.<\\/p>\",\"26\":\"ke_rbulter@kentschools.net\",\"56\":[\"50\"],\"15\":[\"164\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 18:01:06', '2017-09-22 18:01:06', '4202bc27-ac5a-4964-8a39-94d9e28f6a0f'),
 ('298', '116', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Angela Textor \",\"slug\":\"angela-textor\",\"postDate\":1499272920,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Angela is an instructor for Health Careers Technoligies. &nbsp;&nbsp;Angela started her career at Theodore Roosevelt High School in the fall of 2011. &nbsp;Prior to coming to Kent Roosevelt, Angela was a staff member in the Athletic Training Department at Kent state University. &nbsp;During her time at Kent State she worked primarily with Women\\u2019s Gymnastics, Cross Country and Softball, while also serving as the insurance coordinator for athletics. &nbsp;Angela has a vast amount of clinical experience and was a staff member of Crystal Clinic Inc. as an orthopaedic physician assistant for 11 years. &nbsp;Her primary responsibilities were assisting William Pakan, MD. with the evaluation and treatment of patients, as well as assisting in the operating room for outpatient procedures. Angela received her Bachelors of Arts in Education in 1993 from Kent State University and a master\\u2019s degree in Career Technical Education in 2013. &nbsp;&nbsp;Angela is an approved Clinical Instructor and is an instructor in CPR\\/First Aid\\/AED training.<br><\\/p>\",\"26\":\"ke_atextor@kentschools.net\",\"56\":[\"50\"],\"15\":[\"190\"],\"9\":\"#\",\"66\":\"\"}}', '2017-09-22 18:02:21', '2017-09-22 18:02:21', '95a31b9c-287b-4652-87df-82a3386098cd'),
