 ('312', '91', '7', '1', 'en_us', '11', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeffrey Bee\",\"slug\":\"robert\",\"postDate\":1496850840,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>He is a Mechanical Engineer with a Bachelor of Science in Mechanical Engineering degree from The University of Akron. He earned a &nbsp;master\\u2019s degree in Career and Technical Education through Kent State University. He has worked as a mechanical designer, project engineer or product engineer on projects worth hundreds of thousands of dollars to multi-million dollar projects from New York City to Alaska and globally (Saudi Arabia and South Korea). He has had privilege to have taught and coached four Ohio Gold Medal Champions in Technical Drafting in the past six years. (2006-2012 &nbsp;all Portage County Students) Each student competed at the national level against the best in the country.<\\/p>\",\"26\":\" ke_jbee@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"\",\"66\":\"\"}}', '2017-10-13 18:29:56', '2017-10-13 18:29:56', '10b2ddbe-369a-46a4-aa38-a362c2d0d83d'),
 ('313', '118', '7', '1', 'en_us', '7', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Rhonda Butler-Carson\",\"slug\":\"rhonda-butler-carson-ke-rbulter-kentschools-net\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Rhonda Butler Carson received a B.A. in Comprehensive Business Education from the University of Akron as well as a Masters of Education from Kent State University. &nbsp;Currently, she is the instructor for the Teaching Professions program serving students in the Six District Educational Compact. &nbsp;A strong advocate of hands-on and inquiry-based learning, she involves her students in a variety of problem-solving and technology-infused activities that provide them with opportunities to use their skills to both learn and teach others. Her professional interests focus on what\'s new and upcoming in the teaching arena, implementing the most current teaching philosophies and strategies into her instruction. &nbsp;In addition to teaching the program, she is the co-coordinator for the Resident Educator Program with Kent City Schools, a mentoring program for all new teachers in the district.<\\/p>\",\"26\":\"ke_rbulter@kentschools.net\",\"56\":[\"50\"],\"15\":[\"164\"],\"9\":\"#\",\"66\":\"\"}}', '2017-10-13 18:30:27', '2017-10-13 18:30:27', '6c02d2bf-be87-49e5-a224-e684fbe3bb19'),
 ('314', '51', '7', '1', 'en_us', '12', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Janelle Cuva\",\"slug\":\"jon-doe\",\"postDate\":1493993520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Mrs. Cuva has been a business teacher at Roosevelt for 16 years. She holds a bachelor\'s degree from Kent State University in Business Education, and also has a master\'s degree in Instructional Technology. &nbsp;She has been married for 14 years and has three beautiful children.<\\/p>\",\"26\":\"ke_jcuva@kentschools.net\",\"56\":[\"50\"],\"15\":[\"94\"],\"9\":\"#\",\"66\":\"\"}}', '2017-10-13 18:31:01', '2017-10-13 18:31:01', 'e9c7a06e-a001-4f1b-bd50-ecc6661bbaaa'),
 ('315', '100', '7', '1', 'en_us', '7', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Ben Dunlap\",\"slug\":\"ben-dunlap\",\"postDate\":1499272320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Ben Dunlap received a B.A. in Business Education and a M.A. in Sports Administration both from Kent State University. He currently teaches the Business and Sports Management program &nbsp;at Theodore Roosevelt High School in Kent, Ohio. A strong advocate of hands-on, inquiry-based learning, he involves his students in a variety of community service, problem-solving, and technology-infused activities that provide them with opportunities to use their expanding business knowledge and skills to work through various virtual businesses. His professional interests focus on ensuring all of his students understand the vast opportunities available to them in the Sports Management field. In addition, he serves as department chairperson for the Career and Technical Education department at Roosevelt as well as Faculty Manager for its athletic department. &nbsp;<br><\\/p>\",\"26\":\"ke_bdunlap@kentschools.net\",\"56\":[\"50\"],\"15\":[\"166\"],\"9\":\"#\",\"66\":\"\"}}', '2017-10-13 18:31:19', '2017-10-13 18:31:19', '3cd4c4f2-744f-4687-94c7-ca3d8702d748'),
 ('316', '107', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Laura Eyring\",\"slug\":\"laura-eyring\",\"postDate\":1499272560,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Laura Eyring received a B.S. in Aerospace Engineering from Embry-Riddle Aeronautical University, a B.S. in Secondary Math Education from Southeast Missouri State University, and a M.A. in Career-Technical Education from Kent State University and is currently teaching Computer Aided Design, Pre-Calculus, Advanced Pre-Calculus, and College Math Fundamentals at Theodore Roosevelt High School. &nbsp;A strong advocate for showing students the real-world, relevant connections in mathematics as well as in Computer Aided Design, she involves her students in activities and projects that reflect those connections. &nbsp;Her professional interests focus on the ever-changing and quickly-advancing world of 3D prototyping. &nbsp;She serves as an instructor for the Engineering Academy, part of the Six District Educational Compact.<span><\\/span><br><\\/p>\",\"26\":\"ke_leyring@kentschools.net\",\"56\":[\"50\"],\"15\":[\"167\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-13 18:32:23', '2017-10-13 18:32:23', '2ee84b2d-2c8a-4df5-b36f-5638373581ed'),
 ('317', '96', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Tom Franek\",\"slug\":\"mr-tom-franek\",\"postDate\":1498584780,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>As an instructor of &nbsp;Forestry and Landscape Management for 16 years at Kent Theodore Roosevelt High School, I\'ve enjoyed the mix of teaching new skills and knowledge along with providing the ability to apply these skills and knowledge on real job sites in the community. &nbsp;&nbsp;It provides for a very fulfilling career.<\\/p>\\r\\n<p>I believe that careers related to this field provide and promote an active, healthy and happy lifestyle and a very high quality of life. &nbsp;As part of the program, I advocate living healthy by emphasizing safe working habits, proper diet and sleep habits, and involvement in activities that promote fitness.<\\/p>\",\"26\":\"ke_tfranek@kentschools.net\",\"56\":[\"50\"],\"15\":[\"95\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-13 18:32:39', '2017-10-13 18:32:39', '3d3edb14-639f-4890-8f97-a8b815dbb078'),
 ('318', '114', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"John Lang \",\"slug\":\"john-lang\",\"postDate\":1499272860,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>John Lang, an instructor for Forestry and Landscape Management received a degree.in Horticulture from Ohio State, is a Certified Arborist from The International Society of Arboriculture, is a Certified Commercial Pesticide Applicator from the Ohio Department of Agriculture, and holds a class A, commercial driver\'s license from the Ohio Bureau of Motor Vehicles, and owner and operator of Mogul Creek Farms in Kent Ohio.<br><br>Lang is also involved in the United States Ski Association, he is a nationally certified alpine and nordic ski instructor, examiner emeritus. He is starting his thirty fourth year in marketing and sales for &nbsp;Volkl skis, Marker bindings, and Dalbello ski boots. He alo is a certified ski mechanic, boot fitter and sponsored skier. Many students have supplemented their employment in the snowsports industry by taking Lang\'s class.<br><br>Lang is also an accomplished percussionist playing drums and singing for several rock and jazz fusion bands over the last forty years.<\\/p>\",\"26\":\"ke_jlang@kentschools.net\",\"56\":[\"50\"],\"15\":[\"170\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-13 18:32:57', '2017-10-13 18:32:57', '5a93b82d-ad9f-4ad0-9359-2d362a543d3c'),
 ('319', '105', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeff LeSueur\",\"slug\":\"jeff-lesueur\",\"postDate\":1499272500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Jeff LeSueur is an electronics instructor at Theodore Roosevelt High School in Kent, Ohio. &nbsp;He teaches both an engineering class and a traditional career education class. &nbsp;Jeff holds degrees in Electrical Engineering (Cleveland State University) and a Master\\u2019s of Education (John Carroll University).<br><\\/p>\\r\\n<p>He believes that teachers must use materials that engage the students. &nbsp;Lessons should be directly applicable to the real world and skills should be developed that are useful in life and employable. &nbsp;This must be done while still finding and inventing lessons that are <em>interesting<\\/em> to students. &nbsp;Many materials should be used: project kits, videos, programming, field trips, student centered activities as well as traditional lab experiments and theory. &nbsp;Lessons should be evaluated for success regularly and updated frequently. &nbsp;This philosophy led Jeff to the design of the Awesome Cube and other innovative lessons. &nbsp;<\\/p>\\r\\n<p>Prior to teaching, Jeff worked in the telecommunications industry as a systems engineer, sales engineer, and consultant for several companies including Fujitsu, NASA, American Greetings and General DataComm.<\\/p>\\r\\n<p>Jeff has many interests. &nbsp;He is a performing jazz guitarist, equity investor, golfer, skier, boater, and biker.<\\/p>\",\"26\":\"ke_jlesueur@kentschools.net\",\"56\":[\"50\"],\"15\":[\"171\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-13 18:33:22', '2017-10-13 18:33:22', '0f01eae8-b452-410d-a8d7-f3d58ed44d7e'),
 ('320', '103', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Sandi Melucci\",\"slug\":\"sandi-melucci\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Sandi Melucci received her degree from Kent State University in Career Technical Education and is currently teaching Cosmetology at Theodore Roosevelt High School. &nbsp;A strong advocate for hands-on learning and involves her students in hair competitions, professional hair shows and personal in salon training from various licensed professionals in the field of Cosmetology. As she believes in involvement in school and community activities her students are presently preparing for RHS annual craft show as well as working behind the scenes for the theater. &nbsp; &nbsp;<\\/p>\",\"26\":\"ke_smelucci@kentschools.net\",\"56\":[\"50\"],\"15\":[\"188\"],\"9\":\"#\",\"66\":\"\"}}', '2017-10-13 18:33:40', '2017-10-13 18:33:40', '567d3bf5-e239-4a1e-8182-81f8d72eb463'),
 ('321', '115', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Catie Milton \",\"slug\":\"catie-milton\",\"postDate\":1499272920,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Catie Milton received her BSN (Bachelor of Science in Nursing ) and MEd (Master of Education) from Kent State University and is currently one of the instructors for &nbsp;the Health Careers Technologies Program at Kent Roosevelt High School. &nbsp;Catie is a certified American Heart Association instructor and teaches CPR. When she is not teaching , Catie cares &nbsp;for infants and their families at University Hospital\\u2019s Rainbow Babies & Children\\u2019s Hospital &nbsp;as an RN on the NICU Step-down and NICU. She has also worked &nbsp;in Akron Children\\u2019s Hospital NICU and at The Hattie Larlham Foundation as a nursing supervisor. &nbsp;As &nbsp;a registered nurse, Catie is uniquely qualified to bring current skills and practices into the classroom setting. The classes she teaches, Principles of Allied Health and Nursing and Patient Centered Care consist of both theory and lab activities where students can apply what they have learned using up to date medical equipment found in hospitals &nbsp;and other healthcare facilities. As part of the Health Careers &nbsp;program, Catie is the advisor for the Health Careers Tech Club and assists students in planning and implementing many service projects that benefit the local community such as creating quilts for patients undergoing chemotherapy, helping with the Red Cross Blood Drive and raising money for the Northeastern Ohio Leukemia and Lymphoma Society. Catie lives in Brimfield, Ohio &nbsp;and is an active member of Newman Center parish. She volunteers &nbsp;at the Kent Soup Kitchen and with UH Community Partners at various events such as the Cleveland Brown\\u2019s Camp and Boo at the Zoo in Cleveland.<\\/p>\",\"26\":\"ke_cmilton@kentschools.net\",\"56\":[\"50\"],\"15\":[\"172\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-13 18:34:06', '2017-10-13 18:34:06', '44a5d026-bdb4-4c44-bd6e-ef4b3ce73ee6'),
 ('322', '117', '7', '1', 'en_us', '8', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Brent Pfeiffer  \",\"slug\":\"brent-pfeiffer\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Brent Pfeiffer, a life-long resident of Kent, Ohio, is a third generation marketing educator and DECA advisor. Brent is a 1989 graduate of Theodore Roosevelt High School in Kent and a 1994 graduate of Kent State University; Pfeiffer also received his M.Ed. in 2004 from Kent State. Upon graduating from Kent, Brent used his marketing degree to pursue a career in sales working with John Hancock Financial Services and MCI Telecommunications before following the family legacy of teaching after his father\\u2019s untimely death in 1995.<\\/p>\\r\\n<p>Pfeiffer\\u2019s grandfather Paul was an Emeritus marketing professor at Kent State University and his great-uncle, Kenneth (Paul\\u2019s brother), was the State Supervisor of Distributive Education and DECA in Pennsylvania for most of his career. Brent\\u2019s father, Richard, founded Roosevelt\\u2019s award-winning Marketing and DECA program in 1967. &nbsp;During Brent\\u2019s tenure, the program has grown from a one-year program to a two-year program that has been internationally recognized as one of the top programs for entrepreneurial studies. During his 20 year tenure, Pfeiffer\\u2019s students have raised close to $500,000 for school, community, and philanthropic projects.<\\/p>\\r\\n<p><br>Throughout his career, Pfeiffer has worn many hats; he has worked as an assistant golf professional at area golf courses for 15 years, and has coached golf at Roosevelt for 18 years where he led the Rough Riders to seven consecutive league titles. Brent is also an assistant ice hockey coach at Roosevelt where he just finished his tenth season as an assistant with the team. He currently works part-time for the TaylorMade Golf Company in outside sales with his twin brother, David.&nbsp;<\\/p>\\r\\n<p><br>Pfeiffer has also spent time as an adjunct professor in Kent State\\u2019s Center for Entrepreneurship and Business Innovation where he served as an advisor for Kent State\\u2019s chapter of CEO, the Collegiate Entrepreneurs\\u2019 Organization. During his six year tenure in the College of Business, Pfeiffer was twice nominated by his students for the Part Time Distinguished Teaching Award. Brent also worked as a small business advisor in the Entrepreneurship Lab at the Center for Entrepreneurship, assisting student entrepreneurs with their student-run businesses. Pfeiffer has also taught adjunct in the College of Education at Kent State as well.<\\/p>\\r\\n<p><br>Committed to public service, Pfeiffer has volunteered on numerous boards, including fifteen years on the Ohio DECA Executive Council and Board of Directors, three years on the Kent Cyclones Youth Hockey Board of Directors, and is currently on the Advisory Board for Kent State\\u2019s LaunchNET, an entrepreneurial initiative that provides counseling to students, faculty, and alumni looking to bring ideas, inventions, and businesses to life. Pfeiffer has also served on Ohio Department of Education curriculum and assessment boards to develop the statewide entrepreneurship curriculum standards and testing. Most recently, he has served on an international panel of teachers and professors for DECA\\u2019s Competitive Events Task Force which was tasked with the revision, addition, modification, and improvement of DECA\\u2019s entrepreneurship events.<\\/p>\\r\\n<p><br>Brent and his wife of 23 years, Erika reside in Kent with their two children, Paige and Coulter.<br><\\/p>\",\"26\":\"ke_bpfeiffer@kentschools.net\",\"56\":[\"50\"],\"15\":[\"189\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-13 18:34:39', '2017-10-13 18:34:39', 'ef8f7733-f9da-4339-86b7-53666689b0a0'),
 ('323', '99', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Terry Slattery\",\"slug\":\"terry-slattery\",\"postDate\":1499272260,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Terry Slattery is the primary instructor for both the Level I and Level II Athletic Health Care and Fitness career technical education program at Theodore Roosevelt High School. &nbsp;He has lead this 2-yr program since its design and inception into the Six District Educational Compact in 1997. &nbsp;Over 400 students have completed the 2-yr program requirements with approximately 80% of these graduates currently working or studying within the field of health care today. &nbsp;Terry received his B.S. in Health Education and Athletic Training from Bowling Green State University. &nbsp;He has completed graduate credit hours at both Central Michigan University and Kent State University. &nbsp;Terry also serves as the Head Athletic Trainer for all of the Roosevelt Rough Rider athletic teams. &nbsp;He was awarded the 2013 Ohio Athletic Trainers Association (OATA) Linda Weber-Daniels Student Mentorship Award for his work with high school students interested in health care professions. &nbsp;He was also recognized by the OATA in 2003 as the Ohio High School Athletic Trainer of the Year and a Special Consideration award for successfully performing CPR on an unresponsive person at a Kent State University basketball game. &nbsp;Slattery has collaborated with the Six District Educational Compact, Kent State University, University of Akron, Slippery Rock University, and the Ohio Department of Education in curricular design and assessment testing. &nbsp;He and his students have also worked with Northeast Medical University (NEOMED) and AmeriCorp on a number of educational projects and was recognized as the 2016 Health Professions Affinity Community (HPAC) Teacher of the Year. &nbsp;Slattery was also honored by the Kent City Schools as an Emilio Ferrara Service Award winner in 2014. &nbsp;A strong advocate for hands-on, inquiry-based problem solving, he works hard with his students to provide them with a variety of tools to make learning enjoyable and applicable to their personal needs and objectives. &nbsp;<\\/p>\",\"26\":\"ke_tslattery@kentschools.net\",\"56\":[\"50\"],\"15\":[\"175\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-13 18:34:53', '2017-10-13 18:34:53', '9d8670bc-3859-4f9a-9ca3-8f861075fca8'),
 ('324', '101', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Troy Spear\",\"slug\":\"troy-spear\",\"postDate\":1499272380,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Troy Spear is level I instructor for the Computer Aided Design and Engineering Technologies career technical program at Theodore Roosevelt High School. &nbsp;Mr. Spear is the sole instructor for the elective courses: Fundamentals of Wood and Metal Manufacturing, and Advanced Cabinetry. &nbsp;He received his Master of Arts in Industrial Technology from Kent State University after completing his undergraduate B.A. degrees in English, Speech, Theatre and Education from the University of Sioux Falls in Sioux Falls, South Dakota. &nbsp;Spear is also a member of the Society of Manufacturing Engineers, the Cabinetmakers Association, Woodwork Career Alliance and Skills USA. &nbsp;His commitment to hands-on, inquiry based problem solving and learning fosters an active learning environment where students are physically engaged in the work that they are learning about; be it setting up and operating machines, making accurate technical drawings and renderings or writing programs to run on the CAD & Engineering Tech programs CNC machines. &nbsp;Spear\\u2019s goal is that his students demonstrate knowledge and the application of real world knowledge they gain to solve tomorrow\\u2019s problems. &nbsp;He states that if students can dream it we can show them how to draw it, design it, prototype it, machine it, put it together and make it work.<br><\\/p>\",\"26\":\"ke_tspear@kentschools.net\",\"56\":[\"50\"],\"15\":[\"187\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-13 18:35:12', '2017-10-13 18:35:12', 'e07a36fc-e72f-459f-a4db-b479281c4d10'),
 ('325', '116', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Angela Textor \",\"slug\":\"angela-textor\",\"postDate\":1499272920,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Angela is an instructor for Health Careers Technoligies. &nbsp;&nbsp;Angela started her career at Theodore Roosevelt High School in the fall of 2011. &nbsp;Prior to coming to Kent Roosevelt, Angela was a staff member in the Athletic Training Department at Kent state University. &nbsp;During her time at Kent State she worked primarily with Women\\u2019s Gymnastics, Cross Country and Softball, while also serving as the insurance coordinator for athletics. &nbsp;Angela has a vast amount of clinical experience and was a staff member of Crystal Clinic Inc. as an orthopaedic physician assistant for 11 years. &nbsp;Her primary responsibilities were assisting William Pakan, MD. with the evaluation and treatment of patients, as well as assisting in the operating room for outpatient procedures. Angela received her Bachelors of Arts in Education in 1993 from Kent State University and a master\\u2019s degree in Career Technical Education in 2013. &nbsp;&nbsp;Angela is an approved Clinical Instructor and is an instructor in CPR\\/First Aid\\/AED training.<br><\\/p>\",\"26\":\"ke_atextor@kentschools.net\",\"56\":[\"50\"],\"15\":[\"190\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-13 18:35:24', '2017-10-13 18:35:24', '7972c84a-fb37-4c16-8c22-548577fb872c'),
 ('326', '102', '7', '1', 'en_us', '7', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Don Titko\",\"slug\":\"don-titko\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Don Titko received a Bachelors Degree in Industrial Arts Education from Kent State University in 1983. In addition, he received his Masters Degree in Vocational Education from Kent State University in 2001. During his career, Don has spent many years in business and industry from management positions within a fortune 500 company to a construction business owner for 15 years prior to coming to Theodore Roosevelt High School. His strong beliefs in work ethic, pride in your work and craftsmanship resonate throughout his program. Instilling characteristics of accountability, responsibility, honesty, and respect allow students to grow in many ways beyond their technical training and education. &nbsp;Don is an advocate for the importance of students giving back to their community. &nbsp;This is reinforced through community service projects constructed in the program each year. To quote Don, \\\"People forget how fast you did a job&mdash;but they remember how well you did it.\\\"<br><\\/p>\",\"26\":\"ke_dtitko@kentschools.net\",\"56\":[\"50\"],\"15\":[\"136\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-13 18:35:37', '2017-10-13 18:35:37', 'cdd9e008-859a-4fc3-b2f6-0729390fe798'),
 ('327', '104', '7', '1', 'en_us', '7', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Danielle Wardell\",\"slug\":\"danielle-wardell\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Danielle Wardell received her Cosmetology license in 2005 from Theodore Roosevelt High School and then her bachelor\\u2019s degree in Spanish education from the University of Akron in 2010. After six years teaching Spanish, Danielle changed professions, returned to TRHS, and is currently the senior level Cosmetology instructor. She is a strong believer in hands-on, kinesthetic learning. She believes that communication is one of the most valuable skills in the salon and she focuses much of her teaching to that skill. &nbsp;Another valuable skill she tries to convey to her students is the importance of the community. Danielle\\u2019s students perform hair, skin, and nail services on members of the community at Rider Salon as well as sponsor a craft show every November for the city of Kent. Danielle is also an active member of Theodore Roosevelt High School acting as the Junior Class advisor and silent auction chair.<br><\\/p>\",\"26\":\"ke_dwardell@kentschools.net\",\"56\":[\"50\"],\"15\":[\"178\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-13 18:36:06', '2017-10-13 18:36:06', 'e36636f0-2e10-4fdc-8c56-b26ffc5825b3'),
