 ('344', '60', '3', '1', 'en_us', '6', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Forestry and Landscape Management\",\"slug\":\"forestry-and-landscape-management\",\"postDate\":1494433080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p><br><\\/p><p>If you are interested in working outside with plants and turf, this program may be for you. &nbsp;If you complete the Forest and Landscape Management program, you could be employed in various careers found in the \\u201cGreen\\u201d industry. &nbsp;You will have an opportunity to study first hand, given a work-based experience, between three and five major fields of study during the first year of the program. &nbsp;In the second year, you will concentrate on one area, attending class for approximately 50 minutes a day and working three to four hours a day in your area of interest.<\\/p>\\r\\n<ul><li><p>Golf course management <\\/p><\\/li><li><p>Forestry<\\/p><\\/li><li><p>Urban Forestry<\\/p><\\/li><\\/ul>\\r\\n\",\"11\":\"<p>Level I \\u2013 English 1; Tech Theory 1; Lab 2;<br><\\/p>\\r\\n<p>Level II \\u2013 English 1; Tech Theory 1; Lab 3; Internship 1<\\/p>\\r\\n\",\"15\":[\"211\"],\"12\":\"10, 11, 12\",\"14\":\"Two years\",\"38\":[\"53\"],\"35\":{\"new1\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"One period (50 minutes) of Technical Theory\"},{\"col1\":\"Three periods (170 minutes) of work-based experience\"}]}},\"new2\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Working indoors and\\/or outdoors\"}]}},\"new3\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Plant identification and selection\"},{\"col1\":\"Landscape maintenance, construction and design\"},{\"col1\":\"Environmental ecologyArboriculture (Tree Management)\"},{\"col1\":\"Turf management\"},{\"col1\":\"Equipment maintenance, operation and safety\"},{\"col1\":\"Garden center and nursery operations\"},{\"col1\":\"Greenhouse operations\"}]}},\"new5\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Future Educational Opportunities\",\"text\":[{\"col1\":\"Two year college Associate Degree\"},{\"col1\":\"Four year Baccalaureate Degree\"},{\"col1\":\"School-to-work employment transitions\"},{\"col1\":\"Industry internships\"}]}},\"new6\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Reading and math skills\"},{\"col1\":\"Problem solving skills\"},{\"col1\":\"Interest in creative design\"},{\"col1\":\"Interest in biological sciences and the environment\"}]}},\"new4\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Communicate orally and in writing\"},{\"col1\":\"Good interpersonal relationships\"},{\"col1\":\"Good personal appearance and hygiene\"},{\"col1\":\"Positive work attitude\"},{\"col1\":\"Good organizational skills\"},{\"col1\":\"Consistent attendance\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-13 18:53:59', '2017-10-13 18:53:59', '24920071-9d2b-4982-8764-e805a39b7197'),
 ('345', '223', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Visit from Heath Greene\",\"slug\":\"visit-from-heath-greene\",\"postDate\":1507921215,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Heath Greene graduate of Forestry\\/Landscape Management stopped in to visit and promote employment at Vismeg Landscape Contractors. He shared some current pruning techniques he has been using in the field. He also talked about his current assignment as a foreman taking care of a ninety acre condominium retirement community.<\\/p>\",\"15\":\"\",\"65\":\"\\u200bHeath Greene graduate of Forestry\\/Landscape Management stopped in to visit and promote employment at Vismeg Landscape Contractors\",\"21\":[\"60\"],\"75\":\"\"}}', '2017-10-13 19:00:16', '2017-10-13 19:00:16', '28a2428d-675f-4bc4-ba99-ebccef83bcf3'),
 ('346', '62', '3', '1', 'en_us', '5', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Business and Sports Management\",\"slug\":\"business-and-sports-management\",\"postDate\":1494433140,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>This College Tech Prep Initiative develops skills and knowledge in the field of business, sports management and marketing, human resource management, facilities and operations management, sales, and public relations. Students will acquire knowledge of business processes, economics and business relationships, finance, and accounting. &nbsp;&nbsp;Students will learn how to manage a workforce, lead change and build professional relationships with employees and customers. Students will utilize technology, software, and virtual simulations to prepare for careers in the business and sport management fields. &nbsp;Worksite and facility visits to professional, collegiate, and recreational sports and management will be integrated into the program. All students are provided opportunities for leadership development through the Business Professionals of America national student organization. College credit is available through university partnerships.<\\/p>\",\"11\":\"<p>Level I: &nbsp;CP English-1; Theory-1; Lab-1; and optional Capstone*-1<br><\\/p>\\r\\n<p>Level II: CP English-1; Theory-1; Lab-1; and optional Capstone*-1<\\/p>\\r\\n\",\"15\":[\"208\"],\"12\":\"10, 11, 12\",\"14\":\"Two years\",\"38\":[\"54\"],\"35\":{\"new1\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Sports Management\"},{\"col1\":\"Business Foundations\"},{\"col1\":\"Management and Administration Principles\"},{\"col1\":\"Fundamentals of Business and Administrative Services\"},{\"col1\":\"Human Resource Management\"},{\"col1\":\"Finance and Accounting\"},{\"col1\":\"Marketing, Sales, and Public Relations\"}]}},\"new2\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":[{\"col1\":\"Front office positions in professional sports\"},{\"col1\":\"Athletic director in college and high school\"},{\"col1\":\"Team management\"},{\"col1\":\"Event and recreational management\"},{\"col1\":\"Sports marketing\"},{\"col1\":\"Human resource manager\"},{\"col1\":\"Franchising and ownership\"}]}},\"new3\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher education opportunities\",\"text\":[{\"col1\":\"College credits available\"},{\"col1\":\"Associate\\u2019s degree\"},{\"col1\":\"Bachelor\\u2019s degree\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-13 19:16:30', '2017-10-13 19:16:30', '602f7aee-60ee-4e95-a317-514c310da383'),
