 ('351', '71', '3', '1', 'en_us', '5', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Cosmetology\",\"slug\":\"cosmetology\",\"postDate\":1494433380,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>If you are artistic and interested in hair styling, makeup analysis and nail care, here\\u2019s a program that allows you to apply your talents and your interests. &nbsp;Instructors and students are kept up to date in this rapidly changing profession by attending shows and conferences, hosting guest artists and participating in competitions. &nbsp;As soon as you complete this two-year program you can apply to take the State Board exam and become a licensed Cosmetologist. &nbsp;You\\u2019ll be qualified for immediate employment, performing professional grooming services related to the care of hair, skin and nails. &nbsp;Who knows &mdash; some day you could become a famous make-up artist or a salon owner!<br><\\/p>\\r\\n<p><\\/p>\",\"11\":\"\",\"15\":[\"128\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"59\"],\"35\":{\"new1\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"5 periods daily\"}]}},\"new2\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Working with people and equipment\"},{\"col1\":\"Standing for long periods\"},{\"col1\":\"Working with chemicals\"},{\"col1\":\"Working with hands at shoulder height\"}]}},\"new3\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Styling and care of the hair using many tools and products\"},{\"col1\":\"Shaping and cutting the hair\"},{\"col1\":\"Permanently waving or relaxing the hair\"},{\"col1\":\"Hair tinting and lightening\"},{\"col1\":\"Dispensing and controlling supplies\"},{\"col1\":\"Office procedures\"},{\"col1\":\"Cleaning and styling wigs\"},{\"col1\":\"Manicure, pedicure and sculpture nails\"},{\"col1\":\"Facial treatments and make-up\"}]}},\"new4\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Good health and posture\"},{\"col1\":\"Good attendance\"},{\"col1\":\"Good finger dexterity\"},{\"col1\":\"Sense of form and artistry\"},{\"col1\":\"Non-allergic to chemicals\"},{\"col1\":\"Communicate orally and in writing\"}]}},\"new5\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Youth Leadership Organization\",\"text\":[{\"col1\":\"Vocational Industrial Clubs of America (VICA)\"}]}},\"new6\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Art\"},{\"col1\":\"Biology\"},{\"col1\":\"C.P. English\"},{\"col1\":\"General Science\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 17:47:09', '2017-10-16 17:47:09', '20c612d8-4b2d-4ae5-b0e8-7809f3aabe55'),
 ('352', '69', '3', '1', 'en_us', '5', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Athletic Health Care Fitness\",\"slug\":\"athletic-health-care-fitness\",\"postDate\":1494433320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.<\\/p>\",\"11\":\"<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.<\\/p>\",\"15\":[\"202\"],\"12\":\"10\",\"14\":\"2\",\"38\":[\"58\"],\"35\":\"\",\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 17:47:53', '2017-10-16 17:47:53', '9af86f8d-ab4a-4eaa-943a-07cf886a1453'),
 ('353', '69', '3', '1', 'en_us', '6', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Athletic Health Care Fitness\",\"slug\":\"athletic-health-care-fitness\",\"postDate\":1494433320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Are you looking for an educational experience that is fun, exciting and fast-paced? &nbsp;Look no further than Athletic Health Care and Fitness. &nbsp;This program will provide knowledge and real life experiences in recognizing, initially treating and rehabilitating athletic injuries. &nbsp;Under the direction of a licensed athletic trainer, students will assist injured athletes from the onset of injury to their full return to competition. &nbsp;Students will also learn about prevention of injury through the practice of proper sports nutrition, conditioning and weight training. &nbsp;Learning about the proper use and selection of sports related equipment will also provide students with knowledge and experience in injury reduction. &nbsp;The Athletic Health Care and Fitness Program will help you select and prepare for a future in fitness or a variety of health related careers.<\\/p>\",\"11\":\"<p>Level I \\u2013 Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.<\\/p><p>Level II \\u2013 Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.<\\/p>\\r\\n\",\"15\":[\"202\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"58\"],\"35\":{\"new1\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"7:30-10:15am \\u2013  (Level I)\"},{\"col1\":\"11:55-2:30pm \\u2013  (Level II)\"}]}},\"new2\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Assisting with treatment and rehabilitation of injuries\"},{\"col1\":\"Assisting the athletic trainer with evaluation and initial treatment of injuries\"},{\"col1\":\"Carrying out duties assigned by the athletic trainer\"},{\"col1\":\"Assisting in fitness setting\"}]}},\"new3\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Prevention of athletic injuries\"},{\"col1\":\"Recognition of athletic injuries\"},{\"col1\":\"First Aid and CPR\"},{\"col1\":\"Treatment and rehabilitation of athletic injuries\"},{\"col1\":\"Conditioning principles\"},{\"col1\":\"Weight training principles\"},{\"col1\":\"Exercise and fitness programs\"}]}},\"new4\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Assertive and relate well with people\"},{\"col1\":\"Excellent communication skills\"},{\"col1\":\"Desire to help people in need\"},{\"col1\":\"Dependable and reliable\"}]}},\"new5\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Youth Leadership Organization\",\"text\":[{\"col1\":\"AHCF club\"}]}},\"new6\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Biology\"},{\"col1\":\"Sciences\"},{\"col1\":\"English\"},{\"col1\":\"Math\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 17:52:58', '2017-10-16 17:52:58', '7adcfede-2ca7-4503-8057-00e013fc10df');
