 ('354', '70', '3', '1', 'en_us', '5', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Health Care and Technologies\",\"slug\":\"health-care-and-technologies\",\"postDate\":1494433320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Since many health careers require further education, students will be prepared for post-secondary studies in their area of concentration. &nbsp;&nbsp;Health Careers Technologies students will learn clinical skills that are utilized in a variety of occupations in the medical field. &nbsp;Students learn basic health care skills, medical laboratory processes, physical therapy techniques and clinical techniques. Additional coursework is provided in anatomy and physiology, medical terminology, nutrition, infection control, and legal\\/ ethical issues. This program places an emphasis on helping students shape their own future by providing them with a wide range of entry-level skills and knowledge. Certification is available AHA CPR-AED for the Health Care Provider<\\/p>\",\"11\":\"<p>Level I \\u2013 Anatomy and Physiology 1 ; CP English 1; Tech Theory 1; &nbsp;Lab 1.<br><\\/p>\\r\\n<p>Level II \\u2013 Tech Theory 1; Lab 2; CP English 1; Internship 0.5 \\u2013 3 <\\/p>\\r\\n\",\"15\":[\"203\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"58\"],\"35\":{\"new1\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two year program\"},{\"col1\":\"Shadowing observations\"},{\"col1\":\"Level 2 Internship opportunities\"},{\"col1\":\"Self-paced instruction and computer assistance when applicable\"}]}},\"new2\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Involves close contact with people, patients and co-workers\"},{\"col1\":\"Involves moving, lifting and fine motor skills\"}]}},\"new3\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Anatomy and Physiology\"},{\"col1\":\"Emergency Care & Triage\"},{\"col1\":\"Medical Terminology\"},{\"col1\":\"Nutrition & Dietary Modifications\"},{\"col1\":\"Infection Control & Safety Measures\"},{\"col1\":\"Rotations in Medical Assisting, Lab Assisting, Nurse Assisting, Dental Assisting & Rehabilitation Skills\"},{\"col1\":\"Communication skills\"}]}},\"new4\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Good Attendance\"},{\"col1\":\"GPA 3.0\"},{\"col1\":\"Biology\"},{\"col1\":\"Problem-solving skills\"},{\"col1\":\"Communication skills\"},{\"col1\":\"Ability to follow directions\"}]}},\"new5\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Youth Leadership Organization\",\"text\":[{\"col1\":\"HOSA (Health Occupations Students of America)\"}]}},\"new6\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Chemistry\\/other sciences\"},{\"col1\":\"Communication skills \\u2013 writing, listening and speaking\"},{\"col1\":\"Mathematics\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:14:27', '2017-10-16 18:14:27', '44d8c7d9-b5f0-4f1f-9e5c-eee18d45b770'),
 ('355', '68', '3', '1', 'en_us', '4', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Computer Aided Design and Engineering Technologies\",\"slug\":\"computer-aided-design-and-engineering-technologies\",\"postDate\":1494433320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Redefine what is possible through CAD & Engineering Technologies! Students will use the latest industry standard software and equipment to produce working drawings, 3D solid model designs, parts and assemblies. Additionally, students will have the opportunity to program and operate CNC machines (router, lathe, mill and water jet) to produce manufactured products using wood, metal, and plastic. Students will also operate rapid prototype machines (3D printer) laser engraver in fabricating various engineered and designed products. Manufacturing and welder processes and industries will be explored. This exciting, professional College Tech Prep offering is designed to prepare students for careers in the engineering, advanced manufacturing and architectural career fields. Students will network with industry experts and partners in high demand career fields. Senior level internships\\/industry placement opportunities are available to qualified students. Advanced technologies, coupled with the need to update and improve manufacturing facilities and product design, should fuel the demand for professionals in computer-aided manufacturing, architecture, and engineering technologies. According to the latest data 7,400 jobs within a 100 mile radius of Akron, Ohio currently exist. Upon successful completion of the program, students will be eligible to earn up to 3 college credits (CTAG) to any Ohio public university for Computer-Aided Drafting and Design in an Engineering Technology program.<\\/p>\",\"11\":\"<p>Level I: CP or Comp English 1; CADET IA 1; CADET IB 1.<br><\\/p>\\r\\n<p>Level II: CADET IIA 1.5; CADET IIB 1.5. Capstone* 1. (*Capstone includes project\\/ problem-based learning opportunities that occur both in the building and at an external site. Students may combine classroom teaching with work experience.)<\\/p>\\r\\n\",\"15\":[\"201\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"57\"],\"35\":{\"new1\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Skills Necessary for Success\",\"text\":[{\"col1\":\"Detail-oriented problem solver\"},{\"col1\":\"Ability to visualize projects\"},{\"col1\":\"Affinity for mathematics\"},{\"col1\":\"Ability to work independently and as a team member\"},{\"col1\":\"Positive attitude, critical thinker\"},{\"col1\":\"Interest in designing and building\"},{\"col1\":\"Use and implement precise measurements and calculations\"}]}},\"new2\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":{\"0\":{\"col1\":\"Engineering technician\"},\"1\":{\"col1\":\"Machine Technician\"},\"9\":{\"col1\":\"Manufacturing Engineer\\t \"},\"2\":{\"col1\":\"Architect\"},\"8\":{\"col1\":\"CNC programmer\\/operator\\t \"},\"3\":{\"col1\":\"Landscape architect\"},\"7\":{\"col1\":\"CAD Designer\\t \"},\"4\":{\"col1\":\"Interior designer\"},\"5\":{\"col1\":\"Furniture Engineering Draftsman \\t \"},\"6\":{\"col1\":\"Machinist\"}}}},\"new3\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Educational Opportunities\",\"text\":[{\"col1\":\"College credits available. See page 32.\"},{\"col1\":\" Bachelor\\u2019s degree\\t\"},{\"col1\":\"Associate\\u2019s degree \\t \\t \"},{\"col1\":\"Internships\"}]}},\"new4\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Career interests\\/helpful background\"},{\"col1\":\"Computer technology\\t \"},{\"col1\":\"Manufacturing process\"},{\"col1\":\"Blueprint design or production \\t \"},{\"col1\":\"Keyboarding skills\"}]}},\"new5\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Recommendations\",\"text\":[{\"col1\":\"Excellent attendance record \\t \"},{\"col1\":\"Geometry\"},{\"col1\":\"Minimum 2.5 GPA \"},{\"col1\":\"Utilize computer technologies\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:20:53', '2017-10-16 18:20:53', 'f35982ac-2ad7-463a-b0f8-79e803c00358'),
 ('356', '66', '3', '1', 'en_us', '4', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Electronics, Robotics, and Programming\",\"slug\":\"electronics-robotics-and-programming\",\"postDate\":1494433260,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Career opportunities are abundant and increasing in the fields of electronics, robotics and programming. This program will provide students with great preparation in theory and hands on experience. Transistor circuits, amplifiers, LED lighting and soldering projects are<br><\\/p>\\r\\n<p>included. Vex robots are built and programmed with C language. BASIC language is used for parallax robots and LED displays. Video game programming is offered, computers are assembled and software installed. Students who complete the Electronics, Robotics and Programming College Tech Prep Initiative will have the opportunity to continue their studies in post-secondary education, enhance their skills in the military or directly enter the workforce. <\\/p>\\r\\n\",\"11\":\"<p>Level I: Electronics, Robotics and Programming IA 1, Electronics, Robotics and Programming IB.<br><\\/p>\\r\\n<p>Level II: Electronics, Robotics and Programming IIA 1, Electronics, Robotics and Programming IIB.<\\/p>\\r\\n\",\"15\":[\"134\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"57\"],\"35\":{\"new1\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Construction technology\\u2014Core and sustainable construction\"},{\"col1\":\"Carpentry and masonry technical skills\"},{\"col1\":\"Structural systems\"},{\"col1\":\"Structural coverings and finishes\"}]}},\"new2\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Skills Necessary for Success\",\"text\":[{\"col1\":\"Ability to work independently and as part of a team\"},{\"col1\":\"Ability to follow directions and assume responsibility\"},{\"col1\":\"Written and verbal communication skills\"},{\"col1\":\"Disciplined self-starter\"},{\"col1\":\"Creative problem-solver \"},{\"col1\":\"Logical thinker who pays attention to detail\"},{\"col1\":\"Aptitude for precision work\"},{\"col1\":\"Manual dexterity\"},{\"col1\":\"Patience to follow through on tasks\"}]}},\"new3\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":[{\"col1\":\"Computer laboratory technician\"},{\"col1\":\"Development instrumentation technician\"},{\"col1\":\"Electronic communication technician\"},{\"col1\":\"Nuclear reactor electronics technician\"},{\"col1\":\"Systems testing laboratory technician\"},{\"col1\":\"Electronics manufacturing and production technician\"},{\"col1\":\"Electronic equipment installer\"},{\"col1\":\"Cable television installer\"},{\"col1\":\"Computer installer\\/technician\"}]}},\"new4\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Educational Opportunities\",\"text\":[{\"col1\":\"College credits available\"},{\"col1\":\"Associate\\u2019s degree\"},{\"col1\":\"Bachelor\\u2019s degree\"}]}},\"new5\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Using specialized tools and equipment \"},{\"col1\":\"Hands on applications of scientific principles\"},{\"col1\":\"Computer technology\"},{\"col1\":\"Electricity and circuitry\"}]}},\"new6\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Recommendations\",\"text\":[{\"col1\":\"Excellent attendance record\"},{\"col1\":\"Minimum 2.5 GPA\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:28:46', '2017-10-16 18:28:46', 'f011287b-6c99-4802-9a91-1010fd82bc85'),
 ('357', '67', '3', '1', 'en_us', '5', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Engineering Academy\",\"slug\":\"engineering-academy\",\"postDate\":1494433260,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>This two-year College Tech Prep Academy combines academically competitive, college prep courses with hands-on technical studies. Students rotate through four technology areas-computer-aided design, (CAD), electronics, robotics & programming, manufacturing processes and polymers. \\u00be of the program is at Theodore Roosevelt High school and \\u00bc of the program is at Stow-Munroe High School.<br><\\/p>\\r\\n<p>College prep courses in English, Algebra II or Honors\\/Adv. Algebra II, Pre-Calculus or Honors\\/Adv. Pre-Calculus, Calculus, AP Calculus, and Adv. Physics I and II are linked with the technology curriculum. University partners include Cleveland State University and The University of Akron.<\\/p><p>Various instructional approaches are used, including team teaching, work teams, self-directed studies, and project-based learning. &nbsp;Benefits of this program include: exposure to key elements of various aspects of engineering; practical content for future college engineering courses; work with experienced engineers; and extra-curricular opportunities with regional competitions.<br><\\/p>\\r\\n\",\"11\":\"<p><br><\\/p><p>Level I \\u2013 English 1; Tech Theory 1; Lab 2; <\\/p>\\r\\n<p>Level II \\u2013 English 1; Tech Theory 1; Lab 3; Internship 1<\\/p>\\r\\n\",\"15\":[\"131\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"57\"],\"35\":{\"new1\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"3.5 hours daily- from 7:30 am to 11:05 am\"},{\"col1\":\"Two technical credits plus three academic credits per year\"}]}},\"new2\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Prerequisites\",\"text\":[{\"col1\":\"Algebra 1 and Geometry or Honors\\/Adv. Algebra 1 and Honors\\/Adv. Geometry\"},{\"col1\":\"\\u201cB\\u201d or better in all math courses\"},{\"col1\":\"Completion of one college prep credit in science and English\"},{\"col1\":\"Recommended: Average G.P.A. of 2.75 for math, English, and science for three previous semesters\"},{\"col1\":\"Average 95% attendance for three previous semesters\"}]}},\"new3\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Principles of electronics, robotics & programming\"},{\"col1\":\"Design and manufacturing processes\"},{\"col1\":\"Computer-aided design (CAD)\"},{\"col1\":\"Lab testing procedures\\/standards\"},{\"col1\":\"Polymers\"},{\"col1\":\"Principles of Applied Physics\"},{\"col1\":\"Academy mathematics level is based on previous courses:\"},{\"col1\":\"Algebra II or Adv\\/Hon Alg. II\"},{\"col1\":\"Pre-Calculus or Adv\\/Hon Pre-Calculus\"},{\"col1\":\"Calculus or AP Calculus AB (second year 2 only)\"},{\"col1\":\"College Prep English: research writing, literary analysis, technical writing\"}]}},\"new4\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathways\",\"text\":[{\"col1\":\"Engineering: Aeronautical, biomedical, computer, electrical, environmental,  chemical, civil, corrosion, mechanical, petroleum, and welding \"},{\"col1\":\"Computer-Aided Design (CAD)\"},{\"col1\":\"Polymer Science\"},{\"col1\":\"Computer Programming\"},{\"col1\":\"Environmental Science\"},{\"col1\":\"Industrial Design\"},{\"col1\":\"and so much more!\"}]}},\"new5\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Education Opportunities\",\"text\":[{\"col1\":\"College credits available - Students are eligible to earn 9 college credits through the University of Akron, Summit College.\"},{\"col1\":\"Associate\\u2019s degree\"},{\"col1\":\"Bachelor\\u2019s degree\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:35:35', '2017-10-16 18:35:35', 'a901f7ef-7801-4d40-b22f-a5b9a926549a'),
 ('358', '68', '3', '1', 'en_us', '5', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Computer Aided Design and Engineering Technologies\",\"slug\":\"computer-aided-design-and-engineering-technologies\",\"postDate\":1494433320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Redefine what is possible through CAD & Engineering Technologies! Students will use the latest industry standard software and equipment to produce working drawings, 3D solid model designs, parts and assemblies. Additionally, students will have the opportunity to program and operate CNC machines (router, lathe, mill and water jet) to produce manufactured products using wood, metal, and plastic. Students will also operate rapid prototype machines (3D printer) laser engraver in fabricating various engineered and designed products. Manufacturing and welder processes and industries will be explored. This exciting, professional College Tech Prep offering is designed to prepare students for careers in the engineering, advanced manufacturing and architectural career fields. Students will network with industry experts and partners in high demand career fields. Senior level internships\\/industry placement opportunities are available to qualified students. Advanced technologies, coupled with the need to update and improve manufacturing facilities and product design, should fuel the demand for professionals in computer-aided manufacturing, architecture, and engineering technologies. According to the latest data 7,400 jobs within a 100 mile radius of Akron, Ohio currently exist. Upon successful completion of the program, students will be eligible to earn up to 3 college credits (CTAG) to any Ohio public university for Computer-Aided Drafting and Design in an Engineering Technology program.<\\/p>\",\"11\":\"<p>Level I: CP or Comp English 1; CADET IA 1; CADET IB 1.<br><\\/p>\\r\\n<p>Level II: CADET IIA 1.5; CADET IIB 1.5. Capstone* 1. (*Capstone includes project\\/ problem-based learning opportunities that occur both in the building and at an external site. Students may combine classroom teaching with work experience.)<\\/p>\",\"15\":[\"201\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"57\"],\"35\":{\"252\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Skills Necessary for Success\",\"text\":[{\"col1\":\"Detail-oriented problem solver\"},{\"col1\":\"Ability to visualize projects\"},{\"col1\":\"Affinity for mathematics\"},{\"col1\":\"Ability to work independently and as a team member\"},{\"col1\":\"Positive attitude, critical thinker\"},{\"col1\":\"Interest in designing and building\"},{\"col1\":\"Use and implement precise measurements and calculations\"}]}},\"253\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":[{\"col1\":\"Engineering technician\"},{\"col1\":\"Machine Technician\"},{\"col1\":\"Manufacturing Engineer\\t \"},{\"col1\":\"Architect\"},{\"col1\":\"CNC programmer\\/operator\\t \"},{\"col1\":\"Landscape architect\"},{\"col1\":\"CAD Designer\\t \"},{\"col1\":\"Interior designer\"},{\"col1\":\"Furniture Engineering Draftsman \\t \"},{\"col1\":\"Machinist\"}]}},\"254\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Educational Opportunities\",\"text\":[{\"col1\":\"College credits available. See page 32.\"},{\"col1\":\" Bachelor\\u2019s degree\\t\"},{\"col1\":\"Associate\\u2019s degree \\t \\t \"},{\"col1\":\"Internships\"}]}},\"255\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Career interests\\/helpful background\"},{\"col1\":\"Computer technology\\t \"},{\"col1\":\"Manufacturing process\"},{\"col1\":\"Blueprint design or production \\t \"},{\"col1\":\"Keyboarding skills\"}]}},\"256\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Recommendations\",\"text\":[{\"col1\":\"Excellent attendance record \\t \"},{\"col1\":\"Geometry\"},{\"col1\":\"Minimum 2.5 GPA \"},{\"col1\":\"Utilize computer technologies\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:37:20', '2017-10-16 18:37:20', '38731343-2535-4c04-9ae6-13433d144512'),
 ('359', '64', '3', '1', 'en_us', '4', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Construction Technologies\",\"slug\":\"construction-technologies\",\"postDate\":1494433140,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Students interested in working hands on with machinery, hand and power tools and who want to learn skills they can use on-the-job or in their own home should consider being apart of this excellent program. &nbsp;Emphasis is placed on both rough and finished carpentry with introductions to plumbing, masonry, cabinetry and residential wiring. &nbsp;Working in the lab, students will learn by constructing with their hands in order to build a strong foundation for a career in the building trades. &nbsp;Students that have completed this course have entered apprenticeships, entered two-year and four-year college programs in Construction Technology, Construction Management, Surveying and Architecture, started their own construction businesses or worked as building and property maintenance personnel, as well as carpenters for contractors and builders.<br><\\/p><p>In Level 1, students are introduced to many aspects of construction including remodeling, estimating, framing, roofing, exterior finishing, interior finishing, cabinets, countertops and trim work. By applying math, science, communication and team building skills, students construct real-life application projects in the spacious lab while also learning to operate a wide range of hand, power and air tools. Because the class focuses on residential construction, students learn to build from floor to roof, which helps prepare them for a career in the construction industry. The construction process introduces them to basic electrical, plumbing and masonry work. In Level II, students have the opportunity to complete a paid internship with contractors on actual<\\/p>\\r\\n<p>job sites. Completers of this program have entered apprenticeships, enrolled in two- and four-year colleges and worked for a contractor or builder as a carpenter. Many have even started their own construction business! Post-secondary credits available based on successful completion of the program and criteria set by the Ohio Department of Higher Education.<\\/p>\\r\\n\",\"11\":\"<p>Level I: CP or Comp English 1; Construction Tech IA (Construction Safety) 1.5; Construction Tech IB 1.5.<br><\\/p>\\r\\n<p>Level II: Construction Tech IIA 1.5; Construction Tech IIB 1.5. Optional Capstone* 1. (*Capstone includes project\\/problem-based learning opportunities that occur both in the building and at an external site. Students may combine classroom teaching with work experience.)<\\/p>\\r\\n\",\"15\":[\"151\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"55\"],\"35\":{\"new1\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Construction technology\\u2014Core and sustainable construction\"},{\"col1\":\"Carpentry and masonry technical skills\"},{\"col1\":\"Structural systems\"},{\"col1\":\"Structural coverings and finishes\"}]}},\"new2\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Skills Necessary for Success\",\"text\":[{\"col1\":\"Problem-solver\"},{\"col1\":\"Applied mathematics\"},{\"col1\":\"Able to visualize completed projects\"},{\"col1\":\"Ability to estimate and plan\"},{\"col1\":\"Use of hand and power tools\"},{\"col1\":\"Manual dexterity\"},{\"col1\":\"Safety awareness\"},{\"col1\":\"Designing and organization\"}]}},\"new3\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":[{\"col1\":\"General contractor\\/Remodeler\"},{\"col1\":\"Mason\"},{\"col1\":\"Carpenter\"},{\"col1\":\"Cabinet maker\"},{\"col1\":\"Rough framer\"},{\"col1\":\"Plumber\"},{\"col1\":\"Electrician\"},{\"col1\":\"Roofer\"},{\"col1\":\"Maintenance technician\"},{\"col1\":\"Drywall installer\\/Plasterer\"},{\"col1\":\"Estimator\"},{\"col1\":\"Construction supervisor\"},{\"col1\":\"Property manager\"},{\"col1\":\"Building inspector\"},{\"col1\":\"Architect\"},{\"col1\":\"Construction manager\"},{\"col1\":\"Interior Designer\"}]}},\"new4\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Educational Opportunities\",\"text\":[{\"col1\":\"College credits available. \"},{\"col1\":\"Associate\\u2019s degree\"},{\"col1\":\"Bachelor\\u2019s degree\"}]}},\"new5\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Interest in constructing and remodeling homes\"},{\"col1\":\"Interest in construction management\"},{\"col1\":\"Read blueprints and apply designs\"},{\"col1\":\"Interest in interior design of homes\"}]}},\"new6\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Recommendations\",\"text\":[{\"col1\":\"Excellent attendance record\"},{\"col1\":\"Minimum 2.5 GPA\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:44:27', '2017-10-16 18:44:27', '430c52cf-88cd-4402-814a-606c1dbe5986'),
 ('360', '66', '3', '1', 'en_us', '5', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Electronics, Robotics, and Programming\",\"slug\":\"electronics-robotics-and-programming\",\"postDate\":1494433260,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Career opportunities are abundant and increasing in the fields of electronics, robotics and programming. This program will provide students with great preparation in theory and hands on experience. Transistor circuits, amplifiers, LED lighting and soldering projects are<br><\\/p>\\r\\n<p>included. Vex robots are built and programmed with C language. BASIC language is used for parallax robots and LED displays. Video game programming is offered, computers are assembled and software installed. Students who complete the Electronics, Robotics and Programming College Tech Prep Initiative will have the opportunity to continue their studies in post-secondary education, enhance their skills in the military or directly enter the workforce. <\\/p>\",\"11\":\"<p>Level I: Electronics, Robotics and Programming IA 1, Electronics, Robotics and Programming IB.<br><\\/p>\\r\\n<p>Level II: Electronics, Robotics and Programming IIA 1, Electronics, Robotics and Programming IIB.<\\/p>\",\"15\":[\"134\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"57\"],\"35\":{\"257\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Construction technology\\u2014Core and sustainable construction\"},{\"col1\":\"Carpentry and masonry technical skills\"},{\"col1\":\"Structural systems\"},{\"col1\":\"Structural coverings and finishes\"}]}},\"258\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Skills Necessary for Success\",\"text\":[{\"col1\":\"Ability to work independently and as part of a team\"},{\"col1\":\"Ability to follow directions and assume responsibility\"},{\"col1\":\"Written and verbal communication skills\"},{\"col1\":\"Disciplined self-starter\"},{\"col1\":\"Creative problem-solver \"},{\"col1\":\"Logical thinker who pays attention to detail\"},{\"col1\":\"Aptitude for precision work\"},{\"col1\":\"Manual dexterity\"},{\"col1\":\"Patience to follow through on tasks\"}]}},\"259\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":[{\"col1\":\"Computer laboratory technician\"},{\"col1\":\"Development instrumentation technician\"},{\"col1\":\"Electronic communication technician\"},{\"col1\":\"Nuclear reactor electronics technician\"},{\"col1\":\"Systems testing laboratory technician\"},{\"col1\":\"Electronics manufacturing and production technician\"},{\"col1\":\"Electronic equipment installer\"},{\"col1\":\"Cable television installer\"},{\"col1\":\"Computer installer\\/technician\"}]}},\"260\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Educational Opportunities\",\"text\":[{\"col1\":\"College credits available\"},{\"col1\":\"Associate\\u2019s degree\"},{\"col1\":\"Bachelor\\u2019s degree\"}]}},\"261\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Using specialized tools and equipment \"},{\"col1\":\"Hands on applications of scientific principles\"},{\"col1\":\"Computer technology\"},{\"col1\":\"Electricity and circuitry\"}]}},\"262\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Recommendations\",\"text\":[{\"col1\":\"Excellent attendance record\"},{\"col1\":\"Minimum 2.5 GPA\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:44:44', '2017-10-16 18:44:44', '053986a9-ad07-4b77-8492-d82308760566'),
 ('361', '67', '3', '1', 'en_us', '6', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Engineering Academy\",\"slug\":\"engineering-academy\",\"postDate\":1494433260,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>This two-year College Tech Prep Academy combines academically competitive, college prep courses with hands-on technical studies. Students rotate through four technology areas-computer-aided design, (CAD), electronics, robotics & programming, manufacturing processes and polymers. \\u00be of the program is at Theodore Roosevelt High school and \\u00bc of the program is at Stow-Munroe High School.<br><\\/p>\\r\\n<p>College prep courses in English, Algebra II or Honors\\/Adv. Algebra II, Pre-Calculus or Honors\\/Adv. Pre-Calculus, Calculus, AP Calculus, and Adv. Physics I and II are linked with the technology curriculum. University partners include Cleveland State University and The University of Akron.<\\/p>\\r\\n<p>Various instructional approaches are used, including team teaching, work teams, self-directed studies, and project-based learning. &nbsp;Benefits of this program include: exposure to key elements of various aspects of engineering; practical content for future college engineering courses; work with experienced engineers; and extra-curricular opportunities with regional competitions.<br><\\/p>\",\"11\":\"<p><br><\\/p>\\r\\n<p>Level I \\u2013 English 1; Tech Theory 1; Lab 2; <\\/p>\\r\\n<p>Level II \\u2013 English 1; Tech Theory 1; Lab 3; Internship 1<\\/p>\",\"15\":[\"131\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"57\"],\"35\":{\"263\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"3.5 hours daily- from 7:30 am to 11:05 am\"},{\"col1\":\"Two technical credits plus three academic credits per year\"}]}},\"264\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Prerequisites\",\"text\":[{\"col1\":\"Algebra 1 and Geometry or Honors\\/Adv. Algebra 1 and Honors\\/Adv. Geometry\"},{\"col1\":\"\\u201cB\\u201d or better in all math courses\"},{\"col1\":\"Completion of one college prep credit in science and English\"},{\"col1\":\"Recommended: Average G.P.A. of 2.75 for math, English, and science for three previous semesters\"},{\"col1\":\"Average 95% attendance for three previous semesters\"}]}},\"265\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Principles of electronics, robotics & programming\"},{\"col1\":\"Design and manufacturing processes\"},{\"col1\":\"Computer-aided design (CAD)\"},{\"col1\":\"Lab testing procedures\\/standards\"},{\"col1\":\"Polymers\"},{\"col1\":\"Principles of Applied Physics\"},{\"col1\":\"Academy mathematics level is based on previous courses:\"},{\"col1\":\"Algebra II or Adv\\/Hon Alg. II\"},{\"col1\":\"Pre-Calculus or Adv\\/Hon Pre-Calculus\"},{\"col1\":\"Calculus or AP Calculus AB (second year 2 only)\"},{\"col1\":\"College Prep English: research writing, literary analysis, technical writing\"}]}},\"266\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathways\",\"text\":[{\"col1\":\"Engineering: Aeronautical, biomedical, computer, electrical, environmental,  chemical, civil, corrosion, mechanical, petroleum, and welding \"},{\"col1\":\"Computer-Aided Design (CAD)\"},{\"col1\":\"Polymer Science\"},{\"col1\":\"Computer Programming\"},{\"col1\":\"Environmental Science\"},{\"col1\":\"Industrial Design\"},{\"col1\":\"and so much more!\"}]}},\"267\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Education Opportunities\",\"text\":[{\"col1\":\"College credits available - Students are eligible to earn 9 college credits through the University of Akron, Summit College.\"},{\"col1\":\"Associate\\u2019s degree\"},{\"col1\":\"Bachelor\\u2019s degree\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:44:56', '2017-10-16 18:44:56', 'd98512a6-9743-431b-b4e1-0e2dc4a4252f'),
 ('362', '60', '3', '1', 'en_us', '7', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Forestry and Landscape Management\",\"slug\":\"forestry-and-landscape-management\",\"postDate\":1494433080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Concerned about the environment? &nbsp;Interested in ecology? &nbsp;In Forestry and Landscape Management, students learn about scientific identification of trees and plants, as well as landscaping design, construction and maintenance. &nbsp;Students are prepared for further education in fields like Turf Management, Arboriculture, Landscape Construction or Nursery Management. &nbsp;College Prep English includes writing assignments about plant science, career opportunities in the \\u201cGreen Industry\\u201d and other industry-related topics.A strong advocate of problem based learning with an emphasis on authentic, hands on, science based application, John promotes, and executes realistic, fundamental lessons in a huge variety of project based learning applications in the Green Industry. Many activities are a variety of community service projects emphasising plant identification, landscape construction and maintenance, and tree and turfgrass propagation, growing, and health care. <br><br>Classes are taught outdoors as much as possible and educational field trips are added to create dynamics in learning. Some of the traveling a student may experience is ( but not limited to ), traveling to other schools to work with science classes, going to City, County, and State Parks, participating in invasive plant identification and eradication and helping to replace plant species with native material. Classes are also visiting forests and lumber mills, working on golf courses, visiting large and small landscape design and building firms, attending turfgrass commercial equipment sales events, developing relations in business by visiting plant propagation and greenhouse facilities, investigating tree care and landscape maintenance businesses, visiting plant pathology labs studying insect and diseases, looking at mechanical engineering and agricultural repair shops, making occasional trips to farms that produce fruits, vegetables, Christmas trees,row crops, and nursery production.<br><br>When class can not be held outdoors, indoor instruction is geared toward personal communication and marketing skills, plant fertility, soil science, plant identification, and hand\\/ power tool usage and repair.<br><br>Alumni of the program have &nbsp;gone on to have successful traditional Green Industry careers such as designing and managing golf courses, becoming entrepreneurs in landscape construction companies, turf grass and athletic field installation and maintenance, plant health care technicians, US Forest Service employees, Parks and Recreation managers, tree care, and even running plant pathology labs. &nbsp;<br>Others students have successfully taken other non traditional destinations after graduation such as investment bankers, ski area managers, performers in acrobatic gymnastics and climbing, NHRA crew chief to name a few.These students have all suggested &nbsp;that Forestry and Landscape class created the foundation in their lives for working as a team, understanding how to think and memorize, develop personal communication skills, time management, creative expression, and problem solving in difficult situations.<br><\\/p>\\r\\n<p>If you are interested in working outside with plants and turf, this program may be for you. &nbsp;If you complete the Forest and Landscape Management program, you could be employed in various careers found in the \\u201cGreen\\u201d industry. &nbsp;You will have an opportunity to study first hand, given a work-based experience, between three and five major fields of study during the first year of the program. &nbsp;In the second year, you will concentrate on one area, attending class for approximately 50 minutes a day and working three to four hours a day in your area of interest.<\\/p>\\r\\n<ul><li><p>Golf course management <\\/p><\\/li><li><p>Forestry<\\/p><\\/li><li><p>Urban Forestry<\\/p><\\/li><\\/ul>\",\"11\":\"<p>Level I \\u2013 English 1; Tech Theory 1; Lab 2;<br><\\/p>\\r\\n<p>Level II \\u2013 English 1; Tech Theory 1; Lab 3; Internship 1<\\/p>\",\"15\":[\"211\"],\"12\":\"10, 11, 12\",\"14\":\"Two years\",\"38\":[\"53\"],\"35\":{\"217\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"One period (50 minutes) of Technical Theory\"},{\"col1\":\"Three periods (170 minutes) of work-based experience\"}]}},\"218\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Working indoors and\\/or outdoors\"}]}},\"219\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Plant identification and selection\"},{\"col1\":\"Landscape maintenance, construction and design\"},{\"col1\":\"Environmental ecologyArboriculture (Tree Management)\"},{\"col1\":\"Turf management\"},{\"col1\":\"Equipment maintenance, operation and safety\"},{\"col1\":\"Garden center and nursery operations\"},{\"col1\":\"Greenhouse operations\"}]}},\"220\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Future Educational Opportunities\",\"text\":[{\"col1\":\"Two year college Associate Degree\"},{\"col1\":\"Four year Baccalaureate Degree\"},{\"col1\":\"School-to-work employment transitions\"},{\"col1\":\"Industry internships\"}]}},\"221\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Reading and math skills\"},{\"col1\":\"Problem solving skills\"},{\"col1\":\"Interest in creative design\"},{\"col1\":\"Interest in biological sciences and the environment\"}]}},\"222\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Communicate orally and in writing\"},{\"col1\":\"Good interpersonal relationships\"},{\"col1\":\"Good personal appearance and hygiene\"},{\"col1\":\"Positive work attitude\"},{\"col1\":\"Good organizational skills\"},{\"col1\":\"Consistent attendance\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:45:41', '2017-10-16 18:45:41', '63b4be15-b419-4deb-8fb9-e0ba5d1e2a4f'),
 ('363', '71', '3', '1', 'en_us', '6', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Cosmetology\",\"slug\":\"cosmetology\",\"postDate\":1494433380,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>If you are artistic and interested in hair styling, makeup analysis and nail care, here\\u2019s a program that allows you to apply your talents and your interests. &nbsp;Instructors and students are kept up to date in this rapidly changing profession by attending shows and conferences, hosting guest artists and participating in competitions. &nbsp;As soon as you complete this two-year program you can apply to take the State Board exam and become a licensed Cosmetologist. &nbsp;You\\u2019ll be qualified for immediate employment, performing professional grooming services related to the care of hair, skin and nails. &nbsp;Who knows &mdash; some day you could become a famous make-up artist or a salon owner!<br><\\/p>\",\"11\":\"\",\"15\":[\"128\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"59\"],\"35\":{\"234\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"5 periods daily\"}]}},\"235\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Working with people and equipment\"},{\"col1\":\"Standing for long periods\"},{\"col1\":\"Working with chemicals\"},{\"col1\":\"Working with hands at shoulder height\"}]}},\"236\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Styling and care of the hair using many tools and products\"},{\"col1\":\"Shaping and cutting the hair\"},{\"col1\":\"Permanently waving or relaxing the hair\"},{\"col1\":\"Hair tinting and lightening\"},{\"col1\":\"Dispensing and controlling supplies\"},{\"col1\":\"Office procedures\"},{\"col1\":\"Cleaning and styling wigs\"},{\"col1\":\"Manicure, pedicure and sculpture nails\"},{\"col1\":\"Facial treatments and make-up\"}]}},\"237\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Good health and posture\"},{\"col1\":\"Good attendance\"},{\"col1\":\"Good finger dexterity\"},{\"col1\":\"Sense of form and artistry\"},{\"col1\":\"Non-allergic to chemicals\"},{\"col1\":\"Communicate orally and in writing\"}]}},\"238\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Youth Leadership Organization\",\"text\":[{\"col1\":\"Vocational Industrial Clubs of America (VICA)\"}]}},\"239\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Art\"},{\"col1\":\"Biology\"},{\"col1\":\"C.P. English\"},{\"col1\":\"General Science\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:47:05', '2017-10-16 18:47:05', '9c69f677-403f-401f-8874-34e294fba0af'),
 ('364', '71', '3', '1', 'en_us', '7', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Cosmetology\",\"slug\":\"cosmetology\",\"postDate\":1494433380,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>If you are artistic and interested in hair styling, makeup analysis and nail care, here\\u2019s a program that allows you to apply your talents and your interests. &nbsp;Instructors and students are kept up to date in this rapidly changing profession by attending shows and conferences, hosting guest artists and participating in competitions. &nbsp;As soon as you complete this two-year program you can apply to take the State Board exam and become a licensed Cosmetologist. &nbsp;You\\u2019ll be qualified for immediate employment, performing professional grooming services related to the care of hair, skin and nails. &nbsp;Who knows &mdash; some day you could become a famous make-up artist or a salon owner!<br><\\/p>\",\"11\":\"\",\"15\":[\"128\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"59\"],\"35\":{\"234\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"5 periods daily\"}]}},\"235\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Working with people and equipment\"},{\"col1\":\"Standing for long periods\"},{\"col1\":\"Working with chemicals\"},{\"col1\":\"Working with hands at shoulder height\"}]}},\"236\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Styling and care of the hair using many tools and products\"},{\"col1\":\"Shaping and cutting the hair\"},{\"col1\":\"Permanently waving or relaxing the hair\"},{\"col1\":\"Hair tinting and lightening\"},{\"col1\":\"Dispensing and controlling supplies\"},{\"col1\":\"Office procedures\"},{\"col1\":\"Cleaning and styling wigs\"},{\"col1\":\"Manicure, pedicure and sculpture nails\"},{\"col1\":\"Facial treatments and make-up\"}]}},\"237\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Good health and posture\"},{\"col1\":\"Good attendance\"},{\"col1\":\"Good finger dexterity\"},{\"col1\":\"Sense of form and artistry\"},{\"col1\":\"Non-allergic to chemicals\"},{\"col1\":\"Communicate orally and in writing\"}]}},\"238\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Youth Leadership Organization\",\"text\":[{\"col1\":\"Vocational Industrial Clubs of America (VICA)\"}]}},\"239\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Art\"},{\"col1\":\"Biology\"},{\"col1\":\"C.P. English\"},{\"col1\":\"General Science\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:48:07', '2017-10-16 18:48:07', '97244dbe-2af5-4351-b055-5624bfd0ce14'),
