 ('367', '69', '3', '1', 'en_us', '7', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Athletic Health Care Fitness\",\"slug\":\"athletic-health-care-fitness\",\"postDate\":1494433320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Are you looking for an educational experience that is fun, exciting and fast-paced? &nbsp;Look no further than Athletic Health Care and Fitness. &nbsp;This program will provide knowledge and real life experiences in recognizing, initially treating and rehabilitating athletic injuries. &nbsp;Under the direction of a licensed athletic trainer, students will assist injured athletes from the onset of injury to their full return to competition. &nbsp;Students will also learn about prevention of injury through the practice of proper sports nutrition, conditioning and weight training. &nbsp;Learning about the proper use and selection of sports related equipment will also provide students with knowledge and experience in injury reduction. &nbsp;The Athletic Health Care and Fitness Program will help you select and prepare for a future in fitness or a variety of health related careers.<\\/p>\",\"11\":\"<p>Level I \\u2013 Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.<\\/p>\\r\\n<p>Level II \\u2013 Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.<\\/p>\",\"15\":[\"202\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"58\"],\"35\":{\"240\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"7:30-10:15am \\u2013  (Level I)\"},{\"col1\":\"11:55-2:30pm \\u2013  (Level II)\"}]}},\"241\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Assisting with treatment and rehabilitation of injuries\"},{\"col1\":\"Assisting the athletic trainer with evaluation and initial treatment of injuries\"},{\"col1\":\"Carrying out duties assigned by the athletic trainer\"},{\"col1\":\"Assisting in fitness setting\"}]}},\"242\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Prevention of athletic injuries\"},{\"col1\":\"Recognition of athletic injuries\"},{\"col1\":\"First Aid and CPR\"},{\"col1\":\"Treatment and rehabilitation of athletic injuries\"},{\"col1\":\"Conditioning principles\"},{\"col1\":\"Weight training principles\"},{\"col1\":\"Exercise and fitness programs\"}]}},\"243\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Assertive and relate well with people\"},{\"col1\":\"Excellent communication skills\"},{\"col1\":\"Desire to help people in need\"},{\"col1\":\"Dependable and reliable\"}]}},\"244\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Youth Leadership Organization\",\"text\":[{\"col1\":\"AHCF club\"}]}},\"245\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Biology\"},{\"col1\":\"Sciences\"},{\"col1\":\"English\"},{\"col1\":\"Math\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:53:09', '2017-10-16 18:53:09', 'f151e93e-7c69-413f-ad3c-075c0243d1e7'),
 ('368', '64', '3', '1', 'en_us', '5', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Construction Technologies\",\"slug\":\"construction-technologies\",\"postDate\":1494433140,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Students interested in working hands on with machinery, hand and power tools and who want to learn skills they can use on-the-job or in their own home should consider being apart of this excellent program. &nbsp;Emphasis is placed on both rough and finished carpentry with introductions to plumbing, masonry, cabinetry and residential wiring. &nbsp;Working in the lab, students will learn by constructing with their hands in order to build a strong foundation for a career in the building trades. &nbsp;Students that have completed this course have entered apprenticeships, entered two-year and four-year college programs in Construction Technology, Construction Management, Surveying and Architecture, started their own construction businesses or worked as building and property maintenance personnel, as well as carpenters for contractors and builders.<br><\\/p>\\r\\n<p>In Level 1, students are introduced to many aspects of construction including remodeling, estimating, framing, roofing, exterior finishing, interior finishing, cabinets, countertops and trim work. By applying math, science, communication and team building skills, students construct real-life application projects in the spacious lab while also learning to operate a wide range of hand, power and air tools. Because the class focuses on residential construction, students learn to build from floor to roof, which helps prepare them for a career in the construction industry. The construction process introduces them to basic electrical, plumbing and masonry work. In Level II, students have the opportunity to complete a paid internship with contractors on actual<\\/p>\\r\\n<p>job sites. Completers of this program have entered apprenticeships, enrolled in two- and four-year colleges and worked for a contractor or builder as a carpenter. Many have even started their own construction business! Post-secondary credits available based on successful completion of the program and criteria set by the Ohio Department of Higher Education.<\\/p>\",\"11\":\"<p>Level I: CP or Comp English 1; Construction Tech IA (Construction Safety) 1.5; Construction Tech IB 1.5.<br><\\/p>\\r\\n<p>Level II: Construction Tech IIA 1.5; Construction Tech IIB 1.5. Optional Capstone* 1. (*Capstone includes project\\/problem-based learning opportunities that occur both in the building and at an external site. Students may combine classroom teaching with work experience.)<\\/p>\",\"15\":[\"151\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"55\"],\"35\":{\"268\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Construction technology\\u2014Core and sustainable construction\"},{\"col1\":\"Carpentry and masonry technical skills\"},{\"col1\":\"Structural systems\"},{\"col1\":\"Structural coverings and finishes\"}]}},\"269\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Skills Necessary for Success\",\"text\":[{\"col1\":\"Problem-solver\"},{\"col1\":\"Applied mathematics\"},{\"col1\":\"Able to visualize completed projects\"},{\"col1\":\"Ability to estimate and plan\"},{\"col1\":\"Use of hand and power tools\"},{\"col1\":\"Manual dexterity\"},{\"col1\":\"Safety awareness\"},{\"col1\":\"Designing and organization\"}]}},\"270\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":[{\"col1\":\"General contractor\\/Remodeler\"},{\"col1\":\"Mason\"},{\"col1\":\"Carpenter\"},{\"col1\":\"Cabinet maker\"},{\"col1\":\"Rough framer\"},{\"col1\":\"Plumber\"},{\"col1\":\"Electrician\"},{\"col1\":\"Roofer\"},{\"col1\":\"Maintenance technician\"},{\"col1\":\"Drywall installer\\/Plasterer\"},{\"col1\":\"Estimator\"},{\"col1\":\"Construction supervisor\"},{\"col1\":\"Property manager\"},{\"col1\":\"Building inspector\"},{\"col1\":\"Architect\"},{\"col1\":\"Construction manager\"},{\"col1\":\"Interior Designer\"}]}},\"271\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Educational Opportunities\",\"text\":[{\"col1\":\"College credits available. \"},{\"col1\":\"Associate\\u2019s degree\"},{\"col1\":\"Bachelor\\u2019s degree\"}]}},\"272\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Interest in constructing and remodeling homes\"},{\"col1\":\"Interest in construction management\"},{\"col1\":\"Read blueprints and apply designs\"},{\"col1\":\"Interest in interior design of homes\"}]}},\"273\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Recommendations\",\"text\":[{\"col1\":\"Excellent attendance record\"},{\"col1\":\"Minimum 2.5 GPA\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:53:19', '2017-10-16 18:53:19', '2dd2c6cc-a8e0-4e75-bcc1-1058f1810dc9'),
 ('369', '60', '3', '1', 'en_us', '8', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Forestry and Landscape Management\",\"slug\":\"forestry-and-landscape-management\",\"postDate\":1494433080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Concerned about the environment? &nbsp;Interested in ecology? &nbsp;In Forestry and Landscape Management, students learn about scientific identification of trees and plants, as well as landscaping design, construction and maintenance. &nbsp;Students are prepared for further education in fields like Turf Management, Arboriculture, Landscape Construction or Nursery Management. &nbsp;College Prep English includes writing assignments about plant science, career opportunities in the \\u201cGreen Industry\\u201d and other industry-related topics.A strong advocate of problem based learning with an emphasis on authentic, hands on, science based application, John promotes, and executes realistic, fundamental lessons in a huge variety of project based learning applications in the Green Industry. Many activities are a variety of community service projects emphasising plant identification, landscape construction and maintenance, and tree and turfgrass propagation, growing, and health care. <br><br>Classes are taught outdoors as much as possible and educational field trips are added to create dynamics in learning. Some of the traveling a student may experience is ( but not limited to ), traveling to other schools to work with science classes, going to City, County, and State Parks, participating in invasive plant identification and eradication and helping to replace plant species with native material. Classes are also visiting forests and lumber mills, working on golf courses, visiting large and small landscape design and building firms, attending turfgrass commercial equipment sales events, developing relations in business by visiting plant propagation and greenhouse facilities, investigating tree care and landscape maintenance businesses, visiting plant pathology labs studying insect and diseases, looking at mechanical engineering and agricultural repair shops, making occasional trips to farms that produce fruits, vegetables, Christmas trees,row crops, and nursery production.<br><br>When class can not be held outdoors, indoor instruction is geared toward personal communication and marketing skills, plant fertility, soil science, plant identification, and hand\\/ power tool usage and repair.<br><br>Alumni of the program have &nbsp;gone on to have successful traditional Green Industry careers such as designing and managing golf courses, becoming entrepreneurs in landscape construction companies, turf grass and athletic field installation and maintenance, plant health care technicians, US Forest Service employees, Parks and Recreation managers, tree care, and even running plant pathology labs. &nbsp;<br>Others students have successfully taken other non traditional destinations after graduation such as investment bankers, ski area managers, performers in acrobatic gymnastics and climbing, NHRA crew chief to name a few.These students have all suggested &nbsp;that Forestry and Landscape class created the foundation in their lives for working as a team, understanding how to think and memorize, develop personal communication skills, time management, creative expression, and problem solving in difficult situations.<br><\\/p>\\r\\n<p>If you are interested in working outside with plants and turf, this program may be for you. &nbsp;If you complete the Forest and Landscape Management program, you could be employed in various careers found in the \\u201cGreen\\u201d industry. &nbsp;You will have an opportunity to study first hand, given a work-based experience, between three and five major fields of study during the first year of the program. &nbsp;In the second year, you will concentrate on one area, attending class for approximately 50 minutes a day and working three to four hours a day in your area of interest.<\\/p>\\r\\n<ul><li><p>Golf course management <\\/p><\\/li><li><p>Forestry<\\/p><\\/li><li><p>Urban Forestry<\\/p><\\/li><\\/ul>\",\"11\":\"<p>Level I \\u2013 English 1; Tech Theory 1; Lab 2;<br><\\/p>\\r\\n<p>Level II \\u2013 English 1; Tech Theory 1; Lab 3; Internship 1<\\/p>\",\"15\":[\"211\"],\"12\":\"10, 11, 12\",\"14\":\"Two years\",\"38\":[\"53\"],\"35\":{\"217\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"One period (50 minutes) of Technical Theory\"},{\"col1\":\"Three periods (170 minutes) of work-based experience\"}]}},\"218\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Working indoors and\\/or outdoors\"}]}},\"219\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Plant identification and selection\"},{\"col1\":\"Landscape maintenance, construction and design\"},{\"col1\":\"Environmental ecologyArboriculture (Tree Management)\"},{\"col1\":\"Turf management\"},{\"col1\":\"Equipment maintenance, operation and safety\"},{\"col1\":\"Garden center and nursery operations\"},{\"col1\":\"Greenhouse operations\"}]}},\"220\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Future Educational Opportunities\",\"text\":[{\"col1\":\"Two year college Associate Degree\"},{\"col1\":\"Four year Baccalaureate Degree\"},{\"col1\":\"School-to-work employment transitions\"},{\"col1\":\"Industry internships\"}]}},\"221\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Reading and math skills\"},{\"col1\":\"Problem solving skills\"},{\"col1\":\"Interest in creative design\"},{\"col1\":\"Interest in biological sciences and the environment\"}]}},\"222\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Communicate orally and in writing\"},{\"col1\":\"Good interpersonal relationships\"},{\"col1\":\"Good personal appearance and hygiene\"},{\"col1\":\"Positive work attitude\"},{\"col1\":\"Good organizational skills\"},{\"col1\":\"Consistent attendance\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:56:06', '2017-10-16 18:56:06', '6700f21f-9b12-449a-9847-bae34c1b5a6e'),
 ('370', '60', '3', '1', 'en_us', '9', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Forestry and Landscape Management\",\"slug\":\"forestry-and-landscape-management\",\"postDate\":1494433080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Concerned about the environment? &nbsp;Interested in ecology? &nbsp;In Forestry and Landscape Management, students learn about scientific identification of trees and plants, as well as landscaping design, construction and maintenance. &nbsp;Students are prepared for further education in fields like Turf Management, Arboriculture, Landscape Construction or Nursery Management. &nbsp;College Prep English includes writing assignments about plant science, career opportunities in the \\u201cGreen Industry\\u201d and other industry-related topics.A strong advocate of problem based learning with an emphasis on authentic, hands on, science based application, John promotes, and executes realistic, fundamental lessons in a huge variety of project based learning applications in the Green Industry. Many activities are a variety of community service projects emphasising plant identification, landscape construction and maintenance, and tree and turfgrass propagation, growing, and health care. <br><br>Classes are taught outdoors as much as possible and educational field trips are added to create dynamics in learning. Some of the traveling a student may experience is ( but not limited to ), traveling to other schools to work with science classes, going to City, County, and State Parks, participating in invasive plant identification and eradication and helping to replace plant species with native material. Classes are also visiting forests and lumber mills, working on golf courses, visiting large and small landscape design and building firms, attending turfgrass commercial equipment sales events, developing relations in business by visiting plant propagation and greenhouse facilities, investigating tree care and landscape maintenance businesses, visiting plant pathology labs studying insect and diseases, looking at mechanical engineering and agricultural repair shops, making occasional trips to farms that produce fruits, vegetables, Christmas trees,row crops, and nursery production.<br><br>When class can not be held outdoors, indoor instruction is geared toward personal communication and marketing skills, plant fertility, soil science, plant identification, and hand\\/ power tool usage and repair.<br><br>Alumni of the program have &nbsp;gone on to have successful traditional Green Industry careers such as designing and managing golf courses, becoming entrepreneurs in landscape construction companies, turf grass and athletic field installation and maintenance, plant health care technicians, US Forest Service employees, Parks and Recreation managers, tree care, and even running plant pathology labs. &nbsp;<br>Others students have successfully taken other non traditional destinations after graduation such as investment bankers, ski area managers, performers in acrobatic gymnastics and climbing, NHRA crew chief to name a few.These students have all suggested &nbsp;that Forestry and Landscape class created the foundation in their lives for working as a team, understanding how to think and memorize, develop personal communication skills, time management, creative expression, and problem solving in difficult situations.<br><\\/p>\\r\\n<p>If you are interested in working outside with plants and turf, this program may be for you. &nbsp;If you complete the Forest and Landscape Management program, you could be employed in various careers found in the \\u201cGreen\\u201d industry. &nbsp;You will have an opportunity to study first hand, given a work-based experience, between three and five major fields of study during the first year of the program. &nbsp;In the second year, you will concentrate on one area, attending class for approximately 50 minutes a day and working three to four hours a day in your area of interest.<\\/p>\\r\\n<ul><li><p>Golf course management <\\/p><\\/li><li><p>Forestry<\\/p><\\/li><li><p>Urban Forestry<\\/p><\\/li><\\/ul>\",\"11\":\"<p>Level I \\u2013 English 1; Tech Theory 1; Lab 2;<br><\\/p>\\r\\n<p>Level II \\u2013 English 1; Tech Theory 1; Lab 3; Internship 1<\\/p>\",\"15\":[\"211\"],\"12\":\"10, 11, 12\",\"14\":\"Two years\",\"38\":[\"53\"],\"35\":{\"217\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"One period (50 minutes) of Technical Theory\"},{\"col1\":\"Three periods (170 minutes) of work-based experience\"}]}},\"218\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Working indoors and\\/or outdoors\"}]}},\"219\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Plant identification and selection\"},{\"col1\":\"Landscape maintenance, construction and design\"},{\"col1\":\"Environmental ecologyArboriculture (Tree Management)\"},{\"col1\":\"Turf management\"},{\"col1\":\"Equipment maintenance, operation and safety\"},{\"col1\":\"Garden center and nursery operations\"},{\"col1\":\"Greenhouse operations\"}]}},\"220\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Future Educational Opportunities\",\"text\":[{\"col1\":\"Two year college Associate Degree\"},{\"col1\":\"Four year Baccalaureate Degree\"},{\"col1\":\"School-to-work employment transitions\"},{\"col1\":\"Industry internships\"}]}},\"221\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Reading and math skills\"},{\"col1\":\"Problem solving skills\"},{\"col1\":\"Interest in creative design\"},{\"col1\":\"Interest in biological sciences and the environment\"}]}},\"222\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Communicate orally and in writing\"},{\"col1\":\"Good interpersonal relationships\"},{\"col1\":\"Good personal appearance and hygiene\"},{\"col1\":\"Positive work attitude\"},{\"col1\":\"Good organizational skills\"},{\"col1\":\"Consistent attendance\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-16 18:56:38', '2017-10-16 18:56:38', '42db3ed6-7c61-4baf-9bbc-07049f60cd19'),
 ('371', '183', '2', '1', 'en_us', '6', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"TRHS Calendar, TRHS Bell Schedule, Six District Educational Compact Calendar and Bus Schedule\",\"slug\":\"trhs-calnedar-trhs-bell-scheule-six-district-educational-compact-calendar-and-bus-schedule\",\"postDate\":1504886460,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>The TRHS Bell Schedule, TRHS and Six District Educational Compact calendars are located under the forms and calendar tab. &nbsp;Below is the Six District Educational Compact Transportation times.<\\/p>\",\"79\":[\"274\"],\"65\":\"The TRHS Bell Schedule, TRHS and Six District Educational Compact calendars are located under the forms and calendar tab.  Below is the Six District Educational Compact Transportation times.\",\"2\":\"\"}}', '2017-10-16 20:31:09', '2017-10-16 20:31:09', '92521bb6-527c-484e-b193-cc402fad2067'),
 ('372', '182', '2', '1', 'en_us', '3', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"TRHS Students Start Aug. 16; Six District Educational Compact Sudents First Day of School Aug. 17\",\"slug\":\"trhs-students-start-aug-16-six-district-educational-compact-students-first-day-of-school-aug-17\",\"postDate\":1504886220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>The first day of school for all Six District Educational Compact Career-Technical Education programs is August 17.<\\/p>\\r\\n<p>TRHS students will report for classes and TRHS CTE programs on Aug. 16.<\\/p>\\r\\n<p>TRHS students attending Six District Educational Compact programs outside of&nbsp;Kent attend&nbsp;only TRHS classes&nbsp;Aug 16, Six District Educational Compact programs begin Aug. 17 with the exception of Stow-Munroe Falls High School programs (1st day for programs is Aug. 22).<\\/p>\\r\\n<p>Six District Educational Compact students&nbsp;(Hudson, Tallmadge, SMF, Woodridge, and CF)&nbsp;start TRHS&nbsp;CTE programs Aug. 17&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/district-calendar-2017-2018\\/\\\">District-Calendar-2017-2018<\\/a>&nbsp;but attend home school classes on the first scheduled day.<\\/p>\\r\\n<p>Please email me at ke_bbachtel@kentschools.net if you have any questions or contact the Theodore Roosevelt Career-Technical Education office at (330) 676-8740 for personal service,&nbsp; The Kent City Schools&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/district-calendar-2017-2018\\/\\\">District-Calendar-2017-2018<\\/a>&nbsp;, Six District Educational Compact&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/interdistrict-driving-form-8-2018\\/\\\">Interdistrict-Driving-Form-8-2018<\\/a>&nbsp; and &nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/17-18-six-district-calendar\\/\\\">17-18 Six District Calendar<\\/a>&nbsp;are linked and can be found under the Forms tab.<\\/p>\",\"79\":[\"275\"],\"65\":\"The first day of school for all Six District Educational Compact Career-Technical Education programs is August 17.\",\"2\":\"\"}}', '2017-10-16 20:31:28', '2017-10-16 20:31:28', '1bb51fe1-651e-4a69-914f-e73ba91b61aa'),
 ('373', '186', '8', '1', 'en_us', '3', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"no Six District Transportation to Theodore Roosevelt High School\",\"slug\":\"monday-april-17-no-six-district-transportation-to-theodore-roosevelt-high-school\",\"postDate\":1504887600,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"4\\/17\\/2017\"},\"74\":{\"time\":\"11:30 PM\"},\"27\":\"\",\"39\":[\"156\"],\"72\":\"\",\"65\":\"Kent Theodore Roosevelt High School Career-Technical Education programs will be in session on Monday, April 17.  There will be no Six District Educational Compact busing that day.\",\"21\":\"\",\"73\":{\"time\":\"12:00 AM\"}}}', '2017-10-16 20:31:47', '2017-10-16 20:31:47', 'e0b21bb8-5af8-4ba1-9fa9-7e73e3461789'),
 ('374', '181', '8', '1', 'en_us', '2', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"Parent\\/Teacher Conferences Nov. 20 and 21\",\"slug\":\"parent-teacher-conferences-nov-20-and-21\",\"postDate\":1504886100,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"11\\/20\\/2017\"},\"74\":{\"time\":\"\"},\"27\":\"<p>Theodore Roosevelt Parent\\/Teacher conferences will be held on Monday, Nov. 20 from 5pm until 8pm, and on Tuesday, Nov. 21 from 9am until 8pm.&nbsp; Please call 330 676-8700 or email ke_nharris@kentschools.net to schedule an appointment.&nbsp; We welcome this opportunity to share your student\\u2019s progress and to discuss concerns and\\/or questions you may have.<\\/p>\",\"39\":[\"157\"],\"72\":\"\",\"65\":\"Theodore Roosevelt Parent\\/Teacher conferences will be held on Monday, Nov. 20 from 5pm until 8pm, and on Tuesday, Nov. 21 from 9am until 8pm. \",\"21\":\"\",\"73\":{\"time\":\"5:00 PM\"}}}', '2017-10-16 20:33:54', '2017-10-16 20:33:54', '3ce703d8-0719-40b8-a1b1-5cadbb7e47a2'),
 ('375', '185', '8', '1', 'en_us', '3', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"Welcome to the Program-Start Date Aug. 17\",\"slug\":\"welcome-to-the-program-start-date-aug-17-1\",\"postDate\":1504887000,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"8\\/17\\/2017\"},\"74\":{\"time\":\"\"},\"27\":\"<p>Important Items<\\/p>\\r\\n<p>-PLEASE &mdash;Wear school colors & sport uniforms!\\r\\n-Kent and home school calendars are in effect\\u2013reference both calendars..in the event of conflicts\\u2013 please communicate with your program instructor.\\r\\n-All Career-Technical Programs start Thursday, August 17.\\r\\n\\u2013<strong>Notify both, Kent and home school attendance to report an absence (330) 676-8750.<\\/strong>\\r\\n-Bus transportation to and from home school provided. Optional driving privilege form (<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/interdistrict-driving-form-8-2018\\/\\\">Interdistrict-Driving-Form-8-2018<\\/a>) must be completed and returned to the TRHS CTE office room 515 with your home school parking pass.\\r\\n-Each program has certain necessary workbooks and supplies which you will need. In some instances, students will be asked to purchase tool or operational kits. There are two methods of payment:&nbsp; (1) cash in full; or (2) a payment plan. Information about these two payment methods will be provided during the first week of school. Program school fees can be waived for students on free lunch (Six District Educational Compact students approved for free lunch will need to complete a fee waiver form),&nbsp;&nbsp; Your instructor will provide additional details.-<\\/p>\\r\\n<p><strong>Call the Kent Theodore Roosevelt Career-Technical Education office with any questions (330) 676-8740&hellip;we are here to serve you!<\\/strong><\\/p>\",\"39\":[\"155\"],\"72\":\"\",\"65\":\"\",\"21\":\"\",\"73\":{\"time\":\"\"}}}', '2017-10-16 20:34:17', '2017-10-16 20:34:17', '322031a0-c231-4f73-9af7-3d525e4cbeec'),
 ('376', '111', '7', '1', 'en_us', '2', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Aaron Morris \",\"slug\":\"aaron-morris\",\"postDate\":1499272740,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>#<\\/p>\",\"26\":\"st_morris@smfcsd.org\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"#\",\"66\":\"1\"}}', '2017-10-19 21:38:48', '2017-10-19 21:38:48', 'fd586bf4-d486-4821-a933-ee779cc64b04'),
 ('377', '116', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Angela Textor \",\"slug\":\"angela-textor\",\"postDate\":1499272920,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Angela is an instructor for Health Careers Technoligies. &nbsp;&nbsp;Angela started her career at Theodore Roosevelt High School in the fall of 2011. &nbsp;Prior to coming to Kent Roosevelt, Angela was a staff member in the Athletic Training Department at Kent state University. &nbsp;During her time at Kent State she worked primarily with Women\\u2019s Gymnastics, Cross Country and Softball, while also serving as the insurance coordinator for athletics. &nbsp;Angela has a vast amount of clinical experience and was a staff member of Crystal Clinic Inc. as an orthopaedic physician assistant for 11 years. &nbsp;Her primary responsibilities were assisting William Pakan, MD. with the evaluation and treatment of patients, as well as assisting in the operating room for outpatient procedures. Angela received her Bachelors of Arts in Education in 1993 from Kent State University and a master\\u2019s degree in Career Technical Education in 2013. &nbsp;&nbsp;Angela is an approved Clinical Instructor and is an instructor in CPR\\/First Aid\\/AED training.<br><\\/p>\",\"26\":\"ke_atextor@kentschools.net\",\"56\":[\"50\"],\"15\":[\"190\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:38:57', '2017-10-19 21:38:57', '412f4999-4638-4ac0-a3a6-7c0ffc53153f'),
 ('378', '100', '7', '1', 'en_us', '8', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Ben Dunlap\",\"slug\":\"ben-dunlap\",\"postDate\":1499272320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Ben Dunlap received a B.A. in Business Education and a M.A. in Sports Administration both from Kent State University. He currently teaches the Business and Sports Management program &nbsp;at Theodore Roosevelt High School in Kent, Ohio. A strong advocate of hands-on, inquiry-based learning, he involves his students in a variety of community service, problem-solving, and technology-infused activities that provide them with opportunities to use their expanding business knowledge and skills to work through various virtual businesses. His professional interests focus on ensuring all of his students understand the vast opportunities available to them in the Sports Management field. In addition, he serves as department chairperson for the Career and Technical Education department at Roosevelt as well as Faculty Manager for its athletic department. &nbsp;<br><\\/p>\",\"26\":\"ke_bdunlap@kentschools.net\",\"56\":[\"50\"],\"15\":[\"166\"],\"9\":\"#\",\"66\":\"\"}}', '2017-10-19 21:39:06', '2017-10-19 21:39:06', '780476f0-3770-49c9-a987-08de522826df'),
 ('379', '117', '7', '1', 'en_us', '9', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Brent Pfeiffer  \",\"slug\":\"brent-pfeiffer\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Brent Pfeiffer, a life-long resident of Kent, Ohio, is a third generation marketing educator and DECA advisor. Brent is a 1989 graduate of Theodore Roosevelt High School in Kent and a 1994 graduate of Kent State University; Pfeiffer also received his M.Ed. in 2004 from Kent State. Upon graduating from Kent, Brent used his marketing degree to pursue a career in sales working with John Hancock Financial Services and MCI Telecommunications before following the family legacy of teaching after his father\\u2019s untimely death in 1995.<\\/p>\\r\\n<p>Pfeiffer\\u2019s grandfather Paul was an Emeritus marketing professor at Kent State University and his great-uncle, Kenneth (Paul\\u2019s brother), was the State Supervisor of Distributive Education and DECA in Pennsylvania for most of his career. Brent\\u2019s father, Richard, founded Roosevelt\\u2019s award-winning Marketing and DECA program in 1967. &nbsp;During Brent\\u2019s tenure, the program has grown from a one-year program to a two-year program that has been internationally recognized as one of the top programs for entrepreneurial studies. During his 20 year tenure, Pfeiffer\\u2019s students have raised close to $500,000 for school, community, and philanthropic projects.<\\/p>\\r\\n<p><br>Throughout his career, Pfeiffer has worn many hats; he has worked as an assistant golf professional at area golf courses for 15 years, and has coached golf at Roosevelt for 18 years where he led the Rough Riders to seven consecutive league titles. Brent is also an assistant ice hockey coach at Roosevelt where he just finished his tenth season as an assistant with the team. He currently works part-time for the TaylorMade Golf Company in outside sales with his twin brother, David.&nbsp;<\\/p>\\r\\n<p><br>Pfeiffer has also spent time as an adjunct professor in Kent State\\u2019s Center for Entrepreneurship and Business Innovation where he served as an advisor for Kent State\\u2019s chapter of CEO, the Collegiate Entrepreneurs\\u2019 Organization. During his six year tenure in the College of Business, Pfeiffer was twice nominated by his students for the Part Time Distinguished Teaching Award. Brent also worked as a small business advisor in the Entrepreneurship Lab at the Center for Entrepreneurship, assisting student entrepreneurs with their student-run businesses. Pfeiffer has also taught adjunct in the College of Education at Kent State as well.<\\/p>\\r\\n<p><br>Committed to public service, Pfeiffer has volunteered on numerous boards, including fifteen years on the Ohio DECA Executive Council and Board of Directors, three years on the Kent Cyclones Youth Hockey Board of Directors, and is currently on the Advisory Board for Kent State\\u2019s LaunchNET, an entrepreneurial initiative that provides counseling to students, faculty, and alumni looking to bring ideas, inventions, and businesses to life. Pfeiffer has also served on Ohio Department of Education curriculum and assessment boards to develop the statewide entrepreneurship curriculum standards and testing. Most recently, he has served on an international panel of teachers and professors for DECA\\u2019s Competitive Events Task Force which was tasked with the revision, addition, modification, and improvement of DECA\\u2019s entrepreneurship events.<\\/p>\\r\\n<p><br>Brent and his wife of 23 years, Erika reside in Kent with their two children, Paige and Coulter.<br><\\/p>\",\"26\":\"ke_bpfeiffer@kentschools.net\",\"56\":[\"50\"],\"15\":[\"189\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:39:17', '2017-10-19 21:39:17', 'b46343ec-99e7-41ca-a2b3-ac00d8a1316c'),
 ('380', '162', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Brian Bachtel\",\"slug\":\"brian-bachtel\",\"postDate\":1504881240,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Brian Bachtel has been the Director of Career Technical Education at Kent City Schools since 2009. &nbsp;Prior to Kent City Schools, he was the Career Based Intervention Coordinator for Mentor Schools for nineteen years. &nbsp;Mr. Bachtel has taken a leadership role Career Technical Education in the State and on a national level. &nbsp;His leadership includes being the past-president of the Ohio Association for Career Technical Education. &nbsp;He holds a Bachelor\\u2019s degree in Education from the University of Toledo and a Master\\u2019s in Administration from Ashland University. &nbsp;Mr. Bachtel is member of the Rotary club of Kent..<\\/p>\",\"26\":\"ke_bbachtel@kentschools.net\",\"56\":[\"120\"],\"15\":[\"163\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:39:25', '2017-10-19 21:39:25', 'd70073c0-a1bf-4e0a-8d51-dd6e2f7fb491'),
 ('381', '115', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Catie Milton \",\"slug\":\"catie-milton\",\"postDate\":1499272920,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Catie Milton received her BSN (Bachelor of Science in Nursing ) and MEd (Master of Education) from Kent State University and is currently one of the instructors for &nbsp;the Health Careers Technologies Program at Kent Roosevelt High School. &nbsp;Catie is a certified American Heart Association instructor and teaches CPR. When she is not teaching , Catie cares &nbsp;for infants and their families at University Hospital\\u2019s Rainbow Babies & Children\\u2019s Hospital &nbsp;as an RN on the NICU Step-down and NICU. She has also worked &nbsp;in Akron Children\\u2019s Hospital NICU and at The Hattie Larlham Foundation as a nursing supervisor. &nbsp;As &nbsp;a registered nurse, Catie is uniquely qualified to bring current skills and practices into the classroom setting. The classes she teaches, Principles of Allied Health and Nursing and Patient Centered Care consist of both theory and lab activities where students can apply what they have learned using up to date medical equipment found in hospitals &nbsp;and other healthcare facilities. As part of the Health Careers &nbsp;program, Catie is the advisor for the Health Careers Tech Club and assists students in planning and implementing many service projects that benefit the local community such as creating quilts for patients undergoing chemotherapy, helping with the Red Cross Blood Drive and raising money for the Northeastern Ohio Leukemia and Lymphoma Society. Catie lives in Brimfield, Ohio &nbsp;and is an active member of Newman Center parish. She volunteers &nbsp;at the Kent Soup Kitchen and with UH Community Partners at various events such as the Cleveland Brown\\u2019s Camp and Boo at the Zoo in Cleveland.<\\/p>\",\"26\":\"ke_cmilton@kentschools.net\",\"56\":[\"50\"],\"15\":[\"172\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:39:34', '2017-10-19 21:39:34', 'd7a6c10b-03cb-4da8-a0f2-86f9d50d2676'),
 ('382', '113', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Dan Syvanych \",\"slug\":\"dan-syvanych\",\"postDate\":1499272800,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>#<\\/p>\",\"26\":\"st_dsyvanych@smfcsd.org\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"\",\"66\":\"1\"}}', '2017-10-19 21:39:48', '2017-10-19 21:39:48', 'c3c08630-e6b4-4452-b123-bd5e9fd4aeb1'),
 ('383', '104', '7', '1', 'en_us', '8', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Danielle Wardell\",\"slug\":\"danielle-wardell\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Danielle Wardell received her Cosmetology license in 2005 from Theodore Roosevelt High School and then her bachelor\\u2019s degree in Spanish education from the University of Akron in 2010. After six years teaching Spanish, Danielle changed professions, returned to TRHS, and is currently the senior level Cosmetology instructor. She is a strong believer in hands-on, kinesthetic learning. She believes that communication is one of the most valuable skills in the salon and she focuses much of her teaching to that skill. &nbsp;Another valuable skill she tries to convey to her students is the importance of the community. Danielle\\u2019s students perform hair, skin, and nail services on members of the community at Rider Salon as well as sponsor a craft show every November for the city of Kent. Danielle is also an active member of Theodore Roosevelt High School acting as the Junior Class advisor and silent auction chair.<br><\\/p>\",\"26\":\"ke_dwardell@kentschools.net\",\"56\":[\"50\"],\"15\":[\"178\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:39:59', '2017-10-19 21:39:59', 'ae67630a-9387-4482-9702-8e1985f1fae6'),
 ('384', '109', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"David Helmick\",\"slug\":\"david-helmick-st-helmick-smfcsd-org\",\"postDate\":1499272620,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>#<\\/p>\",\"26\":\"st_helmick@smfcsd.org\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"\",\"66\":\"1\"}}', '2017-10-19 21:40:09', '2017-10-19 21:40:09', '1e364c2c-ff14-4b40-b4ce-8585d30711c1'),
 ('385', '102', '7', '1', 'en_us', '8', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Don Titko\",\"slug\":\"don-titko\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Don Titko received a Bachelors Degree in Industrial Arts Education from Kent State University in 1983. In addition, he received his Masters Degree in Vocational Education from Kent State University in 2001. During his career, Don has spent many years in business and industry from management positions within a fortune 500 company to a construction business owner for 15 years prior to coming to Theodore Roosevelt High School. His strong beliefs in work ethic, pride in your work and craftsmanship resonate throughout his program. Instilling characteristics of accountability, responsibility, honesty, and respect allow students to grow in many ways beyond their technical training and education. &nbsp;Don is an advocate for the importance of students giving back to their community. &nbsp;This is reinforced through community service projects constructed in the program each year. To quote Don, \\\"People forget how fast you did a job&mdash;but they remember how well you did it.\\\"<br><\\/p>\",\"26\":\"ke_dtitko@kentschools.net\",\"56\":[\"50\"],\"15\":[\"136\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:40:17', '2017-10-19 21:40:17', '29f60d45-ba50-4c33-a3e4-42148cedf574'),
 ('386', '106', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Ed Borsuk\",\"slug\":\"ed-borsuk\",\"postDate\":1499272560,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>#<\\/p>\",\"26\":\"st_borsuk@smfcsd.org\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"\",\"66\":\"1\"}}', '2017-10-19 21:40:30', '2017-10-19 21:40:30', '5e6bd92f-7391-4234-8212-ff2c918711b3'),
 ('387', '51', '7', '1', 'en_us', '13', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Janelle Cuva\",\"slug\":\"jon-doe\",\"postDate\":1493993520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Mrs. Cuva has been a business teacher at Roosevelt for 16 years. She holds a bachelor\'s degree from Kent State University in Business Education, and also has a master\'s degree in Instructional Technology. &nbsp;She has been married for 14 years and has three beautiful children.<\\/p>\",\"26\":\"ke_jcuva@kentschools.net\",\"56\":[\"50\"],\"15\":[\"94\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:40:40', '2017-10-19 21:40:40', 'a9ebc8b7-499f-4063-b08f-72fb2c44bf26'),
 ('388', '105', '7', '1', 'en_us', '7', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeff LeSueur\",\"slug\":\"jeff-lesueur\",\"postDate\":1499272500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Jeff LeSueur is an electronics instructor at Theodore Roosevelt High School in Kent, Ohio. &nbsp;He teaches both an engineering class and a traditional career education class. &nbsp;Jeff holds degrees in Electrical Engineering (Cleveland State University) and a Master\\u2019s of Education (John Carroll University).<br><\\/p>\\r\\n<p>He believes that teachers must use materials that engage the students. &nbsp;Lessons should be directly applicable to the real world and skills should be developed that are useful in life and employable. &nbsp;This must be done while still finding and inventing lessons that are <em>interesting<\\/em> to students. &nbsp;Many materials should be used: project kits, videos, programming, field trips, student centered activities as well as traditional lab experiments and theory. &nbsp;Lessons should be evaluated for success regularly and updated frequently. &nbsp;This philosophy led Jeff to the design of the Awesome Cube and other innovative lessons. &nbsp;<\\/p>\\r\\n<p>Prior to teaching, Jeff worked in the telecommunications industry as a systems engineer, sales engineer, and consultant for several companies including Fujitsu, NASA, American Greetings and General DataComm.<\\/p>\\r\\n<p>Jeff has many interests. &nbsp;He is a performing jazz guitarist, equity investor, golfer, skier, boater, and biker.<\\/p>\",\"26\":\"ke_jlesueur@kentschools.net\",\"56\":[\"50\"],\"15\":[\"171\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:40:49', '2017-10-19 21:40:49', '2b880b36-f00c-492a-a0a7-40cdf57fd610'),
 ('389', '105', '7', '1', 'en_us', '8', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeff LeSueur\",\"slug\":\"jeff-lesueur\",\"postDate\":1499272500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Jeff LeSueur is an electronics instructor at Theodore Roosevelt High School in Kent, Ohio. &nbsp;He teaches both an engineering class and a traditional career education class. &nbsp;Jeff holds degrees in Electrical Engineering (Cleveland State University) and a Master\\u2019s of Education (John Carroll University).<br><\\/p>\\r\\n<p>He believes that teachers must use materials that engage the students. &nbsp;Lessons should be directly applicable to the real world and skills should be developed that are useful in life and employable. &nbsp;This must be done while still finding and inventing lessons that are <em>interesting<\\/em> to students. &nbsp;Many materials should be used: project kits, videos, programming, field trips, student centered activities as well as traditional lab experiments and theory. &nbsp;Lessons should be evaluated for success regularly and updated frequently. &nbsp;This philosophy led Jeff to the design of the Awesome Cube and other innovative lessons. &nbsp;<\\/p>\\r\\n<p>Prior to teaching, Jeff worked in the telecommunications industry as a systems engineer, sales engineer, and consultant for several companies including Fujitsu, NASA, American Greetings and General DataComm.<\\/p>\\r\\n<p>Jeff has many interests. &nbsp;He is a performing jazz guitarist, equity investor, golfer, skier, boater, and biker.<\\/p>\",\"26\":\"ke_jlesueur@kentschools.net\",\"56\":[\"50\"],\"15\":[\"171\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:40:55', '2017-10-19 21:40:55', '2b88a8c5-1e35-4df8-9367-f1979b699034'),
 ('390', '105', '7', '1', 'en_us', '9', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeff LeSueur\",\"slug\":\"jeff-lesueur\",\"postDate\":1499272500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Jeff LeSueur is an electronics instructor at Theodore Roosevelt High School in Kent, Ohio. &nbsp;He teaches both an engineering class and a traditional career education class. &nbsp;Jeff holds degrees in Electrical Engineering (Cleveland State University) and a Master\\u2019s of Education (John Carroll University).<br><\\/p>\\r\\n<p>He believes that teachers must use materials that engage the students. &nbsp;Lessons should be directly applicable to the real world and skills should be developed that are useful in life and employable. &nbsp;This must be done while still finding and inventing lessons that are <em>interesting<\\/em> to students. &nbsp;Many materials should be used: project kits, videos, programming, field trips, student centered activities as well as traditional lab experiments and theory. &nbsp;Lessons should be evaluated for success regularly and updated frequently. &nbsp;This philosophy led Jeff to the design of the Awesome Cube and other innovative lessons. &nbsp;<\\/p>\\r\\n<p>Prior to teaching, Jeff worked in the telecommunications industry as a systems engineer, sales engineer, and consultant for several companies including Fujitsu, NASA, American Greetings and General DataComm.<\\/p>\\r\\n<p>Jeff has many interests. &nbsp;He is a performing jazz guitarist, equity investor, golfer, skier, boater, and biker.<\\/p>\",\"26\":\"ke_jlesueur@kentschools.net\",\"56\":[\"50\"],\"15\":[\"171\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:40:58', '2017-10-19 21:40:58', '2aa779f4-0498-474e-86b0-28eafd492092'),
 ('391', '91', '7', '1', 'en_us', '12', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeffrey Bee\",\"slug\":\"robert\",\"postDate\":1496850840,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>He is a Mechanical Engineer with a Bachelor of Science in Mechanical Engineering degree from The University of Akron. He earned a &nbsp;master\\u2019s degree in Career and Technical Education through Kent State University. He has worked as a mechanical designer, project engineer or product engineer on projects worth hundreds of thousands of dollars to multi-million dollar projects from New York City to Alaska and globally (Saudi Arabia and South Korea). He has had privilege to have taught and coached four Ohio Gold Medal Champions in Technical Drafting in the past six years. (2006-2012 &nbsp;all Portage County Students) Each student competed at the national level against the best in the country.<\\/p>\",\"26\":\" ke_jbee@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:41:09', '2017-10-19 21:41:09', 'c6449e33-a4e6-466d-a8f3-b3d3a4b4182e'),
 ('392', '114', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"John Lang \",\"slug\":\"john-lang\",\"postDate\":1499272860,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>John Lang, an instructor for Forestry and Landscape Management received a degree.in Horticulture from Ohio State, is a Certified Arborist from The International Society of Arboriculture, is a Certified Commercial Pesticide Applicator from the Ohio Department of Agriculture, and holds a class A, commercial driver\'s license from the Ohio Bureau of Motor Vehicles, and owner and operator of Mogul Creek Farms in Kent Ohio.<br><br>Lang is also involved in the United States Ski Association, he is a nationally certified alpine and nordic ski instructor, examiner emeritus. He is starting his thirty fourth year in marketing and sales for &nbsp;Volkl skis, Marker bindings, and Dalbello ski boots. He alo is a certified ski mechanic, boot fitter and sponsored skier. Many students have supplemented their employment in the snowsports industry by taking Lang\'s class.<br><br>Lang is also an accomplished percussionist playing drums and singing for several rock and jazz fusion bands over the last forty years.<\\/p>\",\"26\":\"ke_jlang@kentschools.net\",\"56\":[\"50\"],\"15\":[\"170\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:41:17', '2017-10-19 21:41:17', '9e665781-0de8-4dc3-a6c4-f0879a2fbe16'),
 ('393', '112', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"John Seabolt \",\"slug\":\"john-seabolt\",\"postDate\":1499272740,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>#<\\/p>\",\"26\":\"ke_jseabolt@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:41:28', '2017-10-19 21:41:28', '22a0066c-e8f2-4a04-9f24-879c2fa29bfc'),
 ('394', '108', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Kasey Adelman\",\"slug\":\"kasey-adelman\",\"postDate\":1499272620,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>#<\\/p>\",\"26\":\"ke_kadelman@kentschools.net\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:41:37', '2017-10-19 21:41:37', '71e3a0eb-fd96-40f2-8ba4-a554c4355f08'),
 ('395', '107', '7', '1', 'en_us', '7', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Laura Eyring\",\"slug\":\"laura-eyring\",\"postDate\":1499272560,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Laura Eyring received a B.S. in Aerospace Engineering from Embry-Riddle Aeronautical University, a B.S. in Secondary Math Education from Southeast Missouri State University, and a M.A. in Career-Technical Education from Kent State University and is currently teaching Computer Aided Design, Pre-Calculus, Advanced Pre-Calculus, and College Math Fundamentals at Theodore Roosevelt High School. &nbsp;A strong advocate for showing students the real-world, relevant connections in mathematics as well as in Computer Aided Design, she involves her students in activities and projects that reflect those connections. &nbsp;Her professional interests focus on the ever-changing and quickly-advancing world of 3D prototyping. &nbsp;She serves as an instructor for the Engineering Academy, part of the Six District Educational Compact.<br><\\/p>\",\"26\":\"ke_leyring@kentschools.net\",\"56\":[\"50\"],\"15\":[\"167\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:41:45', '2017-10-19 21:41:45', 'aa3cba87-a075-4b90-b503-8bbdbc1fba3a'),
 ('396', '107', '7', '1', 'en_us', '8', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Laura Eyring\",\"slug\":\"laura-eyring\",\"postDate\":1499272560,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Laura Eyring received a B.S. in Aerospace Engineering from Embry-Riddle Aeronautical University, a B.S. in Secondary Math Education from Southeast Missouri State University, and a M.A. in Career-Technical Education from Kent State University and is currently teaching Computer Aided Design, Pre-Calculus, Advanced Pre-Calculus, and College Math Fundamentals at Theodore Roosevelt High School. &nbsp;A strong advocate for showing students the real-world, relevant connections in mathematics as well as in Computer Aided Design, she involves her students in activities and projects that reflect those connections. &nbsp;Her professional interests focus on the ever-changing and quickly-advancing world of 3D prototyping. &nbsp;She serves as an instructor for the Engineering Academy, part of the Six District Educational Compact.<br><\\/p>\",\"26\":\"ke_leyring@kentschools.net\",\"56\":[\"50\"],\"15\":[\"167\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:41:49', '2017-10-19 21:41:49', 'fb4a1648-6d01-4c2c-a5d2-f0776a7bdf24'),
 ('397', '107', '7', '1', 'en_us', '9', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Laura Eyring\",\"slug\":\"laura-eyring\",\"postDate\":1499272560,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Laura Eyring received a B.S. in Aerospace Engineering from Embry-Riddle Aeronautical University, a B.S. in Secondary Math Education from Southeast Missouri State University, and a M.A. in Career-Technical Education from Kent State University and is currently teaching Computer Aided Design, Pre-Calculus, Advanced Pre-Calculus, and College Math Fundamentals at Theodore Roosevelt High School. &nbsp;A strong advocate for showing students the real-world, relevant connections in mathematics as well as in Computer Aided Design, she involves her students in activities and projects that reflect those connections. &nbsp;Her professional interests focus on the ever-changing and quickly-advancing world of 3D prototyping. &nbsp;She serves as an instructor for the Engineering Academy, part of the Six District Educational Compact.<br><\\/p>\",\"26\":\"ke_leyring@kentschools.net\",\"56\":[\"50\"],\"15\":[\"167\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:41:54', '2017-10-19 21:41:54', '4b82ede0-50e5-41f0-93fd-42e6e060ce49'),
 ('398', '118', '7', '1', 'en_us', '8', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Rhonda Butler-Carson\",\"slug\":\"rhonda-butler-carson-ke-rbulter-kentschools-net\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Rhonda Butler Carson received a B.A. in Comprehensive Business Education from the University of Akron as well as a Masters of Education from Kent State University. &nbsp;Currently, she is the instructor for the Teaching Professions program serving students in the Six District Educational Compact. &nbsp;A strong advocate of hands-on and inquiry-based learning, she involves her students in a variety of problem-solving and technology-infused activities that provide them with opportunities to use their skills to both learn and teach others. Her professional interests focus on what\'s new and upcoming in the teaching arena, implementing the most current teaching philosophies and strategies into her instruction. &nbsp;In addition to teaching the program, she is the co-coordinator for the Resident Educator Program with Kent City Schools, a mentoring program for all new teachers in the district.<\\/p>\",\"26\":\"ke_rbulter@kentschools.net\",\"56\":[\"50\"],\"15\":[\"164\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:42:04', '2017-10-19 21:42:04', '91afd4f7-15ea-41e0-8746-3c9d132df33e'),
 ('399', '118', '7', '1', 'en_us', '9', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Rhonda Butler-Carson\",\"slug\":\"rhonda-butler-carson-ke-rbulter-kentschools-net\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Rhonda Butler Carson received a B.A. in Comprehensive Business Education from the University of Akron as well as a Masters of Education from Kent State University. &nbsp;Currently, she is the instructor for the Teaching Professions program serving students in the Six District Educational Compact. &nbsp;A strong advocate of hands-on and inquiry-based learning, she involves her students in a variety of problem-solving and technology-infused activities that provide them with opportunities to use their skills to both learn and teach others. Her professional interests focus on what\'s new and upcoming in the teaching arena, implementing the most current teaching philosophies and strategies into her instruction. &nbsp;In addition to teaching the program, she is the co-coordinator for the Resident Educator Program with Kent City Schools, a mentoring program for all new teachers in the district.<\\/p>\",\"26\":\"ke_rbulter@kentschools.net\",\"56\":[\"50\"],\"15\":[\"164\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:42:07', '2017-10-19 21:42:07', '53511c7e-2746-48ac-9293-b595a175e34b'),
 ('400', '118', '7', '1', 'en_us', '10', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Rhonda Butler-Carson\",\"slug\":\"rhonda-butler-carson-ke-rbulter-kentschools-net\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Rhonda Butler Carson received a B.A. in Comprehensive Business Education from the University of Akron as well as a Masters of Education from Kent State University. &nbsp;Currently, she is the instructor for the Teaching Professions program serving students in the Six District Educational Compact. &nbsp;A strong advocate of hands-on and inquiry-based learning, she involves her students in a variety of problem-solving and technology-infused activities that provide them with opportunities to use their skills to both learn and teach others. Her professional interests focus on what\'s new and upcoming in the teaching arena, implementing the most current teaching philosophies and strategies into her instruction. &nbsp;In addition to teaching the program, she is the co-coordinator for the Resident Educator Program with Kent City Schools, a mentoring program for all new teachers in the district.<\\/p>\",\"26\":\"ke_rbulter@kentschools.net\",\"56\":[\"50\"],\"15\":[\"164\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:42:10', '2017-10-19 21:42:10', 'c833b2d0-76c9-4dcb-b955-363020aa7048'),
 ('401', '103', '7', '1', 'en_us', '7', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Sandi Melucci\",\"slug\":\"sandi-melucci\",\"postDate\":1499272440,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Sandi Melucci received her degree from Kent State University in Career Technical Education and is currently teaching Cosmetology at Theodore Roosevelt High School. &nbsp;A strong advocate for hands-on learning and involves her students in hair competitions, professional hair shows and personal in salon training from various licensed professionals in the field of Cosmetology. As she believes in involvement in school and community activities her students are presently preparing for RHS annual craft show as well as working behind the scenes for the theater. &nbsp; &nbsp;<\\/p>\",\"26\":\"ke_smelucci@kentschools.net\",\"56\":[\"50\"],\"15\":[\"188\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:42:20', '2017-10-19 21:42:20', '11575f48-2323-4b41-9278-aafff14a236f'),
 ('402', '110', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Sarah Kaplan  \",\"slug\":\"sarah-kaplan\",\"postDate\":1499272680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>#<\\/p>\",\"26\":\"ke_skaplan@kentschools.net\",\"56\":\"\",\"15\":[\"179\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:42:31', '2017-10-19 21:42:31', 'a320e76c-8e2c-476b-a23f-8bec3a6c2b86'),
 ('403', '99', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Terry Slattery\",\"slug\":\"terry-slattery\",\"postDate\":1499272260,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Terry Slattery is the primary instructor for both the Level I and Level II Athletic Health Care and Fitness career technical education program at Theodore Roosevelt High School. &nbsp;He has lead this 2-yr program since its design and inception into the Six District Educational Compact in 1997. &nbsp;Over 400 students have completed the 2-yr program requirements with approximately 80% of these graduates currently working or studying within the field of health care today. &nbsp;Terry received his B.S. in Health Education and Athletic Training from Bowling Green State University. &nbsp;He has completed graduate credit hours at both Central Michigan University and Kent State University. &nbsp;Terry also serves as the Head Athletic Trainer for all of the Roosevelt Rough Rider athletic teams. &nbsp;He was awarded the 2013 Ohio Athletic Trainers Association (OATA) Linda Weber-Daniels Student Mentorship Award for his work with high school students interested in health care professions. &nbsp;He was also recognized by the OATA in 2003 as the Ohio High School Athletic Trainer of the Year and a Special Consideration award for successfully performing CPR on an unresponsive person at a Kent State University basketball game. &nbsp;Slattery has collaborated with the Six District Educational Compact, Kent State University, University of Akron, Slippery Rock University, and the Ohio Department of Education in curricular design and assessment testing. &nbsp;He and his students have also worked with Northeast Medical University (NEOMED) and AmeriCorp on a number of educational projects and was recognized as the 2016 Health Professions Affinity Community (HPAC) Teacher of the Year. &nbsp;Slattery was also honored by the Kent City Schools as an Emilio Ferrara Service Award winner in 2014. &nbsp;A strong advocate for hands-on, inquiry-based problem solving, he works hard with his students to provide them with a variety of tools to make learning enjoyable and applicable to their personal needs and objectives. &nbsp;<\\/p>\",\"26\":\"ke_tslattery@kentschools.net\",\"56\":[\"50\"],\"15\":[\"175\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:42:40', '2017-10-19 21:42:40', '33ea81b2-8d7e-45cd-8c62-d799a78d6374'),
 ('404', '96', '7', '1', 'en_us', '7', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Tom Franek\",\"slug\":\"mr-tom-franek\",\"postDate\":1498584780,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>As an instructor of &nbsp;Forestry and Landscape Management for 16 years at Kent Theodore Roosevelt High School, I\'ve enjoyed the mix of teaching new skills and knowledge along with providing the ability to apply these skills and knowledge on real job sites in the community. &nbsp;&nbsp;It provides for a very fulfilling career.<\\/p>\\r\\n<p>I believe that careers related to this field provide and promote an active, healthy and happy lifestyle and a very high quality of life. &nbsp;As part of the program, I advocate living healthy by emphasizing safe working habits, proper diet and sleep habits, and involvement in activities that promote fitness.<\\/p>\",\"26\":\"ke_tfranek@kentschools.net\",\"56\":[\"50\"],\"15\":[\"95\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:42:49', '2017-10-19 21:42:49', '234745d2-c505-483e-8896-88744d236a87'),
 ('405', '101', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Troy Spear\",\"slug\":\"troy-spear\",\"postDate\":1499272380,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Troy Spear is level I instructor for the Computer Aided Design and Engineering Technologies career technical program at Theodore Roosevelt High School. &nbsp;Mr. Spear is the sole instructor for the elective courses: Fundamentals of Wood and Metal Manufacturing, and Advanced Cabinetry. &nbsp;He received his Master of Arts in Industrial Technology from Kent State University after completing his undergraduate B.A. degrees in English, Speech, Theatre and Education from the University of Sioux Falls in Sioux Falls, South Dakota. &nbsp;Spear is also a member of the Society of Manufacturing Engineers, the Cabinetmakers Association, Woodwork Career Alliance and Skills USA. &nbsp;His commitment to hands-on, inquiry based problem solving and learning fosters an active learning environment where students are physically engaged in the work that they are learning about; be it setting up and operating machines, making accurate technical drawings and renderings or writing programs to run on the CAD & Engineering Tech programs CNC machines. &nbsp;Spear\\u2019s goal is that his students demonstrate knowledge and the application of real world knowledge they gain to solve tomorrow\\u2019s problems. &nbsp;He states that if students can dream it we can show them how to draw it, design it, prototype it, machine it, put it together and make it work.<br><\\/p>\",\"26\":\"ke_tspear@kentschools.net\",\"56\":[\"50\"],\"15\":[\"187\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:42:59', '2017-10-19 21:42:59', '656c661d-d2bc-4426-98c6-1126485590a8'),
 ('406', '111', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Aaron Morris \",\"slug\":\"aaron-morris\",\"postDate\":1499272740,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>#<\\/p>\",\"26\":\"st_morris@smfcsd.org\",\"56\":[\"50\"],\"15\":\"\",\"9\":\"\",\"66\":\"1\"}}', '2017-10-19 21:43:09', '2017-10-19 21:43:09', '7a3d6ad4-61e2-429d-b375-8f2346d6b616'),
 ('407', '116', '7', '1', 'en_us', '7', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Angela Textor \",\"slug\":\"angela-textor\",\"postDate\":1499272920,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Angela is an instructor for Health Careers Technoligies. &nbsp;&nbsp;Angela started her career at Theodore Roosevelt High School in the fall of 2011. &nbsp;Prior to coming to Kent Roosevelt, Angela was a staff member in the Athletic Training Department at Kent state University. &nbsp;During her time at Kent State she worked primarily with Women\\u2019s Gymnastics, Cross Country and Softball, while also serving as the insurance coordinator for athletics. &nbsp;Angela has a vast amount of clinical experience and was a staff member of Crystal Clinic Inc. as an orthopaedic physician assistant for 11 years. &nbsp;Her primary responsibilities were assisting William Pakan, MD. with the evaluation and treatment of patients, as well as assisting in the operating room for outpatient procedures. Angela received her Bachelors of Arts in Education in 1993 from Kent State University and a master\\u2019s degree in Career Technical Education in 2013. &nbsp;&nbsp;Angela is an approved Clinical Instructor and is an instructor in CPR\\/First Aid\\/AED training.<br><\\/p>\",\"26\":\"ke_atextor@kentschools.net\",\"56\":[\"50\"],\"15\":[\"190\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:43:16', '2017-10-19 21:43:16', 'b54f7f9e-f5c5-4ef5-a050-bbae15750f60'),
 ('408', '100', '7', '1', 'en_us', '9', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Ben Dunlap\",\"slug\":\"ben-dunlap\",\"postDate\":1499272320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Ben Dunlap received a B.A. in Business Education and a M.A. in Sports Administration both from Kent State University. He currently teaches the Business and Sports Management program &nbsp;at Theodore Roosevelt High School in Kent, Ohio. A strong advocate of hands-on, inquiry-based learning, he involves his students in a variety of community service, problem-solving, and technology-infused activities that provide them with opportunities to use their expanding business knowledge and skills to work through various virtual businesses. His professional interests focus on ensuring all of his students understand the vast opportunities available to them in the Sports Management field. In addition, he serves as department chairperson for the Career and Technical Education department at Roosevelt as well as Faculty Manager for its athletic department. &nbsp;<br><\\/p>\",\"26\":\"ke_bdunlap@kentschools.net\",\"56\":[\"50\"],\"15\":[\"166\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:43:26', '2017-10-19 21:43:26', '785dea9b-5224-4e1f-9d09-9bacfebb1ad1'),
 ('409', '117', '7', '1', 'en_us', '10', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Brent Pfeiffer  \",\"slug\":\"brent-pfeiffer\",\"postDate\":1499272980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Brent Pfeiffer, a life-long resident of Kent, Ohio, is a third generation marketing educator and DECA advisor. Brent is a 1989 graduate of Theodore Roosevelt High School in Kent and a 1994 graduate of Kent State University; Pfeiffer also received his M.Ed. in 2004 from Kent State. Upon graduating from Kent, Brent used his marketing degree to pursue a career in sales working with John Hancock Financial Services and MCI Telecommunications before following the family legacy of teaching after his father\\u2019s untimely death in 1995.<\\/p>\\r\\n<p>Pfeiffer\\u2019s grandfather Paul was an Emeritus marketing professor at Kent State University and his great-uncle, Kenneth (Paul\\u2019s brother), was the State Supervisor of Distributive Education and DECA in Pennsylvania for most of his career. Brent\\u2019s father, Richard, founded Roosevelt\\u2019s award-winning Marketing and DECA program in 1967. &nbsp;During Brent\\u2019s tenure, the program has grown from a one-year program to a two-year program that has been internationally recognized as one of the top programs for entrepreneurial studies. During his 20 year tenure, Pfeiffer\\u2019s students have raised close to $500,000 for school, community, and philanthropic projects.<\\/p>\\r\\n<p><br>Throughout his career, Pfeiffer has worn many hats; he has worked as an assistant golf professional at area golf courses for 15 years, and has coached golf at Roosevelt for 18 years where he led the Rough Riders to seven consecutive league titles. Brent is also an assistant ice hockey coach at Roosevelt where he just finished his tenth season as an assistant with the team. He currently works part-time for the TaylorMade Golf Company in outside sales with his twin brother, David.&nbsp;<\\/p>\\r\\n<p><br>Pfeiffer has also spent time as an adjunct professor in Kent State\\u2019s Center for Entrepreneurship and Business Innovation where he served as an advisor for Kent State\\u2019s chapter of CEO, the Collegiate Entrepreneurs\\u2019 Organization. During his six year tenure in the College of Business, Pfeiffer was twice nominated by his students for the Part Time Distinguished Teaching Award. Brent also worked as a small business advisor in the Entrepreneurship Lab at the Center for Entrepreneurship, assisting student entrepreneurs with their student-run businesses. Pfeiffer has also taught adjunct in the College of Education at Kent State as well.<\\/p>\\r\\n<p><br>Committed to public service, Pfeiffer has volunteered on numerous boards, including fifteen years on the Ohio DECA Executive Council and Board of Directors, three years on the Kent Cyclones Youth Hockey Board of Directors, and is currently on the Advisory Board for Kent State\\u2019s LaunchNET, an entrepreneurial initiative that provides counseling to students, faculty, and alumni looking to bring ideas, inventions, and businesses to life. Pfeiffer has also served on Ohio Department of Education curriculum and assessment boards to develop the statewide entrepreneurship curriculum standards and testing. Most recently, he has served on an international panel of teachers and professors for DECA\\u2019s Competitive Events Task Force which was tasked with the revision, addition, modification, and improvement of DECA\\u2019s entrepreneurship events.<\\/p>\\r\\n<p><br>Brent and his wife of 23 years, Erika reside in Kent with their two children, Paige and Coulter.<br><\\/p>\",\"26\":\"ke_bpfeiffer@kentschools.net\",\"56\":[\"50\"],\"15\":[\"189\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:43:36', '2017-10-19 21:43:36', '472e8cb7-c335-41f7-8001-69d3917cf39b'),
 ('410', '162', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Brian Bachtel\",\"slug\":\"brian-bachtel\",\"postDate\":1504881240,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Brian Bachtel has been the Director of Career Technical Education at Kent City Schools since 2009. &nbsp;Prior to Kent City Schools, he was the Career Based Intervention Coordinator for Mentor Schools for nineteen years. &nbsp;Mr. Bachtel has taken a leadership role Career Technical Education in the State and on a national level. &nbsp;His leadership includes being the past-president of the Ohio Association for Career Technical Education. &nbsp;He holds a Bachelor\\u2019s degree in Education from the University of Toledo and a Master\\u2019s in Administration from Ashland University. &nbsp;Mr. Bachtel is member of the Rotary club of Kent..<\\/p>\",\"26\":\"ke_bbachtel@kentschools.net\",\"56\":[\"120\"],\"15\":[\"163\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-19 21:43:43', '2017-10-19 21:43:43', 'aad9b698-658e-4355-8b62-ddcceecf8824'),
