 ('412', '2', '1', '1', 'en_us', '23', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1492529583,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"37\":[\"9\"],\"22\":\"\",\"23\":\"This is information about when we\'re accepting applications and why you should apply today.\",\"24\":\"How To Apply\",\"1\":\"<p>If you are a high school student planning your future, then Kent Roosevelt Career Technical programs is the place for you! &nbsp;Learn in our high-tech facility from instructors with real-world experience. The Kent Roosevelt High School Career Technical programs are open to students within the Six District Educational Compact.&nbsp;<\\/p>\",\"15\":[\"151\",\"147\"],\"31\":\"1\",\"32\":\"News\",\"33\":\"Explore Career Paths\",\"34\":[\"4\"],\"35\":\"\",\"64\":\"Career Technical Education\",\"36\":\"Welcome to Kent Roosevelt\"}}', '2017-10-19 21:47:23', '2017-10-19 21:47:23', '17d2cce9-a383-4969-877d-ee624b339f78'),
 ('413', '91', '7', '1', 'en_us', '13', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Jeffrey Bee\",\"slug\":\"robert\",\"postDate\":1496850840,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>He is a Mechanical Engineer with a Bachelor of Science in Mechanical Engineering degree from The University of Akron. He earned a &nbsp;master\\u2019s degree in Career and Technical Education through Kent State University. He has worked as a mechanical designer, project engineer or product engineer on projects worth hundreds of thousands of dollars to multi-million dollar projects from New York City to Alaska and globally (Saudi Arabia and South Korea). He has had privilege to have taught and coached four Ohio Gold Medal Champions in Technical Drafting in the past six years. (2006-2012 &nbsp;all Portage County Students) Each student competed at the national level against the best in the country.<\\/p>\",\"26\":\" ke_jbee@kentschools.net\",\"56\":[\"50\"],\"15\":[\"279\"],\"9\":\"\",\"66\":\"\"}}', '2017-10-20 17:04:30', '2017-10-20 17:04:30', '247ccf6c-498b-424a-b678-3ebc1f3d6783'),
