 ('421', '2', '1', '1', 'en_us', '24', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1492529583,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"37\":[\"9\"],\"22\":\"\",\"23\":\"This is information about when we\'re accepting applications and why you should apply today.\",\"24\":\"How To Apply\",\"1\":\"<p>If you are a high school student planning your future, then Kent Roosevelt Career Technical programs is the place for you! &nbsp;Learn in our high-tech facility from instructors with real-world experience. The Kent Roosevelt High School Career Technical programs are open to students within the Six District Educational Compact.&nbsp;<\\/p>\",\"15\":[\"285\"],\"31\":\"1\",\"32\":\"News\",\"33\":\"Explore Career Paths\",\"34\":[\"4\"],\"35\":\"\",\"64\":\"Career Technical Education\",\"36\":\"Welcome to Kent Roosevelt\"}}', '2017-10-23 05:23:22', '2017-10-23 05:23:22', 'cc2084c8-9e55-430d-9d0a-e8b333ed1c63'),
 ('422', '68', '3', '1', 'en_us', '6', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Computer Aided Design and Engineering Technologies\",\"slug\":\"computer-aided-design-and-engineering-technologies\",\"postDate\":1494433320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Redefine what is possible through CAD & Engineering Technologies! Students will use the latest industry standard software and equipment to produce working drawings, 3D solid model designs, parts and assemblies. Additionally, students will have the opportunity to program and operate CNC machines (router, lathe, mill and water jet) to produce manufactured products using wood, metal, and plastic. Students will also operate rapid prototype machines (3D printer) laser engraver in fabricating various engineered and designed products. Manufacturing and welder processes and industries will be explored. This exciting, professional College Tech Prep offering is designed to prepare students for careers in the engineering, advanced manufacturing and architectural career fields. Students will network with industry experts and partners in high demand career fields. Senior level internships\\/industry placement opportunities are available to qualified students. Advanced technologies, coupled with the need to update and improve manufacturing facilities and product design, should fuel the demand for professionals in computer-aided manufacturing, architecture, and engineering technologies. According to the latest data 7,400 jobs within a 100 mile radius of Akron, Ohio currently exist. Upon successful completion of the program, students will be eligible to earn up to 3 college credits (CTAG) to any Ohio public university for Computer-Aided Drafting and Design in an Engineering Technology program.<\\/p>\",\"11\":\"<p>Level I: CP or Comp English 1; CADET IA 1; CADET IB 1.<br><\\/p>\\r\\n<p>Level II: CADET IIA 1.5; CADET IIB 1.5. Capstone* 1. (*Capstone includes project\\/ problem-based learning opportunities that occur both in the building and at an external site. Students may combine classroom teaching with work experience.)<\\/p>\",\"15\":[\"285\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"57\"],\"35\":{\"252\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Skills Necessary for Success\",\"text\":[{\"col1\":\"Detail-oriented problem solver\"},{\"col1\":\"Ability to visualize projects\"},{\"col1\":\"Affinity for mathematics\"},{\"col1\":\"Ability to work independently and as a team member\"},{\"col1\":\"Positive attitude, critical thinker\"},{\"col1\":\"Interest in designing and building\"},{\"col1\":\"Use and implement precise measurements and calculations\"}]}},\"253\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":[{\"col1\":\"Engineering technician\"},{\"col1\":\"Machine Technician\"},{\"col1\":\"Manufacturing Engineer\\t \"},{\"col1\":\"Architect\"},{\"col1\":\"CNC programmer\\/operator\\t \"},{\"col1\":\"Landscape architect\"},{\"col1\":\"CAD Designer\\t \"},{\"col1\":\"Interior designer\"},{\"col1\":\"Furniture Engineering Draftsman \\t \"},{\"col1\":\"Machinist\"}]}},\"254\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Educational Opportunities\",\"text\":[{\"col1\":\"College credits available. See page 32.\"},{\"col1\":\" Bachelor\\u2019s degree\\t\"},{\"col1\":\"Associate\\u2019s degree \\t \\t \"},{\"col1\":\"Internships\"}]}},\"255\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Career interests\\/helpful background\"},{\"col1\":\"Computer technology\\t \"},{\"col1\":\"Manufacturing process\"},{\"col1\":\"Blueprint design or production \\t \"},{\"col1\":\"Keyboarding skills\"}]}},\"256\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Recommendations\",\"text\":[{\"col1\":\"Excellent attendance record \\t \"},{\"col1\":\"Geometry\"},{\"col1\":\"Minimum 2.5 GPA \"},{\"col1\":\"Utilize computer technologies\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-23 14:27:44', '2017-10-23 14:27:44', 'cf70911f-8019-4c17-8fb6-035d3c65331e'),
 ('423', '69', '3', '1', 'en_us', '8', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Athletic Health Care Fitness\",\"slug\":\"athletic-health-care-fitness\",\"postDate\":1494433320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Are you looking for an educational experience that is fun, exciting and fast-paced? &nbsp;Look no further than Athletic Health Care and Fitness. &nbsp;This program will provide knowledge and real life experiences in recognizing, initially treating and rehabilitating athletic injuries. &nbsp;Under the direction of a licensed athletic trainer, students will assist injured athletes from the onset of injury to their full return to competition. &nbsp;Students will also learn about prevention of injury through the practice of proper sports nutrition, conditioning and weight training. &nbsp;Learning about the proper use and selection of sports related equipment will also provide students with knowledge and experience in injury reduction. &nbsp;The Athletic Health Care and Fitness Program will help you select and prepare for a future in fitness or a variety of health related careers.<\\/p>\",\"11\":\"<p>Level I \\u2013 Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.<\\/p>\\r\\n<p>Level II \\u2013 Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.<\\/p>\",\"15\":[\"285\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"58\"],\"35\":{\"240\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"7:30-10:15am \\u2013  (Level I)\"},{\"col1\":\"11:55-2:30pm \\u2013  (Level II)\"}]}},\"241\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Assisting with treatment and rehabilitation of injuries\"},{\"col1\":\"Assisting the athletic trainer with evaluation and initial treatment of injuries\"},{\"col1\":\"Carrying out duties assigned by the athletic trainer\"},{\"col1\":\"Assisting in fitness setting\"}]}},\"242\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Prevention of athletic injuries\"},{\"col1\":\"Recognition of athletic injuries\"},{\"col1\":\"First Aid and CPR\"},{\"col1\":\"Treatment and rehabilitation of athletic injuries\"},{\"col1\":\"Conditioning principles\"},{\"col1\":\"Weight training principles\"},{\"col1\":\"Exercise and fitness programs\"}]}},\"243\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Assertive and relate well with people\"},{\"col1\":\"Excellent communication skills\"},{\"col1\":\"Desire to help people in need\"},{\"col1\":\"Dependable and reliable\"}]}},\"244\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Youth Leadership Organization\",\"text\":[{\"col1\":\"AHCF club\"}]}},\"245\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Biology\"},{\"col1\":\"Sciences\"},{\"col1\":\"English\"},{\"col1\":\"Math\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-23 14:27:53', '2017-10-23 14:27:53', 'adc01f84-fe6d-434f-bf9e-299caa32d0fb'),
 ('424', '70', '3', '1', 'en_us', '6', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Health Care and Technologies\",\"slug\":\"health-care-and-technologies\",\"postDate\":1494433320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Since many health careers require further education, students will be prepared for post-secondary studies in their area of concentration. &nbsp;&nbsp;Health Careers Technologies students will learn clinical skills that are utilized in a variety of occupations in the medical field. &nbsp;Students learn basic health care skills, medical laboratory processes, physical therapy techniques and clinical techniques. Additional coursework is provided in anatomy and physiology, medical terminology, nutrition, infection control, and legal\\/ ethical issues. This program places an emphasis on helping students shape their own future by providing them with a wide range of entry-level skills and knowledge. Certification is available AHA CPR-AED for the Health Care Provider<\\/p>\",\"11\":\"<p>Level I \\u2013 Anatomy and Physiology 1 ; CP English 1; Tech Theory 1; &nbsp;Lab 1.<br><\\/p>\\r\\n<p>Level II \\u2013 Tech Theory 1; Lab 2; CP English 1; Internship 0.5 \\u2013 3 <\\/p>\",\"15\":[\"285\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"58\"],\"35\":{\"246\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two year program\"},{\"col1\":\"Shadowing observations\"},{\"col1\":\"Level 2 Internship opportunities\"},{\"col1\":\"Self-paced instruction and computer assistance when applicable\"}]}},\"247\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Involves close contact with people, patients and co-workers\"},{\"col1\":\"Involves moving, lifting and fine motor skills\"}]}},\"248\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Anatomy and Physiology\"},{\"col1\":\"Emergency Care & Triage\"},{\"col1\":\"Medical Terminology\"},{\"col1\":\"Nutrition & Dietary Modifications\"},{\"col1\":\"Infection Control & Safety Measures\"},{\"col1\":\"Rotations in Medical Assisting, Lab Assisting, Nurse Assisting, Dental Assisting & Rehabilitation Skills\"},{\"col1\":\"Communication skills\"}]}},\"249\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Good Attendance\"},{\"col1\":\"GPA 3.0\"},{\"col1\":\"Biology\"},{\"col1\":\"Problem-solving skills\"},{\"col1\":\"Communication skills\"},{\"col1\":\"Ability to follow directions\"}]}},\"250\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Youth Leadership Organization\",\"text\":[{\"col1\":\"HOSA (Health Occupations Students of America)\"}]}},\"251\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Chemistry\\/other sciences\"},{\"col1\":\"Communication skills \\u2013 writing, listening and speaking\"},{\"col1\":\"Mathematics\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-10-23 14:28:30', '2017-10-23 14:28:30', '129a9ff5-2ae1-46ee-9ff4-7b9449b56f2f'),
 ('425', '186', '8', '1', 'en_us', '4', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"no Six District Transportation to Theodore Roosevelt High School\",\"slug\":\"monday-april-17-no-six-district-transportation-to-theodore-roosevelt-high-school\",\"postDate\":1504887600,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"4\\/19\\/2017\"},\"74\":{\"time\":\"11:30 PM\"},\"27\":\"\",\"39\":\"\",\"72\":\"\",\"65\":\"Kent Theodore Roosevelt High School Career-Technical Education programs will be in session on Monday, April 17.  There will be no Six District Educational Compact busing that day.\",\"21\":\"\",\"73\":{\"time\":\"12:00 AM\"}}}', '2017-10-25 14:56:57', '2017-10-25 14:56:57', '8b193611-9d16-4e56-8f47-5458be0206f9'),
 ('426', '185', '8', '1', 'en_us', '4', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"Welcome to the Program-Start Date Aug. 17\",\"slug\":\"welcome-to-the-program-start-date-aug-17-1\",\"postDate\":1504887000,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"8\\/17\\/2017\"},\"74\":{\"time\":\"\"},\"27\":\"<p>Important Items<\\/p>\\r\\n<p>-PLEASE &mdash;Wear school colors & sport uniforms!\\r\\n-Kent and home school calendars are in effect\\u2013reference both calendars..in the event of conflicts\\u2013 please communicate with your program instructor.\\r\\n-All Career-Technical Programs start Thursday, August 17.\\r\\n\\u2013<strong>Notify both, Kent and home school attendance to report an absence (330) 676-8750.<\\/strong>\\r\\n-Bus transportation to and from home school provided. Optional driving privilege form (<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/interdistrict-driving-form-8-2018\\/\\\">Interdistrict-Driving-Form-8-2018<\\/a>) must be completed and returned to the TRHS CTE office room 515 with your home school parking pass.\\r\\n-Each program has certain necessary workbooks and supplies which you will need. In some instances, students will be asked to purchase tool or operational kits. There are two methods of payment:&nbsp; (1) cash in full; or (2) a payment plan. Information about these two payment methods will be provided during the first week of school. Program school fees can be waived for students on free lunch (Six District Educational Compact students approved for free lunch will need to complete a fee waiver form),&nbsp;&nbsp; Your instructor will provide additional details.-<\\/p>\\r\\n<p><strong>Call the Kent Theodore Roosevelt Career-Technical Education office with any questions (330) 676-8740&hellip;we are here to serve you!<\\/strong><\\/p>\",\"39\":\"\",\"72\":\"\",\"65\":\"\",\"21\":\"\",\"73\":{\"time\":\"\"}}}', '2017-10-25 14:57:13', '2017-10-25 14:57:13', 'f570212c-b6fb-470c-834d-09b87857cf3d'),
 ('427', '182', '2', '1', 'en_us', '4', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"TRHS Students Start Aug. 16; Six District Educational Compact Sudents First Day of School Aug. 17\",\"slug\":\"trhs-students-start-aug-16-six-district-educational-compact-students-first-day-of-school-aug-17\",\"postDate\":1504886220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>The first day of school for all Six District Educational Compact Career-Technical Education programs is August 17.<\\/p>\\r\\n<p>TRHS students will report for classes and TRHS CTE programs on Aug. 16.<\\/p>\\r\\n<p>TRHS students attending Six District Educational Compact programs outside of&nbsp;Kent attend&nbsp;only TRHS classes&nbsp;Aug 16, Six District Educational Compact programs begin Aug. 17 with the exception of Stow-Munroe Falls High School programs (1st day for programs is Aug. 22).<\\/p>\\r\\n<p>Six District Educational Compact students&nbsp;(Hudson, Tallmadge, SMF, Woodridge, and CF)&nbsp;start TRHS&nbsp;CTE programs Aug. 17&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/district-calendar-2017-2018\\/\\\">District-Calendar-2017-2018<\\/a>&nbsp;but attend home school classes on the first scheduled day.<\\/p>\\r\\n<p>Please email me at ke_bbachtel@kentschools.net if you have any questions or contact the Theodore Roosevelt Career-Technical Education office at (330) 676-8740 for personal service,&nbsp; The Kent City Schools&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/district-calendar-2017-2018\\/\\\">District-Calendar-2017-2018<\\/a>&nbsp;, Six District Educational Compact&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/interdistrict-driving-form-8-2018\\/\\\">Interdistrict-Driving-Form-8-2018<\\/a>&nbsp; and &nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/17-18-six-district-calendar\\/\\\">17-18 Six District Calendar<\\/a>&nbsp;are linked and can be found under the Forms tab.<\\/p>\",\"79\":[\"275\"],\"65\":\"The first day of school for all Six District Educational Compact Career-Technical Education programs is August 17.\",\"2\":\"\"}}', '2017-10-25 14:58:18', '2017-10-25 14:58:18', '886fd858-3c56-42bf-be6f-de6cac762083'),
