 ('434', '69', '3', '1', 'en_us', '9', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Athletic Health Care Fitness\",\"slug\":\"athletic-health-care-fitness\",\"postDate\":1494433320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Are you looking for an educational experience that is fun, exciting and fast-paced? &nbsp;Look no further than Athletic Health Care and Fitness. &nbsp;This program will provide knowledge and real life experiences in recognizing, initially treating and rehabilitating athletic injuries. &nbsp;Under the direction of a licensed athletic trainer, students will assist injured athletes from the onset of injury to their full return to competition. &nbsp;Students will also learn about prevention of injury through the practice of proper sports nutrition, conditioning and weight training. &nbsp;Learning about the proper use and selection of sports related equipment will also provide students with knowledge and experience in injury reduction. &nbsp;The Athletic Health Care and Fitness Program will help you select and prepare for a future in fitness or a variety of health related careers.<\\/p>\",\"11\":\"<p>Level I \\u2013 Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.<\\/p>\\r\\n<p>Level II \\u2013 Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.<\\/p>\",\"15\":[\"285\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"58\"],\"35\":{\"240\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"7:30-10:15am \\u2013  (Level I)\"},{\"col1\":\"11:55-2:30pm \\u2013  (Level II)\"}]}},\"241\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Assisting with treatment and rehabilitation of injuries\"},{\"col1\":\"Assisting the athletic trainer with evaluation and initial treatment of injuries\"},{\"col1\":\"Carrying out duties assigned