 ('439', '182', '2', '1', 'en_us', '6', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"TRHS Students Start Aug. 16; Six District Educational Compact Sudents First Day of School Aug. 17\",\"slug\":\"trhs-students-start-aug-16-six-district-educational-compact-students-first-day-of-school-aug-17\",\"postDate\":1505145420,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>The first day of school for all Six District Educational Compact Career-Technical Education programs is August 17.<\\/p>\\r\\n<p>TRHS students will report for classes and TRHS CTE programs on Aug. 16.<\\/p>\\r\\n<p>TRHS students attending Six District Educational Compact programs outside of&nbsp;Kent attend&nbsp;only TRHS classes&nbsp;Aug 16, Six District Educational Compact programs begin Aug. 17 with the exception of Stow-Munroe Falls High School programs (1st day for programs is Aug. 22).<\\/p>\\r\\n<p>Six District Educational Compact students&nbsp;(Hudson, Tallmadge, SMF, Woodridge, and CF)&nbsp;start TRHS&nbsp;CTE programs Aug. 17&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/district-calendar-2017-2018\\/\\\">District-Calendar-2017-2018<\\/a>&nbsp;but attend home school classes on the first scheduled day.<\\/p>\\r\\n<p>Please email me at ke_bbachtel@kentschools.net if you have any questions or contact the Theodore Roosevelt Career-Technical Education office at (330) 676-8740 for personal service,&nbsp; The Kent City Schools&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/district-calendar-2017-2018\\/\\\">District-Calendar-2017-2018<\\/a>&nbsp;, Six District Educational Compact&nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/interdistrict-driving-form-8-2018\\/\\\">Interdistrict-Driving-Form-8-2018<\\/a>&nbsp; and &nbsp;<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/17-18-six-district-calendar\\/\\\">17-18 Six District Calendar<\\/a>&nbsp;are linked and can be found under the Forms tab.<\\/p>\",\"15\":[\"285\"],\"79\":[\"275\"],\"65\":\"The first day of school for all Six District Educational Compact Career-Technical Education programs is August 17.\",\"2\":\"\"}}', '2017-10-30 01:05:48', '2017-10-30 01:05:48', '981481f6-3ed4-4b83-bc38-49536cafe89f'),
