 ('444', '4', '10', '1', 'en_us', '7', '', '{\"typeId\":\"10\",\"authorId\":null,\"title\":\"Explore Programs\",\"slug\":\"programs-landing-page\",\"postDate\":1508520736,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"81\":\"\",\"1\":\"<p>Theodore Roosevelt High School Career Technical Education is a member of the Six District Educational Compact. The Six District Educational Compact offers 25 career-technical programs. All Six District Educational Compact programs, with the exception of auto specialization, provide opportunity for students to earn College Tech Prep status.&nbsp;<\\/p><p>For more information about all the Six District Educational Compact Career Technical Education programs visit&nbsp;<a href=\\\"http:\\/\\/www.sixdistrict.com\\/\\\" target=\\\"_blank\\\">www.sixdistrict.com<\\/a>.&nbsp;<\\/p><p>Contact Brian Bachtel, Career-Technical Director, or Edna Hensel, CTE Administrative Assistant, at (330) 676-8740 to learn more about starting your career this year.<\\/p>\",\"15\":[\"285\"]}}', '2017-10-30 03:32:21', '2017-10-30 03:32:21', '54a66e6f-ab05-43bf-a54b-fefccdb2c66d'),
