 ('446', '116', '7', '1', 'en_us', '8', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Angela Textor \",\"slug\":\"angela-textor\",\"postDate\":1499272920,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Angela is an instructor for Health Careers Technoligies. &nbsp;&nbsp;Angela started her career at Theodore Roosevelt High School in the fall of 2011. &nbsp;Prior to coming to Kent Roosevelt, Angela was a staff member in the Athletic Training Department at Kent state University. &nbsp;During her time at Kent State she worked primarily with Women\\u2019s Gymnastics, Cross Country and Softball, while also serving as the insurance coordinator for athletics. &nbsp;Angela has a vast amount of clinical experience and was a staff member of Crystal Clinic Inc. as an orthopaedic physician assistant for 11 years. &nbsp;Her primary responsibilities were assisting William Pakan, MD. with the evaluation and treatment of patients, as well as assisting in the operating room for outpatient procedures. Angela received her Bachelors of Arts in Education in 1993 from Kent State University and a master\\u2019s degree in Career Technical Education in 2013. &nbsp;&nbsp;Angela is an approved Clinical Instructor and is an instructor in CPR\\/First Aid\\/AED training.<br><\\/p>\",\"26\":\"ke_atextor@kentschools.net\",\"56\":[\"50\"],\"15\":[\"190\"],\"9\":\"330\",\"66\":\"\"}}', '2017-10-31 01:17:21', '2017-10-31 01:17:21', 'f92bb1bc-05a0-4f0a-810a-b82716d212df'),
 ('447', '69', '3', '1', 'en_us', '12', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Athletic Health Care Fitness\",\"slug\":\"athletic-health-care-fitness\",\"postDate\":1494433320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Are you looking for an educational experience that is fun, exciting and fast-paced? &nbsp;Look no further than Athletic Health Care and Fitness. &nbsp;This program will provide knowledge and real life experiences in recognizing, initially treating and rehabilitating athletic injuries. &nbsp;Under the direction of a licensed athletic trainer, students will assist injured athletes from the onset of injury to their full return to competition. &nbsp;Students will also learn about prevention of injury through the practice of proper sports nutrition, conditioning and weight training. &nbsp;Learning about the proper use and selection of sports related equipment will also provide students with knowledge and experience in injury reduction. &nbsp;The Athletic Health Care and Fitness Program will help you select and prepare for a future in fitness or a variety of health related careers.<\\/p>\",\"11\":\"<p>Level I \\u2013 Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.<\\/p>\\r\\n<p>Level II \\u2013 Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.<\\/p>\",\"15\":[\"285\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"58\"],\"80\":[\"285\",\"128\",\"94\",\"95\"],\"35\":{\"240\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"7:30-10:15am \\u2013  (Level I)\"},{\"col1\":\"11:55-2:30pm \\u2013  (Level II)\"}]}},\"241\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Assisting with treatment and rehabilitation of injuries\"},{\"col1\":\"Assisting the athletic trainer with evaluation and initial treatment of injuries\"},{\"col1\":\"Carrying out duties assigned by the athletic trainer\"},{\"col1\":\"Assisting in fitness setting\"}]}},\"242\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Prevention of athletic injuries\"},{\"col1\":\"Recognition of athletic injuries\"},{\"col1\":\"First Aid and CPR\"},{\"col1\":\"Treatment and rehabilitation of athletic injuries\"},{\"col1\":\"Conditioning principles\"},{\"col1\":\"Weight training principles\"},{\"col1\":\"Exercise and fitness programs\"}]}},\"243\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Assertive and relate well with people\"},{\"col1\":\"Excellent communication skills\"},{\"col1\":\"Desire to help people in need\"},{\"col1\":\"Dependable and reliable\"}]}},\"244\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Youth Leadership Organization\",\"text\":[{\"col1\":\"AHCF club\"}]}},\"245\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Biology\"},{\"col1\":\"Sciences\"},{\"col1\":\"English\"},{\"col1\":\"Math\"}]}}},\"13\":\"Kent\",\"75\":\"https:\\/\\/www.youtube.com\\/watch?v=izOY_EUycfI\"}}', '2017-10-31 03:11:45', '2017-10-31 03:11:45', '323dbbf9-b88b-4e78-8ce6-30d4f1f8337f'),
 ('448', '69', '3', '1', 'en_us', '13', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Athletic Health Care Fitness\",\"slug\":\"athletic-health-care-fitness\",\"postDate\":1494433320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Are you looking for an educational experience that is fun, exciting and fast-paced? &nbsp;Look no further than Athletic Health Care and Fitness. &nbsp;This program will provide knowledge and real life experiences in recognizing, initially treating and rehabilitating athletic injuries. &nbsp;Under the direction of a licensed athletic trainer, students will assist injured athletes from the onset of injury to their full return to competition. &nbsp;Students will also learn about prevention of injury through the practice of proper sports nutrition, conditioning and weight training. &nbsp;Learning about the proper use and selection of sports related equipment will also provide students with knowledge and experience in injury reduction. &nbsp;The Athletic Health Care and Fitness Program will help you select and prepare for a future in fitness or a variety of health related careers.<\\/p>\",\"11\":\"<p>Level I \\u2013 Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.<\\/p>\\r\\n<p>Level II \\u2013 Adv Anatomy and Physiology 1; Tech Theory 1; Lab 1.<\\/p>\",\"15\":[\"285\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"58\"],\"80\":[\"285\",\"128\",\"94\",\"95\"],\"35\":{\"240\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"7:30-10:15am \\u2013  (Level I)\"},{\"col1\":\"11:55-2:30pm \\u2013  (Level II)\"}]}},\"241\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Assisting with treatment and rehabilitation of injuries\"},{\"col1\":\"Assisting the athletic trainer with evaluation and initial treatment of injuries\"},{\"col1\":\"Carrying out duties assigned by the athletic trainer\"},{\"col1\":\"Assisting in fitness setting\"}]}},\"242\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Prevention of athletic injuries\"},{\"col1\":\"Recognition of athletic injuries\"},{\"col1\":\"First Aid and CPR\"},{\"col1\":\"Treatment and rehabilitation of athletic injuries\"},{\"col1\":\"Conditioning principles\"},{\"col1\":\"Weight training principles\"},{\"col1\":\"Exercise and fitness programs\"}]}},\"243\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Assertive and relate well with people\"},{\"col1\":\"Excellent communication skills\"},{\"col1\":\"Desire to help people in need\"},{\"col1\":\"Dependable and reliable\"}]}},\"244\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Youth Leadership Organization\",\"text\":[{\"col1\":\"AHCF club\"}]}},\"245\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Biology\"},{\"col1\":\"Sciences\"},{\"col1\":\"English\"},{\"col1\":\"Math\"}]}}},\"13\":\"Kent\",\"75\":\"https:\\/\\/www.youtube.com\\/watch?v=izOY_EUycfI\"}}', '2017-10-31 03:11:54', '2017-10-31 03:11:54', '58b631a3-6922-41ad-89f7-0c37c7bc053d'),
