 ('460', '185', '8', '1', 'en_us', '5', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"Welcome to the Program-Start Date Aug. 17\",\"slug\":\"welcome-to-the-program-start-date-aug-17-1\",\"postDate\":1504887000,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"8\\/17\\/2018\"},\"74\":{\"time\":\"\"},\"27\":\"<p>Important Items<\\/p>\\r\\n<p>-PLEASE &mdash;Wear school colors & sport uniforms!\\r\\n-Kent and home school calendars are in effect\\u2013reference both calendars..in the event of conflicts\\u2013 please communicate with your program instructor.\\r\\n-All Career-Technical Programs start Thursday, August 17.\\r\\n\\u2013<strong>Notify both, Kent and home school attendance to report an absence (330) 676-8750.<\\/strong>\\r\\n-Bus transportation to and from home school provided. Optional driving privilege form (<a href=\\\"http:\\/\\/kentschools.net\\/rhscte\\/forms\\/interdistrict-driving-form-8-2018\\/\\\">Interdistrict-Driving-Form-8-2018<\\/a>) must be completed and returned to the TRHS CTE office room 515 with your home school parking pass.\\r\\n-Each program has certain necessary workbooks and supplies which you will need. In some instances, students will be asked to purchase tool or operational kits. There are two methods of payment:&nbsp; (1) cash in full; or (2) a payment plan. Information about these two payment methods will be provided during the first week of school. Program school fees can be waived for students on free lunch (Six District Educational Compact students approved for free lunch will need to complete a fee waiver form),&nbsp;&nbsp; Your instructor will provide additional details.-<\\/p>\\r\\n<p><strong>Call the Kent Theodore Roosevelt Career-Technical Education office with any questions (330) 676-8740&hellip;we are here to serve you!<\\/strong><\\/p>\",\"39\":[\"276\"],\"72\":\"\",\"65\":\"\",\"21\":\"\",\"73\":{\"time\":\"\"}}}', '2017-11-03 01:35:26', '2017-11-03 01:35:26', '8bb3d994-8bc2-4d1f-a0ff-3266a8c63afa'),
 ('461', '186', '8', '1', 'en_us', '6', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"no Six District Transportation to Theodore Roosevelt High School\",\"slug\":\"monday-april-17-no-six-district-transportation-to-theodore-roosevelt-high-school\",\"postDate\":1504887600,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"4\\/19\\/2018\"},\"74\":{\"time\":\"11:30 PM\"},\"27\":\"\",\"39\":[\"276\"],\"72\":\"\",\"65\":\"Kent Theodore Roosevelt High School Career-Technical Education programs will be in session on Monday, April 17.  There will be no Six District Educational Compact busing that day.\",\"21\":\"\",\"73\":{\"time\":\"12:00 AM\"}}}', '2017-11-03 01:35:32', '2017-11-03 01:35:32', '91125b88-db8b-4550-8404-954fbe7f8398'),
 ('462', '186', '8', '1', 'en_us', '7', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"no Six District Transportation to Theodore Roosevelt High School\",\"slug\":\"monday-april-17-no-six-district-transportation-to-theodore-roosevelt-high-school\",\"postDate\":1504887600,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"8\\/1\\/2017\"},\"74\":{\"time\":\"11:30 PM\"},\"27\":\"\",\"39\":[\"276\"],\"72\":\"\",\"65\":\"Kent Theodore Roosevelt High School Career-Technical Education programs will be in session on Monday, April 17.  There will be no Six District Educational Compact busing that day.\",\"21\":\"\",\"73\":{\"time\":\"12:00 AM\"}}}', '2017-11-03 02:12:35', '2017-11-03 02:12:35', 'baeae447-b22c-4fe6-b20a-aca7080fe6c1'),
 ('463', '4', '10', '1', 'en_us', '9', '', '{\"typeId\":\"10\",\"authorId\":null,\"title\":\"Explore Programs\",\"slug\":\"programs-landing-page\",\"postDate\":1508520736,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"81\":\"Six District\",\"1\":\"<p>Theodore Roosevelt High School Career Technical Education is a member of the Six District Educational Compact. The Six District Educational Compact offers 25 career-technical programs. All Six District Educational Compact programs, with the exception of auto specialization, provide opportunity for students to earn College Tech Prep status.&nbsp;<\\/p>\\r\\n<p>For more information about all the Six District Educational Compact Career Technical Education programs visit&nbsp;<a href=\\\"http:\\/\\/www.sixdistrict.com\\/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">www.sixdistrict.com<\\/a>.&nbsp;<\\/p>\\r\\n<p>Contact Brian Bachtel, Career-Technical Director, or Edna Hensel, CTE Administrative Assistant, at (330) 676-8740 to learn more about starting your career this year.<\\/p>\",\"15\":[\"285\"],\"75\":\"https:\\/\\/www.youtube.com\\/watch?v=WY5vOpp9x6M\"}}', '2017-11-03 02:52:28', '2017-11-03 02:52:28', 'a80b0b38-c9e7-4f91-89d1-f86b6aba8ac0'),
 ('464', '181', '8', '1', 'en_us', '3', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"Parent\\/Teacher Conferences Nov. 20 and 21\",\"slug\":\"parent-teacher-conferences-nov-20-and-21\",\"postDate\":1504886100,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":{\"date\":\"11\\/20\\/2017\"},\"74\":{\"time\":\"\"},\"27\":\"<p>Theodore Roosevelt Parent\\/Teacher conferences will be held on Monday, Nov. 20 from 5pm until 8pm, and on Tuesday, Nov. 21 from 9am until 8pm.&nbsp; Please call 330 676-8700 or email ke_nharris@kentschools.net to schedule an appointment.&nbsp; We welcome this opportunity to share your student\\u2019s progress and to discuss concerns and\\/or questions you may have.<\\/p>\",\"39\":[\"277\",\"278\"],\"72\":\"\",\"65\":\"Theodore Roosevelt Parent\\/Teacher conferences will be held on Monday, Nov. 20 from 5pm until 8pm, and on Tuesday, Nov. 21 from 9am until 8pm. \",\"21\":\"\",\"73\":{\"time\":\"5:00 PM\"}}}', '2017-11-06 02:17:41', '2017-11-06 02:17:41', '60760b8c-652a-423d-86a8-492833323482'),
