 ('470', '2', '1', '1', 'en_us', '25', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1492529583,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"37\":[\"9\"],\"22\":\"\",\"23\":\"This is information about when we\'re accepting applications and why you should apply today.\",\"24\":\"How To Apply\",\"1\":\"<p>If you are a high school student planning your future, then Kent Roosevelt Career Technical programs is the place for you! &nbsp;Learn in our high-tech facility from instructors with real-world experience. The Kent Roosevelt High School Career Technical programs are open to students within the Six District Educational Compact.&nbsp;<\\/p>\",\"15\":[\"285\",\"303\",\"302\"],\"31\":\"1\",\"32\":\"News\",\"33\":\"Explore Career Paths\",\"34\":[\"4\"],\"35\":\"\",\"64\":\"Career Technical Education\",\"36\":\"Welcome to Kent Roosevelt\"}}', '2017-11-12 01:22:09', '2017-11-12 01:22:09', '4b21ff7f-105a-456f-b571-d5cbbbd0f71f'),
 ('471', '62', '3', '1', 'en_us', '6', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Business and Sports Management\",\"slug\":\"business-and-sports-management\",\"postDate\":1494433140,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>This College Tech Prep Initiative develops skills and knowledge in the field of business, sports management and marketing, human resource management, facilities and operations management, sales, and public relations. Students will acquire knowledge of business processes, economics and business relationships, finance, and accounting. &nbsp;&nbsp;Students will learn how to manage a workforce, lead change and build professional relationships with employees and customers. Students will utilize technology, software, and virtual simulations to prepare for careers in the business and sport management fields. &nbsp;Worksite and facility visits to professional, collegiate, and recreational sports and management will be integrated into the program. All students are provided opportunities for leadership development through the Business Professionals of America national student organization. College credit is available through university partnerships.<\\/p>\",\"11\":\"<p>Level I: &nbsp;CP English-1; Theory-1; Lab-1; and optional Capstone*-1<br><\\/p>\\r\\n<p>Level II: CP English-1; Theory-1; Lab-1; and optional Capstone*-1<\\/p>\",\"15\":[\"303\"],\"12\":\"10, 11, 12\",\"14\":\"Two years\",\"38\":[\"54\"],\"80\":\"\",\"35\":{\"224\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Sports Management\"},{\"col1\":\"Business Foundations\"},{\"col1\":\"Management and Administration Principles\"},{\"col1\":\"Fundamentals of Business and Administrative Services\"},{\"col1\":\"Human Resource Management\"},{\"col1\":\"Finance and Accounting\"},{\"col1\":\"Marketing, Sales, and Public Relations\"}]}},\"225\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":[{\"col1\":\"Front office positions in professional sports\"},{\"col1\":\"Athletic director in college and high school\"},{\"col1\":\"Team management\"},{\"col1\":\"Event and recreational management\"},{\"col1\":\"Sports marketing\"},{\"col1\":\"Human resource manager\"},{\"col1\":\"Franchising and ownership\"}]}},\"226\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher education opportunities\",\"text\":[{\"col1\":\"College credits available\"},{\"col1\":\"Associate\\u2019s degree\"},{\"col1\":\"Bachelor\\u2019s degree\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-11-12 01:45:14', '2017-11-12 01:45:14', '60926264-2a9d-4219-8914-1168d2f912f8'),
