 ('475', '66', '3', '1', 'en_us', '6', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Electronics, Robotics, and Programming\",\"slug\":\"electronics-robotics-and-programming\",\"postDate\":1494433260,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Career opportunities are abundant and increasing in the fields of electronics, robotics and programming. This program will provide students with great preparation in theory and hands on experience. Transistor circuits, amplifiers, LED lighting and soldering projects are<br><\\/p>\\r\\n<p>included. Vex robots are built and programmed with C language. BASIC language is used for parallax robots and LED displays. Video game programming is offered, computers are assembled and software installed. Students who complete the Electronics, Robotics and Programming College Tech Prep Initiative will have the opportunity to continue their studies in post-secondary education, enhance their skills in the military or directly enter the workforce. <\\/p>\",\"11\":\"<p>Level I: Electronics, Robotics and Programming IA 1, Electronics, Robotics and Programming IB.<br><\\/p>\\r\\n<p>Level II: Electronics, Robotics and Programming IIA 1, Electronics, Robotics and Programming IIB.<\\/p>\",\"15\":[\"303\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"57\"],\"80\":\"\",\"35\":{\"257\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Construction technology\\u2014Core and sustainable construction\"},{\"col1\":\"Carpentry and masonry technical skills\"},{\"col1\":\"Structural systems\"},{\"col1\":\"Structural coverings and finishes\"}]}},\"258\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Skills Necessary for Success\",\"text\":[{\"col1\":\"Ability to work independently and as part of a team\"},{\"col1\":\"Ability to follow directions and assume responsibility\"},{\"col1\":\"Written and verbal communication skills\"},{\"col1\":\"Disciplined self-starter\"},{\"col1\":\"Creative problem-solver \"},{\"col1\":\"Logical thinker who pays attention to detail\"},{\"col1\":\"Aptitude for precision work\"},{\"col1\":\"Manual dexterity\"},{\"col1\":\"Patience to follow through on tasks\"}]}},\"259\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":[{\"col1\":\"Computer laboratory technician\"},{\"col1\":\"Development instrumentation technician\"},{\"col1\":\"Electronic communication technician\"},{\"col1\":\"Nuclear reactor electronics technician\"},{\"col1\":\"Systems testing laboratory technician\"},{\"col1\":\"Electronics manufacturing and production technician\"},{\"col1\":\"Electronic equipment installer\"},{\"col1\":\"Cable television installer\"},{\"col1\":\"Computer installer\\/technician\"}]}},\"260\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Educational Opportunities\",\"text\":[{\"col1\":\"College credits available\"},{\"col1\":\"Associate\\u2019s degree\"},{\"col1\":\"Bachelor\\u2019s degree\"}]}},\"261\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Using specialized tools and equipment \"},{\"col1\":\"Hands on applications of scientific principles\"},{\"col1\":\"Computer technology\"},{\"col1\":\"Electricity and circuitry\"}]}},\"262\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Recommendations\",\"text\":[{\"col1\":\"Excellent attendance record\"},{\"col1\":\"Minimum 2.5 GPA\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-11-13 02:09:52', '2017-11-13 02:09:52', '6d549e1d-e969-48e8-b336-9489ebbf5ae6'),
 ('476', '67', '3', '1', 'en_us', '7', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Engineering Academy\",\"slug\":\"engineering-academy\",\"postDate\":1494433260,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>This two-year College Tech Prep Academy combines academically competitive, college prep courses with hands-on technical studies. Students rotate through four technology areas-computer-aided design, (CAD), electronics, robotics & programming, manufacturing processes and polymers. \\u00be of the program is at Theodore Roosevelt High school and \\u00bc of the program is at Stow-Munroe High School.<br><\\/p>\\r\\n<p>College prep courses in English, Algebra II or Honors\\/Adv. Algebra II, Pre-Calculus or Honors\\/Adv. Pre-Calculus, Calculus, AP Calculus, and Adv. Physics I and II are linked with the technology curriculum. University partners include Cleveland State University and The University of Akron.<\\/p>\\r\\n<p>Various instructional approaches are used, including team teaching, work teams, self-directed studies, and project-based learning. &nbsp;Benefits of this program include: exposure to key elements of various aspects of engineering; practical content for future college engineering courses; work with experienced engineers; and extra-curricular opportunities with regional competitions.<br><\\/p>\",\"11\":\"<p><br><\\/p>\\r\\n<p>Level I \\u2013 English 1; Tech Theory 1; Lab 2; <\\/p>\\r\\n<p>Level II \\u2013 English 1; Tech Theory 1; Lab 3; Internship 1<\\/p>\",\"15\":[\"302\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"57\"],\"80\":\"\",\"35\":{\"263\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"3.5 hours daily- from 7:30 am to 11:05 am\"},{\"col1\":\"Two technical credits plus three academic credits per year\"}]}},\"264\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Prerequisites\",\"text\":[{\"col1\":\"Algebra 1 and Geometry or Honors\\/Adv. Algebra 1 and Honors\\/Adv. Geometry\"},{\"col1\":\"\\u201cB\\u201d or better in all math courses\"},{\"col1\":\"Completion of one college prep credit in science and English\"},{\"col1\":\"Recommended: Average G.P.A. of 2.75 for math, English, and science for three previous semesters\"},{\"col1\":\"Average 95% attendance for three previous semesters\"}]}},\"265\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Principles of electronics, robotics & programming\"},{\"col1\":\"Design and manufacturing processes\"},{\"col1\":\"Computer-aided design (CAD)\"},{\"col1\":\"Lab testing procedures\\/standards\"},{\"col1\":\"Polymers\"},{\"col1\":\"Principles of Applied Physics\"},{\"col1\":\"Academy mathematics level is based on previous courses:\"},{\"col1\":\"Algebra II or Adv\\/Hon Alg. II\"},{\"col1\":\"Pre-Calculus or Adv\\/Hon Pre-Calculus\"},{\"col1\":\"Calculus or AP Calculus AB (second year 2 only)\"},{\"col1\":\"College Prep English: research writing, literary analysis, technical writing\"}]}},\"266\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathways\",\"text\":[{\"col1\":\"Engineering: Aeronautical, biomedical, computer, electrical, environmental,  chemical, civil, corrosion, mechanical, petroleum, and welding \"},{\"col1\":\"Computer-Aided Design (CAD)\"},{\"col1\":\"Polymer Science\"},{\"col1\":\"Computer Programming\"},{\"col1\":\"Environmental Science\"},{\"col1\":\"Industrial Design\"},{\"col1\":\"and so much more!\"}]}},\"267\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Education Opportunities\",\"text\":[{\"col1\":\"College credits available - Students are eligible to earn 9 college credits through the University of Akron, Summit College.\"},{\"col1\":\"Associate\\u2019s degree\"},{\"col1\":\"Bachelor\\u2019s degree\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-11-13 02:09:58', '2017-11-13 02:09:58', '52488941-914d-4052-aa53-b63755f7c565'),
 ('477', '62', '3', '1', 'en_us', '7', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Business and Sports Management\",\"slug\":\"business-and-sports-management\",\"postDate\":1494433140,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>This College Tech Prep Initiative develops skills and knowledge in the field of business, sports management and marketing, human resource management, facilities and operations management, sales, and public relations. Students will acquire knowledge of business processes, economics and business relationships, finance, and accounting. &nbsp;&nbsp;Students will learn how to manage a workforce, lead change and build professional relationships with employees and customers. Students will utilize technology, software, and virtual simulations to prepare for careers in the business and sport management fields. &nbsp;Worksite and facility visits to professional, collegiate, and recreational sports and management will be integrated into the program. All students are provided opportunities for leadership development through the Business Professionals of America national student organization. College credit is available through university partnerships.<\\/p>\",\"11\":\"<p>Level I: &nbsp;CP English-1; Theory-1; Lab-1; and optional Capstone*-1<br><\\/p>\\r\\n<p>Level II: CP English-1; Theory-1; Lab-1; and optional Capstone*-1<\\/p>\",\"15\":[\"303\"],\"12\":\"10, 11, 12\",\"14\":\"Two years\",\"38\":[\"54\"],\"80\":\"\",\"35\":{\"224\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Sports Management\"},{\"col1\":\"Business Foundations\"},{\"col1\":\"Management and Administration Principles\"},{\"col1\":\"Fundamentals of Business and Administrative Services\"},{\"col1\":\"Human Resource Management\"},{\"col1\":\"Finance and Accounting\"},{\"col1\":\"Marketing, Sales, and Public Relations\"}]}},\"225\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":[{\"col1\":\"Front office positions in professional sports\"},{\"col1\":\"Athletic director in college and high school\"},{\"col1\":\"Team management\"},{\"col1\":\"Event and recreational management\"},{\"col1\":\"Sports marketing\"},{\"col1\":\"Human resource manager\"},{\"col1\":\"Franchising and ownership\"}]}},\"226\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher education opportunities\",\"text\":[{\"col1\":\"College credits available\"},{\"col1\":\"Associate\\u2019s degree\"},{\"col1\":\"Bachelor\\u2019s degree\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-11-13 02:12:30', '2017-11-13 02:12:30', 'ad704251-9d23-4a50-b69b-00cc179f33c2'),
 ('478', '64', '3', '1', 'en_us', '6', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Construction Technologies\",\"slug\":\"construction-technologies\",\"postDate\":1494433140,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Students interested in working hands on with machinery, hand and power tools and who want to learn skills they can use on-the-job or in their own home should consider being apart of this excellent program. &nbsp;Emphasis is placed on both rough and finished carpentry with introductions to plumbing, masonry, cabinetry and residential wiring. &nbsp;Working in the lab, students will learn by constructing with their hands in order to build a strong foundation for a career in the building trades. &nbsp;Students that have completed this course have entered apprenticeships, entered two-year and four-year college programs in Construction Technology, Construction Management, Surveying and Architecture, started their own construction businesses or worked as building and property maintenance personnel, as well as carpenters for contractors and builders.<br><\\/p>\\r\\n<p>In Level 1, students are introduced to many aspects of construction including remodeling, estimating, framing, roofing, exterior finishing, interior finishing, cabinets, countertops and trim work. By applying math, science, communication and team building skills, students construct real-life application projects in the spacious lab while also learning to operate a wide range of hand, power and air tools. Because the class focuses on residential construction, students learn to build from floor to roof, which helps prepare them for a career in the construction industry. The construction process introduces them to basic electrical, plumbing and masonry work. In Level II, students have the opportunity to complete a paid internship with contractors on actual<\\/p>\\r\\n<p>job sites. Completers of this program have entered apprenticeships, enrolled in two- and four-year colleges and worked for a contractor or builder as a carpenter. Many have even started their own construction business! Post-secondary credits available based on successful completion of the program and criteria set by the Ohio Department of Higher Education.<\\/p>\",\"11\":\"<p>Level I: CP or Comp English 1; Construction Tech IA (Construction Safety) 1.5; Construction Tech IB 1.5.<br><\\/p>\\r\\n<p>Level II: Construction Tech IIA 1.5; Construction Tech IIB 1.5. Optional Capstone* 1. (*Capstone includes project\\/problem-based learning opportunities that occur both in the building and at an external site. Students may combine classroom teaching with work experience.)<\\/p>\",\"15\":[\"303\"],\"12\":\"10, 11, 12\",\"14\":\"Two Years\",\"38\":[\"55\"],\"80\":\"\",\"35\":{\"268\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Construction technology\\u2014Core and sustainable construction\"},{\"col1\":\"Carpentry and masonry technical skills\"},{\"col1\":\"Structural systems\"},{\"col1\":\"Structural coverings and finishes\"}]}},\"269\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Skills Necessary for Success\",\"text\":[{\"col1\":\"Problem-solver\"},{\"col1\":\"Applied mathematics\"},{\"col1\":\"Able to visualize completed projects\"},{\"col1\":\"Ability to estimate and plan\"},{\"col1\":\"Use of hand and power tools\"},{\"col1\":\"Manual dexterity\"},{\"col1\":\"Safety awareness\"},{\"col1\":\"Designing and organization\"}]}},\"270\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":[{\"col1\":\"General contractor\\/Remodeler\"},{\"col1\":\"Mason\"},{\"col1\":\"Carpenter\"},{\"col1\":\"Cabinet maker\"},{\"col1\":\"Rough framer\"},{\"col1\":\"Plumber\"},{\"col1\":\"Electrician\"},{\"col1\":\"Roofer\"},{\"col1\":\"Maintenance technician\"},{\"col1\":\"Drywall installer\\/Plasterer\"},{\"col1\":\"Estimator\"},{\"col1\":\"Construction supervisor\"},{\"col1\":\"Property manager\"},{\"col1\":\"Building inspector\"},{\"col1\":\"Architect\"},{\"col1\":\"Construction manager\"},{\"col1\":\"Interior Designer\"}]}},\"271\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Educational Opportunities\",\"text\":[{\"col1\":\"College credits available. \"},{\"col1\":\"Associate\\u2019s degree\"},{\"col1\":\"Bachelor\\u2019s degree\"}]}},\"272\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Interest in constructing and remodeling homes\"},{\"col1\":\"Interest in construction management\"},{\"col1\":\"Read blueprints and apply designs\"},{\"col1\":\"Interest in interior design of homes\"}]}},\"273\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Recommendations\",\"text\":[{\"col1\":\"Excellent attendance record\"},{\"col1\":\"Minimum 2.5 GPA\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-11-13 02:12:40', '2017-11-13 02:12:40', '2dd9e417-63b5-445c-a954-d94407dde18b'),
 ('479', '60', '3', '1', 'en_us', '10', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Forestry and Landscape Management\",\"slug\":\"forestry-and-landscape-management\",\"postDate\":1494433080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Concerned about the environment? &nbsp;Interested in ecology? &nbsp;In Forestry and Landscape Management, students learn about scientific identification of trees and plants, as well as landscaping design, construction and maintenance. &nbsp;Students are prepared for further education in fields like Turf Management, Arboriculture, Landscape Construction or Nursery Management. &nbsp;College Prep English includes writing assignments about plant science, career opportunities in the \\u201cGreen Industry\\u201d and other industry-related topics.A strong advocate of problem based learning with an emphasis on authentic, hands on, science based application, John promotes, and executes realistic, fundamental lessons in a huge variety of project based learning applications in the Green Industry. Many activities are a variety of community service projects emphasising plant identification, landscape construction and maintenance, and tree and turfgrass propagation, growing, and health care. <br><br>Classes are taught outdoors as much as possible and educational field trips are added to create dynamics in learning. Some of the traveling a student may experience is ( but not limited to ), traveling to other schools to work with science classes, going to City, County, and State Parks, participating in invasive plant identification and eradication and helping to replace plant species with native material. Classes are also visiting forests and lumber mills, working on golf courses, visiting large and small landscape design and building firms, attending turfgrass commercial equipment sales events, developing relations in business by visiting plant propagation and greenhouse facilities, investigating tree care and landscape maintenance businesses, visiting plant pathology labs studying insect and diseases, looking at mechanical engineering and agricultural repair shops, making occasional trips to farms that produce fruits, vegetables, Christmas trees,row crops, and nursery production.<br><br>When class can not be held outdoors, indoor instruction is geared toward personal communication and marketing skills, plant fertility, soil science, plant identification, and hand\\/ power tool usage and repair.<br><br>Alumni of the program have &nbsp;gone on to have successful traditional Green Industry careers such as designing and managing golf courses, becoming entrepreneurs in landscape construction companies, turf grass and athletic field installation and maintenance, plant health care technicians, US Forest Service employees, Parks and Recreation managers, tree care, and even running plant pathology labs. &nbsp;<br>Others students have successfully taken other non traditional destinations after graduation such as investment bankers, ski area managers, performers in acrobatic gymnastics and climbing, NHRA crew chief to name a few.These students have all suggested &nbsp;that Forestry and Landscape class created the foundation in their lives for working as a team, understanding how to think and memorize, develop personal communication skills, time management, creative expression, and problem solving in difficult situations.<br><\\/p>\\r\\n<p>If you are interested in working outside with plants and turf, this program may be for you. &nbsp;If you complete the Forest and Landscape Management program, you could be employed in various careers found in the \\u201cGreen\\u201d industry. &nbsp;You will have an opportunity to study first hand, given a work-based experience, between three and five major fields of study during the first year of the program. &nbsp;In the second year, you will concentrate on one area, attending class for approximately 50 minutes a day and working three to four hours a day in your area of interest.<\\/p>\\r\\n<ul><li><p>Golf course management <\\/p><\\/li><li><p>Forestry<\\/p><\\/li><li><p>Urban Forestry<\\/p><\\/li><\\/ul>\",\"11\":\"<p>Level I \\u2013 English 1; Tech Theory 1; Lab 2;<br><\\/p>\\r\\n<p>Level II \\u2013 English 1; Tech Theory 1; Lab 3; Internship 1<\\/p>\",\"15\":[\"304\"],\"12\":\"10, 11, 12\",\"14\":\"Two years\",\"38\":[\"53\"],\"80\":\"\",\"35\":{\"217\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Program Time\",\"text\":[{\"col1\":\"Two years\"},{\"col1\":\"One period (50 minutes) of Technical Theory\"},{\"col1\":\"Three periods (170 minutes) of work-based experience\"}]}},\"218\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"General Working Conditions\",\"text\":[{\"col1\":\"Working indoors and\\/or outdoors\"}]}},\"219\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Areas of Concentration\",\"text\":[{\"col1\":\"Plant identification and selection\"},{\"col1\":\"Landscape maintenance, construction and design\"},{\"col1\":\"Environmental ecologyArboriculture (Tree Management)\"},{\"col1\":\"Turf management\"},{\"col1\":\"Equipment maintenance, operation and safety\"},{\"col1\":\"Garden center and nursery operations\"},{\"col1\":\"Greenhouse operations\"}]}},\"220\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Future Educational Opportunities\",\"text\":[{\"col1\":\"Two year college Associate Degree\"},{\"col1\":\"Four year Baccalaureate Degree\"},{\"col1\":\"School-to-work employment transitions\"},{\"col1\":\"Industry internships\"}]}},\"221\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Reading and math skills\"},{\"col1\":\"Problem solving skills\"},{\"col1\":\"Interest in creative design\"},{\"col1\":\"Interest in biological sciences and the environment\"}]}},\"222\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Additional Requirements\",\"text\":[{\"col1\":\"Communicate orally and in writing\"},{\"col1\":\"Good interpersonal relationships\"},{\"col1\":\"Good personal appearance and hygiene\"},{\"col1\":\"Positive work attitude\"},{\"col1\":\"Good organizational skills\"},{\"col1\":\"Consistent attendance\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-11-13 02:27:44', '2017-11-13 02:27:44', '7cce285f-17bd-45cb-adab-388f1d01cb7a'),
 ('480', '63', '3', '1', 'en_us', '4', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Marketing Management\",\"slug\":\"marketing-management\",\"postDate\":1494433140,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.<\\/p>\",\"11\":\"<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.<\\/p>\",\"15\":[\"303\"],\"12\":\"10\",\"14\":\"2\",\"38\":[\"54\"],\"80\":\"\",\"35\":\"\",\"13\":\"Kent\",\"75\":\"\"}}', '2017-11-13 02:34:21', '2017-11-13 02:34:21', '3c25b0ef-9a50-4ff7-b115-7510dbf97586'),
 ('481', '65', '3', '1', 'en_us', '6', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"Teaching Professions\",\"slug\":\"teaching-professions\",\"postDate\":1494433200,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"1\",\"57\":\"\",\"1\":\"<p>The Teaching Professions\\u2019 program is designed for students who are interested in a teaching, school administration, or guidance counseling career. &nbsp;This career pathway will help students learn more about future career options, while their field experience and coursework provide a solid foundation for a successful teaching career. &nbsp;Students will develop a professional portfolio that will summarize their field and classroom experiences. &nbsp;Due to the high percentage of teachers approaching retirement age in the next 5 years, it is estimated that more than 2.5 million teachers will be needed in the U.S. and about 57,000 K-12 openings in Ohio.<br><\\/p>\",\"11\":\"<p>2, plus one credit for Advanced English<\\/p>\",\"15\":[\"285\"],\"12\":\"10,11,12\",\"14\":\"Two years\",\"38\":[\"56\"],\"80\":\"\",\"35\":{\"229\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Skills Necessary for Success\",\"text\":[{\"col1\":\"Good communication skills\"},{\"col1\":\"Patience and ability to handle stress\"},{\"col1\":\"Ability to work with children and adults\"},{\"col1\":\"Love of learning and enthusiasm for teaching\"},{\"col1\":\"Organizational and managements kills\"}]}},\"230\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Professional Pathway\",\"text\":[{\"col1\":\"High school teacher\"},{\"col1\":\"Middle school teacher\"},{\"col1\":\"Elementary school teacher\"},{\"col1\":\"Special education teacher\"},{\"col1\":\"Sports instructor and coach\"},{\"col1\":\"School counselor\"},{\"col1\":\"Principals\\/school administrator\"},{\"col1\":\"Media specialist\"}]}},\"231\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Higher Educational Opportunities\",\"text\":[{\"col1\":\"College credits available at any state university in Ohio\"},{\"col1\":\"Bachelor\\u2019s degree\"},{\"col1\":\"Master\\u2019s degree\"}]}},\"232\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Helpful Background\",\"text\":[{\"col1\":\"Interest in working with people\"},{\"col1\":\"Volunteer teaching and coaching experiences\"}]}},\"233\":{\"type\":\"programOverview\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Recommendations\",\"text\":[{\"col1\":\"Excellent attendance record\"},{\"col1\":\"Minimum 2.5 GPA\"},{\"col1\":\"Honors or Advanced English\"}]}}},\"13\":\"Kent\",\"75\":\"\"}}', '2017-11-13 02:34:30', '2017-11-13 02:34:30', 'b96aee4c-aec9-4396-9d67-ab350f93f3c9');
