 ('64', 'field', '1', 'en_us', ' students interested in working hands on with machinery hand and power tools and who want to learn skills they can use on the job or in their own home should consider being apart of this excellent program emphasis is placed on both rough and finished carpentry with introductions to plumbing masonry cabinetry and residential wiring working in the lab students will learn by constructing with their hands in order to build a strong foundation for a career in the building trades students that have completed this course have entered apprenticeships entered two year and four year college programs in construction technology construction management surveying and architecture started their own construction businesses or worked as building and property maintenance personnel as well as carpenters for contractors and builders in level 1 students are introduced to many aspects of construction including remodeling estimating framing roofing exterior finishing interior finishing cabinets countertops and trim work by applying math science communication and team building skills students construct real life application projects in the spacious lab while also learning to operate a wide range of hand power and air tools because the class focuses on residential construction students learn to build from floor to roof which helps prepare them for a career in the construction industry the construction process introduces them to basic electrical plumbing and masonry work in level ii students have the opportunity to complete a paid internship with contractors on actual job sites completers of this program have entered apprenticeships enrolled in two and four year colleges and worked for a contractor or builder as a carpenter many have even started their own construction business post secondary credits available based on successful completion of the program and criteria set by the ohio department of higher education '),
