 ('60', 'field', '1', 'en_us', ' concerned about the environment interested in ecology in forestry and landscape management students learn about scientific identification of trees and plants as well as landscaping design construction and maintenance students are prepared for further education in fields like turf management arboriculture landscape construction or nursery management college prep english includes writing assignments about plant science career opportunities in the green industry and other industry related topics a strong advocate of problem based learning with an emphasis on authentic hands on science based application john promotes and executes realistic fundamental lessons in a huge variety of project based learning applications in the green industry many activities are a variety of community service projects emphasising plant identification landscape construction and maintenance and tree and turfgrass propagation growing and health care classes are taught outdoors as much as possible and educational field trips are added to create dynamics in learning some of the traveling a student may experience is but not limited to traveling to other schools to work with science classes going to city county and state parks participating in invasive plant identification and eradication and helping to replace plant species with native material classes are also visiting forests and lumber mills working on golf courses visiting large and small landscape design and building firms attending turfgrass commercial equipment sales events developing relations in business by visiting plant propagation and greenhouse facilities investigating tree care and landscape maintenance businesses visiting plant pathology labs studying insect and diseases looking at mechanical engineering and agricultural repair shops making occasional trips to farms that produce fruits vegetables christmas trees row crops and nursery production when class can not be held outdoors indoor instruction is geared toward personal communication and marketing skills plant fertility soil science plant identification and hand power tool usage and repair alumni of the program have gone on to have successful traditional green industry careers such as designing and managing golf courses becoming entrepreneurs in landscape construction companies turf grass and athletic field installation and maintenance plant health care technicians us forest service employees parks and recreation managers tree care and even running plant pathology labs others students have successfully taken other non traditional destinations after graduation such as investment bankers ski area managers performers in acrobatic gymnastics and climbing nhra crew chief to name a few these students have all suggested that forestry and landscape class created the foundation in their lives for working as a team understanding how to think and memorize develop personal communication skills time management creative expression and problem solving in difficult situations if you are interested in working outside with plants and turf this program may be for you if you complete the forest and landscape management program you could be employed in various careers found in the green industry you will have an opportunity to study first hand given a work based experience between three and five major fields of study during the first year of the program in the second year you will concentrate on one area attending class for approximately 50 minutes a day and working three to four hours a day in your area of interest golf course management forestryurban forestry '),
