 ('99', 'field', '1', 'en_us', ' terry slattery is the primary instructor for both the level i and level ii athletic health care and fitness career technical education program at theodore roosevelt high school he has lead this 2 yr program since its design and inception into the six district educational compact in 1997 over 400 students have completed the 2 yr program requirements with approximately 80% of these graduates currently working or studying within the field of health care today terry received his b s in health education and athletic training from bowling green state university he has completed graduate credit hours at both central michigan university and kent state university terry also serves as the head athletic trainer for all of the roosevelt rough rider athletic teams he was awarded the 2013 ohio athletic trainers association oata linda weber daniels student mentorship award for his work with high school students interested in health care professions he was also recognized by the oata in 2003 as the ohio high school athletic trainer of the year and a special consideration award for successfully performing cpr on an unresponsive person at a kent state university basketball game slattery has collaborated with the six district educational compact kent state university university of akron slippery rock university and the ohio department of education in curricular design and assessment testing he and his students have also worked with northeast medical university neomed and americorp on a number of educational projects and was recognized as the 2016 health professions affinity community hpac teacher of the year slattery was also honored by the kent city schools as an emilio ferrara service award winner in 2014 a strong advocate for hands on inquiry based problem solving he works hard with his students to provide them with a variety of tools to make learning enjoyable and applicable to their personal needs and objectives '),
