 ('100', 'field', '1', 'en_us', ' ben dunlap received a b a in business education and a m a in sports administration both from kent state university he currently teaches the business and sports management program at theodore roosevelt high school in kent ohio a strong advocate of hands on inquiry based learning he involves his students in a variety of community service problem solving and technology infused activities that provide them with opportunities to use their expanding business knowledge and skills to work through various virtual businesses his professional interests focus on ensuring all of his students understand the vast opportunities available to them in the sports management field in addition he serves as department chairperson for the career and technical education department at roosevelt as well as faculty manager for its athletic department '),
