 ('101', 'field', '1', 'en_us', ' troy spear is level i instructor for the computer aided design and engineering technologies career technical program at theodore roosevelt high school mr spear is the sole instructor for the elective courses fundamentals of wood and metal manufacturing and advanced cabinetry he received his master of arts in industrial technology from kent state university after completing his undergraduate b a degrees in english speech theatre and education from the university of sioux falls in sioux falls south dakota spear is also a member of the society of manufacturing engineers the cabinetmakers association woodwork career alliance and skills usa his commitment to hands on inquiry based problem solving and learning fosters an active learning environment where students are physically engaged in the work that they are learning about be it setting up and operating machines making accurate technical drawings and renderings or writing programs to run on the cad engineering tech programs cnc machines spear s goal is that his students demonstrate knowledge and the application of real world knowledge they gain to solve tomorrow s problems he states that if students can dream it we can show them how to draw it design it prototype it machine it put it together and make it work '),
