 ('104', 'field', '1', 'en_us', ' danielle wardell received her cosmetology license in 2005 from theodore roosevelt high school and then her bachelor s degree in spanish education from the university of akron in 2010 after six years teaching spanish danielle changed professions returned to trhs and is currently the senior level cosmetology instructor she is a strong believer in hands on kinesthetic learning she believes that communication is one of the most valuable skills in the salon and she focuses much of her teaching to that skill another valuable skill she tries to convey to her students is the importance of the community danielle s students perform hair skin and nail services on members of the community at rider salon as well as sponsor a craft show every november for the city of kent danielle is also an active member of theodore roosevelt high school acting as the junior class advisor and silent auction chair '),
