 ('105', 'field', '1', 'en_us', ' jeff lesueur is an electronics instructor at theodore roosevelt high school in kent ohio he teaches both an engineering class and a traditional career education class jeff holds degrees in electrical engineering cleveland state university and a master s of education john carroll university he believes that teachers must use materials that engage the students lessons should be directly applicable to the real world and skills should be developed that are useful in life and employable this must be done while still finding and inventing lessons that are interesting to students many materials should be used project kits videos programming field trips student centered activities as well as traditional lab experiments and theory lessons should be evaluated for success regularly and updated frequently this philosophy led jeff to the design of the awesome cube and other innovative lessons prior to teaching jeff worked in the telecommunications industry as a systems engineer sales engineer and consultant for several companies including fujitsu nasa american greetings and general datacomm jeff has many interests he is a performing jazz guitarist equity investor golfer skier boater and biker '),
