 ('114', 'field', '1', 'en_us', ' john lang an instructor for forestry and landscape management received a degree in horticulture from ohio state is a certified arborist from the international society of arboriculture is a certified commercial pesticide applicator from the ohio department of agriculture and holds a class a commercial driver s license from the ohio bureau of motor vehicles and owner and operator of mogul creek farms in kent ohio lang is also involved in the united states ski association he is a nationally certified alpine and nordic ski instructor examiner emeritus he is starting his thirty fourth year in marketing and sales for volkl skis marker bindings and dalbello ski boots he alo is a certified ski mechanic boot fitter and sponsored skier many students have supplemented their employment in the snowsports industry by taking lang s class lang is also an accomplished percussionist playing drums and singing for several rock and jazz fusion bands over the last forty years '),
