 ('115', 'field', '1', 'en_us', ' catie milton received her bsn bachelor of science in nursing and med master of education from kent state university and is currently one of the instructors for the health careers technologies program at kent roosevelt high school catie is a certified american heart association instructor and teaches cpr when she is not teaching catie cares for infants and their families at university hospital s rainbow babies children s hospital as an rn on the nicu step down and nicu she has also worked in akron children s hospital nicu and at the hattie larlham foundation as a nursing supervisor as a registered nurse catie is uniquely qualified to bring current skills and practices into the classroom setting the classes she teaches principles of allied health and nursing and patient centered care consist of both theory and lab activities where students can apply what they have learned using up to date medical equipment found in hospitals and other healthcare facilities as part of the health careers program catie is the advisor for the health careers tech club and assists students in planning and implementing many service projects that benefit the local community such as creating quilts for patients undergoing chemotherapy helping with the red cross blood drive and raising money for the northeastern ohio leukemia and lymphoma society catie lives in brimfield ohio and is an active member of newman center parish she volunteers at the kent soup kitchen and with uh community partners at various events such as the cleveland brown s camp and boo at the zoo in cleveland '),
