 ('116', 'field', '1', 'en_us', ' angela is an instructor for health careers technoligies angela started her career at theodore roosevelt high school in the fall of 2011 prior to coming to kent roosevelt angela was a staff member in the athletic training department at kent state university during her time at kent state she worked primarily with women s gymnastics cross country and softball while also serving as the insurance coordinator for athletics angela has a vast amount of clinical experience and was a staff member of crystal clinic inc as an orthopaedic physician assistant for 11 years her primary responsibilities were assisting william pakan md with the evaluation and treatment of patients as well as assisting in the operating room for outpatient procedures angela received her bachelors of arts in education in 1993 from kent state university and a master s degree in career technical education in 2013 angela is an approved clinical instructor and is an instructor in cpr first aid aed training '),
