 ('117', 'field', '1', 'en_us', ' brent pfeiffer a life long resident of kent ohio is a third generation marketing educator and deca advisor brent is a 1989 graduate of theodore roosevelt high school in kent and a 1994 graduate of kent state university pfeiffer also received his m ed in 2004 from kent state upon graduating from kent brent used his marketing degree to pursue a career in sales working with john hancock financial services and mci telecommunications before following the family legacy of teaching after his father s untimely death in 1995 pfeiffer s grandfather paul was an emeritus marketing professor at kent state university and his great uncle kenneth paul s brother was the state supervisor of distributive education and deca in pennsylvania for most of his career brent s father richard founded roosevelt s award winning marketing and deca program in 1967 during brent s tenure the program has grown from a one year program to a two year program that has been internationally recognized as one of the top programs for entrepreneurial studies during his 20 year tenure pfeiffer s students have raised close to $500 000 for school community and philanthropic projects throughout his career pfeiffer has worn many hats he has worked as an assistant golf professional at area golf courses for 15 years and has coached golf at roosevelt for 18 years where he led the rough riders to seven consecutive league titles brent is also an assistant ice hockey coach at roosevelt where he just finished his tenth season as an assistant with the team he currently works part time for the taylormade golf company in outside sales with his twin brother david pfeiffer has also spent time as an adjunct professor in kent state s center for entrepreneurship and business innovation where he served as an advisor for kent state s chapter of ceo the collegiate entrepreneurs organization during his six year tenure in the college of business pfeiffer was twice nominated by his students for the part time distinguished teaching award brent also worked as a small business advisor in the entrepreneurship lab at the center for entrepreneurship assisting student entrepreneurs with their student run businesses pfeiffer has also taught adjunct in the college of education at kent state as well committed to public service pfeiffer has volunteered on numerous boards including fifteen years on the ohio deca executive council and board of directors three years on the kent cyclones youth hockey board of directors and is currently on the advisory board for kent state s launchnet an entrepreneurial initiative that provides counseling to students faculty and alumni looking to bring ideas inventions and businesses to life pfeiffer has also served on ohio department of education curriculum and assessment boards to develop the statewide entrepreneurship curriculum standards and testing most recently he has served on an international panel of teachers and professors for deca s competitive events task force which was tasked with the revision addition modification and improvement of deca s entrepreneurship events brent and his wife of 23 years erika reside in kent with their two children paige and coulter '),
